	'use strict';module.exports=[{airportCode:'ABR',cityName:'Aberdeen, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Aberdeen,_South_Dakota',imgUrl:undefined,imgDescription:undefined,cityDescription:'Aberdeen  is a city in and the county seat of Brown County, South Dakota, United States, about 125 miles  northeast of Pierre. The city population was 26,091 at the 2010 census, making it the third largest city in the state. Aberdeen is the principal city of the Aberdeen Micropolitan Statistical Area, which includes all of Brown and Edmunds counties and has a population of 40,602 in 2010. Aberdeen is the home of Northern State University and Presentation College.'},{airportCode:'ABI',cityName:'Abilene, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Abilene,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cb/Abilene_from_the_Enterprise_Building.jpg/275px-Abilene_from_the_Enterprise_Building.jpg',imgDescription:'Downtown Abilene in 2015',cityDescription:'Abilene  is a city in Taylor and Jones counties in west central Texas, United States. The population was 117,063 according to the 2010 census making it the twenty-seventh most populous city in the state of Texas. It is the principal city of the Abilene Metropolitan Statistical Area, which had a 2011 estimated population of 166,416. It is the county seat of Taylor County. Dyess Air Force Base is located on the west side of the city.'},{airportCode:'CAK',cityName:'Akron, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Akron,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4a/AkronOhioSky.jpg/250px-AkronOhioSky.jpg',imgDescription:'AkronOhioSky.jpg',cityDescription:'Akron  is the fifth-largest city in the U.S. state of Ohio and is the county seat of Summit County. It is in the Great Lakes region approximately 39 miles  south of Lake Erie along the Little Cuyahoga River. As of the 2010 census, the city had a population of 199,110. The Akron, OH Metropolitan Statistical Area  covers Summit and Portage counties, and in 2010 had a population of 703,200. Akron is also part of the larger Cleveland-Akron-Canton, OH Combined Statistical Area, which in 2010 had a population of 3,515,646.'},{airportCode:'ALS',cityName:'Alamosa, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Alamosa,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4f/Alamosa%2C_Colorado.JPG/275px-Alamosa%2C_Colorado.JPG',imgDescription:'Entering from the east',cityDescription:'The City of Alamosa is the Home Rule Municipality that is the county seat and the most populous municipality of Alamosa County, Colorado, United States. The city population was 8,780 at the 2010 United States Census. The city is the commercial center of the San Luis Valley in south-central Colorado, and is the home of Adams State University.'},{airportCode:'ABY',cityName:'Albany, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Albany,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Albany_Government_Center.jpg/250px-Albany_Government_Center.jpg',imgDescription:'The Albany Government Center',cityDescription:'Albany is a city in the U.S. state of Georgia and the seat of Dougherty County. Located in southwest Georgia, it is the principal city of the Albany, Georgia metropolitan area. The population was 77,434 at the 2010 U.S. Census, making it the eighth-largest city in Georgia.'},{airportCode:'ALB',cityName:'Albany, New York',wikiUrl:'https://en.wikipedia.org/wiki/Albany,_New_York',imgUrl:undefined,imgDescription:undefined,cityDescription:'Albany  is the capital of the U.S. state of New York and the seat of Albany County. Roughly 150 miles  north of the City of New York, Albany developed on the west bank of the Hudson River, about 10 miles  south of its confluence with the Mohawk River. The population of the City of Albany was 97,856 according to the 2010 census. Albany constitutes the economic and cultural core of the Capital District of New York State, which comprises the Albany-Schenectady-Troy, NY Metropolitan Statistical Area, including the nearby cities and suburbs of Troy, Schenectady, and Saratoga Springs. With a Census-estimated population of 1,170,483 in 2013, the Capital District is the third most populous metropolitan region in the state and 38th in the United States.'},{airportCode:'ABQ',cityName:'Albuquerque, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Albuquerque,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Albuquerque_Infobox_Photo.png/255px-Albuquerque_Infobox_Photo.png',imgDescription:'Balloon Fiesta,  Downtown Albuquerque  Alvarado Center, Sandia Peak Tramway San Felipe de Neri Church, Rio Grande Wetlands.',cityDescription:'Albuquerque  is the most populous city in the U.S. state of New Mexico. The high-altitude city serves as the county seat of Bernalillo County, and it is situated in the central part of the state, straddling the Rio Grande. The city population is 557,169 as of the July 1, 2014, population estimate from the United States Census Bureau, and ranks as the 32nd-largest city in the U.S. The Albuquerque Metropolitan Statistical Area  has a population of 902,797 according to the United States Census Bureau\'s most recently available estimate for July 1, 2013. Albuquerque is the 59th-largest United States metropolitan area. The Albuquerque MSA population includes the city of Rio Rancho, Bernalillo, Placitas, Corrales, Los Lunas, Belen, Bosque Farms, and forms part of the larger Albuquerque  Santa Fe  Las Vegas combined statistical area, with a total population of 1,163,964 as of the July 1, 2013 Census Bureau estimates.'},{airportCode:'AEX',cityName:'Alexandria, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Alexandria,_Louisiana',imgUrl:undefined,imgDescription:undefined,cityDescription:'Alexandria is a city in and the parish seat of Rapides Parish, Louisiana, United States. It lies on the south bank of the Red River in almost the exact geographic center of the state. It is the principal city of the Alexandria metropolitan area  which encompasses all of Rapides and Grant parishes. Its neighboring city is Pineville. In 2010, the population was 47,723, an increase of 3 percent from the 2000 census.'},{airportCode:'ABE',cityName:'Allentown, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Allentown,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Allentown_PA_Photo_Collage.jpg/295px-Allentown_PA_Photo_Collage.jpg',imgDescription:'Allentown PA Photo Collage.jpg',cityDescription:'Allentown  is a city located in Lehigh County, Pennsylvania, United States. It is Pennsylvania\'s third most populous city and the 226th largest city in the United States. As of the 2010 census, the city had a total population of 118,032 and is currently the fastest growing city in all of Pennsylvania. It is the largest city in the metropolitan area known as the Lehigh Valley, which had a population of 821,623 residents as of 2010. It constitutes a portion of the New York City Metropolitan Area and is the county seat of Lehigh County. In 2012, the city celebrated the 250th anniversary of its founding in 1762.'},{airportCode:'AIA',cityName:'Alliance, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Alliance,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/Alliance%2C_Nebraska_2nd_and_Box_Butte_looking_N.jpg/250px-Alliance%2C_Nebraska_2nd_and_Box_Butte_looking_N.jpg',imgDescription:'Downtown Alliance: Box Butte Avenue',cityDescription:'Alliance is a city in Box Butte County, in the northwestern part of the state of Nebraska, in the Great Plains region of the United States. Its population was 8,491 at the 2010 census. It is the county seat of Box Butte County.'},{airportCode:'APN',cityName:'Alpena, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Alpena,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/17/Lighthouse_at_Alpena_MI_2005-09.jpeg/250px-Lighthouse_at_Alpena_MI_2005-09.jpeg',imgDescription:'The Alpena Light at the Alpena Municipal Marina',cityDescription:'Alpena  is a city in the U.S. state of Michigan and the county seat of Alpena County. It is considered to be part of northern Michigan. The Thunder Bay National Marine Sanctuary is located in the city. The population was 10,483 at the 2010 census. The population swells with a large number of visitors in the summer.'},{airportCode:'AOO',cityName:'Altoona, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Altoona,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Altoona_Downtown_from_Brush_Mountain.jpg/250px-Altoona_Downtown_from_Brush_Mountain.jpg',imgDescription:'Skyline of Altoona, Pennsylvania',cityDescription:'Altoona is a city in central Pennsylvania Blair County, Pennsylvania, United States. It is the principal city of the Altoona Metropolitan Statistical Area . The population was 46,320 at the time of the 2010 Census, making it the tenth most populous city in Pennsylvania. The Altoona MSA includes all of Blair County and was recorded as having a population of 127,089 at the 2010 Census, around 100,000 of which live within a 5-mile  radius of the Altoona city center according to U.S. Census zip code population data. This includes the adjacent boroughs of Hollidaysburg and Duncansville, adjacent townships of Logan, Allegheny, Blair, Frankstown, Antis, and Tyrone, as well as nearby boroughs of Bellwood and Newry.'},{airportCode:'AMA',cityName:'Amarillo, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Amarillo,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Amarillo_Texas_Downtown.jpg/250px-Amarillo_Texas_Downtown.jpg',imgDescription:'Downtown Amarillo',cityDescription:'Amarillo  is the fourteenth most populous city in the state of Texas, also the largest city in the Texas Panhandle, and the seat of Potter County. A portion of the city extends into Randall County. The population was 190,695 at the 2010 census . The Amarillo metropolitan area has an estimated population of 236,113 in four counties.'},{airportCode:'ANC',cityName:'Anchorage, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Anchorage,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4a/Anchorage_on_an_April_evening.jpg/250px-Anchorage_on_an_April_evening.jpg',imgDescription:'Anchorage skyline and Bootleggers Cove as photographed from Point Woronzof Park on an April evening.',cityDescription:'Anchorage  is a unified home rule municipality in the U.S. State of Alaska. With an estimated 300,950 residents in 2013, it is Alaska\'s most populous city and contains more than 40 percent of the state\'s total population; among the 50 states, only New York has a higher percentage of residents who live in its most populous city. All together, the Anchorage metropolitan area, which combines Anchorage with the neighboring Matanuska-Susitna Borough, had a population of 396,142 in 2013.'},{airportCode:'ATW',cityName:'Appleton, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Appleton,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7a/Appleton_Skyline_Panorama.JPG/250px-Appleton_Skyline_Panorama.JPG',imgDescription:'Downtown Appleton skyline',cityDescription:'Appleton is a city in Outagamie , Calumet, and Winnebago counties in the U.S. state of Wisconsin. One of the Fox Cities, it is situated on the Fox River, 30 miles  southwest of Green Bay and 100 miles  north of Milwaukee. Appleton is the county seat of Outagamie County. The population was 72,623 at the 2010 census. Of this, 60,045 were in Outagamie County, 11,088 in Calumet County, and 1,490 in Winnebago County. Appleton is the principal city of the Appleton, Wisconsin Metropolitan Statistical Area, which is included in the Appleton-Oshkosh-Neenah, Wisconsin Combined Statistical Area.'},{airportCode:'AVL',cityName:'Asheville, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Asheville,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5e/Asheville_Downtown_panorama.jpg/250px-Asheville_Downtown_panorama.jpg',imgDescription:'Downtown Asheville and surrounding area',cityDescription:'Asheville is a city in and the county seat of Buncombe County, North Carolina, United States. It is the largest city in Western North Carolina, and the 11th largest city in North Carolina. The city\'s population was 83,393 according to the 2010 United States census. It is the principal city in the four-county Asheville metropolitan area, with a population of 424,858 in 2010. Asheville is home to the United States National Climatic Data Center , the world\'s largest active archive of weather data.'},{airportCode:'ASE',cityName:'Aspen, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Aspen,_Colorado',imgUrl:undefined,imgDescription:undefined,cityDescription:'The City of Aspen is the Home Rule Municipality that is the county seat and the most populous municipality of Pitkin County, Colorado, United States. The city population was 6,658 at the 2010 United States Census. Aspen is situated in a remote area of the Rocky Mountains\' Sawatch Range and Elk Mountains, along the Roaring Fork River at an elevation just below 8,000 feet  above sea level on the Western Slope, 11 miles  west of the Continental Divide.'},{airportCode:'AHN',cityName:'Athens, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Athens,_Georgia',imgUrl:undefined,imgDescription:undefined,cityDescription:'Athens  is a consolidated citycounty in the U.S. state of Georgia, in the northeastern part of the state, comprising the former city of Athens proper  and Clarke County. The University of Georgia, the state\'s flagship public research university, is located in this college town, and contributed to its initial growth. In 1991, after a vote the preceding year, the original city abandoned its charter to form a unified government with Clarke County, referred to jointly as Athens-Clarke County. As of the 2010 census, the consolidated city-county  had a total population of 115,452; all of Clarke County had a population of 116,714. Athens is the sixth-largest city in Georgia, and the principal city of the Athens-Clarke County, Georgia Metropolitan Statistical Area, which had a population of 192,541 as of the 2010 census. Athens-Clarke County has the smallest geographical area of a county in Georgia.'},{airportCode:'ATL',cityName:'Atlanta, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Atlanta,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/Atlanta_Montage_2.jpg/300px-Atlanta_Montage_2.jpg',imgDescription:'From top to bottom left to right: Atlanta skyline seen from Buckhead, the Fox Theatre, the Georgia State Capitol, Centennial Olympic Park, Millennium Gate, the Canopy Walk, the Georgia Aquarium, The Phoenix statue, and the Midtown skyline',cityDescription:'Atlanta is the capital of and the most populous city in the U.S. state of Georgia, with an estimated 2013 population of 447,841. Atlanta is the cultural and economic center of the Atlanta metropolitan area, home to 5,522,942 people and the ninth largest metropolitan area in the United States. Atlanta is the county seat of Fulton County, and a small portion of the city extends eastward into DeKalb County.'},{airportCode:'ACY',cityName:'Atlantic City, New Jersey',wikiUrl:'https://en.wikipedia.org/wiki/Atlantic_City,_New_Jersey',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Atlantic_City_skyline_from_47th_floor_of_Revel.jpg/250px-Atlantic_City_skyline_from_47th_floor_of_Revel.jpg',imgDescription:'Atlantic City skyline from 47th floor of Revel',cityDescription:'Atlantic City is a resort city in Atlantic County, New Jersey, known for its casinos, boardwalk and beach. In 2010, it had a population of 39,558.'},{airportCode:'AGS',cityName:'Augusta, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Augusta,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8a/Augusta_Georgia_Broad_Street_Lamar_Building.jpg/266px-Augusta_Georgia_Broad_Street_Lamar_Building.jpg',imgDescription:'Downtown Augusta on Broad Street',cityDescription:'AugustaRichmond County US  is a consolidated city-county in the U.S. state of Georgia, located at the fall line of the Savannah River, at the head of its navigable portion.'},{airportCode:'AUG',cityName:'Augusta, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Augusta,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/92/Augusta%2C_Maine_2.jpg/240px-Augusta%2C_Maine_2.jpg',imgDescription:'Kennebec River flowing past downtown Augusta in September 2006',cityDescription:'Augusta is the capital of the U.S. state of Maine and the county seat of Kennebec County.'},{airportCode:'AUS',cityName:'Austin, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Austin,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Austin_Evening.jpg/250px-Austin_Evening.jpg',imgDescription:'Downtown skyline as seen from  Lady Bird Lake',cityDescription:'Austin  is the capital of the US state of Texas and the seat of Travis County. Located in Central Texas, Austin is the 11th-most populous city in the United States and the fourth-most populous city in Texas. It is the fastest growing of the largest 50 US cities. Austin is also the second largest state capital in the United States, after Phoenix, Arizona. As of July 1, 2014, Austin had a population of 912,791 . The city is the cultural and economic center of the AustinRound Rock metropolitan area, which had an estimated population of 1,943,299 as of July 1, 2014.'},{airportCode:'BFL',cityName:'Bakersfield, California',wikiUrl:'https://en.wikipedia.org/wiki/Bakersfield,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/BakersfieldSkyline.jpg/250px-BakersfieldSkyline.jpg',imgDescription:'Bakersfield skyline at night with the Rabobank Arena in the foreground.',cityDescription:'Bakersfield is a city in Southern California, United States near the southern end of the San Joaquin Valley in Kern County. The city is 110 mi  north of Los Angeles and about the same distance south of Fresno. It is an inland city about 135 mi  east of Pismo Beach on the Pacific Ocean. Bakersfields population is around 375,000, making it the 9th largest city in California and the 52nd largest city in the United States. The city is also the county seat for Kern County, which encompasses the entire MSA and is the third largest county in California by area. The total Bakersfield inner urban area, which includes East Bakersfield and Rosedale, has a population of about 464,000.'},{airportCode:'BWI',cityName:'Baltimore, Maryland',wikiUrl:'https://en.wikipedia.org/wiki/Baltimore,_Maryland',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/BaltimoreC12.png/250px-BaltimoreC12.png',imgDescription:'Downtown Baltimore, Emerson Bromo-Seltzer Tower, Pennsylvania Station, M&T Bank Stadium, (Baltimore Ravens Stadium), Inner Harbor and the National Aquarium in Baltimore, Baltimore City Hall, Washington Monument',cityDescription:'Baltimore  is the largest city in the U.S. state of Maryland, and the 26th-most populous city in the country. It is the largest independent city in the United States. Baltimore has more public monuments than any other city per capita in the country and is home to some of the earliest National Register historic districts in the nation, including Fell\'s Point , Federal Hill  and Mount Vernon Place . More than 65,000 properties, or roughly one in three buildings in the city, are listed on the National Register, more than any other city in the nation.'},{airportCode:'BGR',cityName:'Bangor, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Bangor,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ad/BangorSkyline.jpg/250px-BangorSkyline.jpg',imgDescription:'Bangor skyline',cityDescription:'Bangor  is a city in the U.S. state of Maine. The city proper has a population of 33,039, while the metropolitan Bangor metropolitan area has a population of 153,746.'},{airportCode:'BHB',cityName:'Bar Harbor, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Bar_Harbor,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/92/Main_Street_Bar_Harbor.jpg/250px-Main_Street_Bar_Harbor.jpg',imgDescription:'Main Street in Bar Harbor (2008)',cityDescription:'Bar Harbor is a town on Mount Desert Island in Hancock County, Maine, United States. As of the 2010 census, its population is 5,235. Bar Harbor is a popular tourist destination in the Down East region of Maine and home to the College of the Atlantic, Jackson Laboratory, and MDI Biological Laboratory . Prior to a catastrophic 1947 fire the town was a famous summer colony for the super-affluent elite. Bar Harbor is home to the largest parts of Acadia National Park, including Cadillac Mountain, the highest point within twenty-five miles  of the coastline of the Eastern United States. The town is served by the Hancock County-Bar Harbor Airport which has flights on Cape Air and PenAir to Boston.'},{airportCode:'BRW',cityName:'Barrow, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Barrow,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/Barrow_Alaska.jpg/250px-Barrow_Alaska.jpg',imgDescription:'The city of Barrow, Alaska in July 2008.',cityDescription:'Barrow   is the largest city of the North Slope Borough in the U.S. state of Alaska and is located above the Arctic Circle. It is the 11th northernmost public community in the world and is the northernmost city in the United States of America, with nearby Point Barrow being the nation\'s northernmost point.'},{airportCode:'BTR',cityName:'Baton Rouge, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Baton_Rouge,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b2/Baton_Rouge_Louisiana_waterfront_aerial_view.jpg/250px-Baton_Rouge_Louisiana_waterfront_aerial_view.jpg',imgDescription:'Baton Rouge waterfront',cityDescription:'Baton Rouge ) is the capital of the U.S. state of Louisiana and its second-largest city. The seat of East Baton Rouge Parish, the city is located on the eastern bank of the Mississippi River.'},{airportCode:'BPT',cityName:'Beaumont, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Beaumont,_Texas',imgUrl:undefined,imgDescription:undefined,cityDescription:'Beaumont  is a city in and county seat of Jefferson County, Texas, United States, within the BeaumontPort Arthur Metropolitan Statistical Area. Located on the Neches River and about 90 miles from Houston, the city had a population of 118,296 at the 2010 census making it the twenty-fourth most populous city in the state of Texas.'},{airportCode:'BKW',cityName:'Beckley, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Beckley,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5a/Beckley_Main_Street.jpg/250px-Beckley_Main_Street.jpg',imgDescription:'Main Street in downtown Beckley in 2007.',cityDescription:'Beckley is a city and county seat of Raleigh County located in West Virginia, United States. It was founded on April 4, 1838. Beckley was named in honor of John James Beckley, who was the first Clerk of the House of Representatives and the first Librarian of Congress. It was founded by his son Alfred Beckley . The current mayor is Bill O\'Brien'},{airportCode:'BED',cityName:'Bedford, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Bedford,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/Boston_and_Maine_6211%2C_Bedford_Depot%2C_Bedford_MA.jpg/250px-Boston_and_Maine_6211%2C_Bedford_Depot%2C_Bedford_MA.jpg',imgDescription:'Bedford Depot',cityDescription:'Bedford is a town in Middlesex County, Massachusetts, United States. It is within the Greater Boston area, 15 miles  north-west of the city of Boston. The population of Bedford was 13,320 at the 2010 census.'},{airportCode:'BLI',cityName:'Bellingham, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Bellingham,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/Aerial_View_of_Bellingham%2C_Washington.jpg/250px-Aerial_View_of_Bellingham%2C_Washington.jpg',imgDescription:'Aerial View of Bellingham, Washington.jpg',cityDescription:'Bellingham  is the largest city in, and the county seat of, Whatcom County in the State of Washington, United States. It is the thirteenth-largest city in the state, with 80,885 residents at the 2010 Census, or sixth-largest by metropolitan area after Seattle-Tacoma, Spokane, the northern side of the Portland metropolitan area, the Tri-Cities, and Yakima. The boundaries of the city encompass the former towns of Fairhaven, Whatcom, Sehome, and Bellingham.'},{airportCode:'BJI',cityName:'Bemidji, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Bemidji,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/71/Paul_Bunyan_and_Babe_statues_Bemidji_Minnesota_crop.JPG/250px-Paul_Bunyan_and_Babe_statues_Bemidji_Minnesota_crop.JPG',imgDescription:'Statues of Paul Bunyan and Babe the Blue Ox',cityDescription:'Bemidji  is a city in Beltrami County , in north west Minnesota, United States. With a population of 13,431 at the 2010 census, it is the largest commercial center between Grand Forks, North Dakota and Duluth, Minnesota. Bemidji houses many Native American services, which includes the Indian Health Service. The city is the central hub of the Red Lake Indian Reservation, White Earth Indian Reservation and the Leech Lake Indian Reservation. Bemidji lies on the south west shore of Lake Bemidji, the northernmost lake feeding the Mississippi River and as such is deemed "the first city on the Mississippi." Bemidji is also called the "curling capital" of the U.S.'},{airportCode:'BET',cityName:'Bethel, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Bethel,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f0/Bethel_Alaska_aerial_view.jpg/250px-Bethel_Alaska_aerial_view.jpg',imgDescription:'Aerial view of Bethel on the Kuskokwim River',cityDescription:'Bethel  is a city located near the west coast of the U.S. state of Alaska, approximately 400 miles  west of Anchorage. Accessible only by air and river, Bethel is the main port on the Kuskokwim River and is an administrative and transportation hub for the 56 villages in the Yukon-Kuskokwim Delta.'},{airportCode:'BTT',cityName:'Bettles, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Bettles,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cd/Bettles_and_Evansville%2C_Alaska.jpg/250px-Bettles_and_Evansville%2C_Alaska.jpg',imgDescription:'Aerial view of Bettles (right) and its neighbor Evansville (left)',cityDescription:'Bettles  is a city in Yukon-Koyukuk Census Area, Alaska, United States. The population was 12 at the 2010 census.'},{airportCode:'BIL',cityName:'Billings, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Billings,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/Billings%2C_Montana_Collage_4.jpg/250px-Billings%2C_Montana_Collage_4.jpg',imgDescription:'Billings, Montana',cityDescription:'Billings is the largest city in the state of Montana, and is the principal city of the Billings Metropolitan Area with a population of 166,855. It has a trade area of over half a million people.'},{airportCode:'BGM',cityName:'Binghamton, New York',wikiUrl:'https://en.wikipedia.org/wiki/Binghamton,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b3/Binghamton_Montage.jpg/300px-Binghamton_Montage.jpg',imgDescription:'Clockwise from top: Binghamton skyline, the Endicott Johnson Square Deal Arch, the South Washington Street Bridge, the Ross Park Zoo carousel, Court Street Historic District, downtown in winter, and the Spiedie Fest and Balloon Rally.',cityDescription:'Binghamton  is a city in, and the county seat of, Broome County, New York, United States. It lies in the state\'s Southern Tier region near the Pennsylvania border, in a bowl-shaped valley at the confluence of the Susquehanna and Chenango Rivers. Binghamton is the principal city and cultural center of the Binghamton metropolitan area , home to a quarter million people. The population of the city itself, according to the 2010 census, is 47,376.'},{airportCode:'BHM',cityName:'Birmingham, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Birmingham,_Alabama',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Birmingham_AL_Montage.jpg/280px-Birmingham_AL_Montage.jpg',imgDescription:'From top left: Downtown from Red Mountain; Torii in the Birmingham Botanical Gardens; Alabama Theatre; Birmingham Museum of Art; City Hall; Downtown Financial Center.',cityDescription:'Birmingham  is the largest city in the US state of Alabama. The city is the county seat of Jefferson County. The city\'s population was 212,237 according to the 2010 United States Census. The Birmingham-Hoover Metropolitan Statistical Area had a population of about 1,128,047 according to the 2010 Census, which is approximately one quarter of Alabama\'s population.'},{airportCode:'BIS',cityName:'Bismarck, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Bismarck,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7a/2009-0521-ND-StateCapitol.jpg/250px-2009-0521-ND-StateCapitol.jpg',imgDescription:'North Dakota State Capitol',cityDescription:'Bismarck  is the capital of the U.S. state of North Dakota and the county seat of Burleigh County. It is the second most populous city in North Dakota after Fargo. The city\'s population was 61,272 at the 2010 census, while its metropolitan population was 126,597. In 2014, Forbes magazine ranked Bismarck as the seventh fastest-growing small city in the United States.'},{airportCode:'BMI',cityName:'Bloomington, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Bloomington,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Bloomington is a city in McLean County, Illinois, United States and the county seat. It is adjacent to Normal, and is the more populous of the two principal municipalities of the Bloomington-Normal metropolitan area. The mayor of Bloomington is Tari Renner.'},{airportCode:'BMG',cityName:'Bloomington, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/Bloomington,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/04/Bloomington_IN_Kirkwood.jpg/250px-Bloomington_IN_Kirkwood.jpg',imgDescription:'Bloomington IN Kirkwood.jpg',cityDescription:'Bloomington is a city in and the county seat of Monroe County in the southern region of the U.S. state of Indiana. It is the seventh-largest city in Indiana and the fifth-largest outside the Indianapolis metropolitan area. According to the Monroe County History Center, Bloomington is known as the "Gateway to Scenic Southern Indiana." The city was established in 1818 by a group of settlers from Kentucky, Tennessee, the Carolinas and Virginia who were so impressed with "a haven of blooms" that they called it Bloomington.'},{airportCode:'BLF',cityName:'Bluefield, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Bluefield,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Bluefield%2C_West_Virginia.jpg/300px-Bluefield%2C_West_Virginia.jpg',imgDescription:'Bluefield, West Virginia.jpg',cityDescription:'Bluefield is a city in Mercer County, West Virginia, United States. The population was 10,447 at the 2010 census. It is the core city of the Bluefield WV-VA micropolitan area, which has a population of 107,342.'},{airportCode:'BOI',cityName:'Boise, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Boise,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Boise1-vert.jpg/250px-Boise1-vert.jpg',imgDescription:'Skyline of Boise',cityDescription:'Boise  is the capital and most populous city of the U.S. state of Idaho, as well as the county seat of Ada County. Located on the Boise River in southwestern Idaho, the population of Boise at the 2010 Census was 205,671, the 99th largest in the nation. Its estimated population in 2013 was 214,237.'},{airportCode:'BOS',cityName:'Boston, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Boston,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c0/Boston_Collage_4_750px.jpg/325px-Boston_Collage_4_750px.jpg',imgDescription:'From top to bottom, left to right: the Boston skyline viewed from the Bunker Hill Monument; the Museum of Fine Arts; Faneuil Hall; Massachusetts State House; The First Church of Christ, Scientist; Boston Public Library; the John F. Kennedy Presidential Library and Museum; South Station; Boston University and the Charles River; Arnold Arboretum; Fenway Park; and the Boston Common',cityDescription:'Boston  is the capital and largest city of the Commonwealth of Massachusetts in the United States. Boston also served as the historic county seat of Suffolk County until Massachusetts disbanded county government in 1999. The city proper covers 48 square miles  with an estimated population of 655,884 in 2014, making it the largest city in New England and the 24th largest city in the United States. The city is the economic and cultural anchor of a substantially larger metropolitan area called Greater Boston, home to 4.7 million people and the tenth-largest metropolitan statistical area in the country. Greater Boston as a commuting region is home to 8.1 million people, making it the sixth-largest combined statistical area in the United States.'},{airportCode:'BZN',cityName:'Bozeman, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Bozeman,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/Bozeman_MT_areal.jpg/250px-Bozeman_MT_areal.jpg',imgDescription:'Aerial view of Bozeman',cityDescription:'Bozeman is a city in and the county seat of Gallatin County, Montana, United States, in the southwestern part of the state. The 2010 census put Bozeman\'s population at 37,280 and the 2014 census estimate put the population at 41,660 making it the fourth largest city in the state. It is the principal city of the Bozeman, MT Micropolitan Statistical Area, consisting of all of Gallatin County with a population of 97,304. It is the largest Micropolitan Statistical Area in Montana and is the third largest of all of Montanas statistical areas.'},{airportCode:'BKX',cityName:'Brookings, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Brookings,_South_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9b/Brookings_SD_3.jpg/250px-Brookings_SD_3.jpg',imgDescription:'Main Street in downtown Brookings',cityDescription:'Brookings is a city in Brookings County, South Dakota, United States. Brookings is the fourth largest city in South Dakota, with a population of 22,056 at the 2010 census. It is the county seat of Brookings County, and home to South Dakota State University, the largest institution of higher education in the state. Also found in Brookings are the South Dakota State Art Museum, the Children\'s Museum of South Dakota, the annual Brookings Summer Arts Festival, and the headquarters of a number of manufacturing companies and agricultural operations.'},{airportCode:'BRO',cityName:'Brownsville, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Brownsville,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5a/Brownsville_Skyline.jpg/250px-Brownsville_Skyline.jpg',imgDescription:'Skyline of Brownsville, Cameron County, Texas',cityDescription:'Brownsville is the county seat of Cameron County, Texas. It is the sixteenth most populous city in the state of Texas, with a population at the 2010 census of 175,023 and an estimated population in 2014 of 183,046. It is located at the southernmost tip of Texas, on the northern bank of the Rio Grande, directly north and across the border from Matamoros, Tamaulipas, Mexico. The 2014 U.S. Census Bureau estimate placed the Brownsville-Harlingen metropolitan area population at 420,392, making it the ninth most populous metropolitan area in the state of Texas. In addition, the international MatamorosBrownsville Metropolitan Area was estimated to have a population of 1,136,995. Brownsville has one of the highest poverty rates in the nation, and is frequently cited as having the highest percentage of residents below the federal poverty level out of all cities in the nation.'},{airportCode:'BQK',cityName:'Brunswick, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Brunswick,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/37/BrunswickMontage1.png/250px-BrunswickMontage1.png',imgDescription:'Port of Brunswick, Old Town National Historic District, Ritz Theatre, Old Brunswick City Hall, Glynn Academy, College of Coastal Georgia',cityDescription:'Brunswick  is a city in and the county seat of Glynn County, Georgia, United States. As the major urban and economic center of the state\'s lower southeast, it is the second-largest urban area on the Georgia coast after Savannah and contains the Brunswick Old Town Historic District.'},{airportCode:'BUF',cityName:'Buffalo, New York',wikiUrl:'https://en.wikipedia.org/wiki/Buffalo,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/6/63/Aerial_photo_of_Buffalo%2C_NY_Skyline.jpg/300px-Aerial_photo_of_Buffalo%2C_NY_Skyline.jpg',imgDescription:'Aerial photo of Buffalo, NY Skyline.jpg',cityDescription:'Buffalo  is a city in Western New York and the seat of Erie County, located on the eastern shores of Lake Erie at the head of the Niagara River. As of 2014, Buffalo is the second most populous city in the state after New York City with 258,703 residents, and the metropolitan area is the 53rd largest in the United States.'},{airportCode:'BUR',cityName:'Burbank, California',wikiUrl:'https://en.wikipedia.org/wiki/Burbank,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fe/Burbank_media_district_from_Griffith_Park_2015-11-07.jpg/250px-Burbank_media_district_from_Griffith_Park_2015-11-07.jpg',imgDescription:'Looking northwest over Burbank from Griffith Park.',cityDescription:'Burbank is a city in Los Angeles County in Southern California, United States, 12 miles  northwest of downtown Los Angeles. The population at the 2010 census was 103,340.'},{airportCode:'BRL',cityName:'Burlington, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Burlington,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/82/BurlingtonIA_Skyline_cropped.jpg/250px-BurlingtonIA_Skyline_cropped.jpg',imgDescription:'Skyline of Burlington from Mississippi River',cityDescription:'Burlington is a city and the county seat of Des Moines County, Iowa, United States. The population was 25,663 in the 2010 census, a decline from the 26,839 population in the 2000 census. Burlington is the center of a micropolitan area including West Burlington, Iowa and Middletown, Iowa and Gulfport, Illinois. Burlington is the home of Snake Alley, once labelled the crookedest alley in the world.'},{airportCode:'BBF',cityName:'Burlington, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Burlington,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/Town_Hall%2C_Burlington_MA.jpg/250px-Town_Hall%2C_Burlington_MA.jpg',imgDescription:'Town Hall',cityDescription:'Burlington is a town in Middlesex County, Massachusetts, United States. The population was 24,498 at the 2010 census.'},{airportCode:'BTV',cityName:'Burlington, Vermont',wikiUrl:'https://en.wikipedia.org/wiki/Burlington,_Vermont',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/d/dd/Collage_of_Burlington%2C_VT%2C_USA.jpg/285px-Collage_of_Burlington%2C_VT%2C_USA.jpg',imgDescription:'From top to bottom, going left to right: Burlington skyline viewed from Lake Champlain, ECHO Lake Aquarium and Science Center, Church Street Marketplace, Ethan Allen Homestead Museum and Historic Site, Old Mill building on the University of Vermont campus, Battery Park, and Gutterson Fieldhouse.',cityDescription:'Burlington is the largest city in the U.S. state of Vermont and the county seat of Chittenden County. It lies 45 miles  south of the Canada-United States  border and 94 miles  south of Montreal.'},{airportCode:'BTM',cityName:'Butte, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Butte,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/94/Butte-Panorama_01.jpg/250px-Butte-Panorama_01.jpg',imgDescription:'Butte viewed from the campus of Montana Tech',cityDescription:'Butte  is a city and the county seat of Silver Bow County, Montana. In 1977, the city and county governments consolidated to form the sole entity of Butte-Silver Bow. As of the 2010 census, Butte\'s population was approximately 34,200. Butte is Montana\'s fifth largest city.'},{airportCode:'CGI',cityName:'Cape Girardeau, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Cape_Girardeau,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Cape_dec29-07_%2823%29.JPG/250px-Cape_dec29-07_%2823%29.JPG',imgDescription:'Downtown Cape Girardeau',cityDescription:'Cape Girardeau ; colloquially referred to as "Cape") is a city located in Cape Girardeau County, Missouri in the United States. It is located approximately 115 miles  southeast of St. Louis and 175 miles  north of Memphis. As of the 2010 U.S. Census, the city\'s population was 37,941, making it the 16th-largest city in Missouri, and the largest city in Southeast Missouri. An emerging college town, it is the home of Southeast Missouri State University.'},{airportCode:'CLD',cityName:'Carlsbad, California',wikiUrl:'https://en.wikipedia.org/wiki/Carlsbad,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e0/Calsbad-late-night.jpg/250px-Calsbad-late-night.jpg',imgDescription:'Nighttime view of Carlsbad in 2006',cityDescription:'Carlsbad is an affluent seaside resort city occupying a 7-mile  stretch of Pacific coastline in northern San Diego County, California. The city is 87 miles  south of Los Angeles and 35 miles  north of downtown San Diego and is part of the San Diego-Carlsbad, CA Metropolitan Statistical Area. Referred to as "The Village by the Sea" by locals, the city is a tourist destination. The city\'s estimated 2014 population was 112,299.'},{airportCode:'CNM',cityName:'Carlsbad, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Carlsbad,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/Carlsbad_NM_Infobox.png/250px-Carlsbad_NM_Infobox.png',imgDescription:'Eddy County Courthouse  Carlsbad Museum and Art Center, Carlsbad Library Carlsbad Municipal Building',cityDescription:'Carlsbad  is the county seat of Eddy County, New Mexico, United States. As of the 2010 census, the city population was 26,138. Carlsbad is centered at the intersection of U.S. Routes 62/180 and 285, and is the principal city of the Carlsbad-Artesia Micropolitan Statistical Area, which has a total population of 55,435. Located in the Southeastern part of New Mexico, Carlsbad straddles the Pecos River and sits at the eastern edge of the Guadalupe Mountains.'},{airportCode:'CPR',cityName:'Casper, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Casper,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Casperskyline.jpg/250px-Casperskyline.jpg',imgDescription:'Overview of downtown Casper, looking south toward Casper Mountain, with North Platte River in foreground.',cityDescription:'Casper  is a city in and the county seat of Natrona County, Wyoming, United States. Casper is the second-largest city in Wyoming, according to the 2010 census, with a population of 55,316. Only Cheyenne, the state capital, is larger. Casper is nicknamed "The Oil City" and has a long history of oil boomtown and cowboy culture, dating back to development of the nearby Salt Creek Oil Field. In 2010, Casper was named the highest-ranked family-friendly small city in the West, and ranked eighth overall in the nation in Forbes magazine\'s list of "the best small cities to raise a family".'},{airportCode:'CID',cityName:'Cedar Rapids, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Cedar_Rapids,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/19/Cedar_Rapids_skyline.jpg/250px-Cedar_Rapids_skyline.jpg',imgDescription:'Cedar Rapids skyline.jpg',cityDescription:'Cedar Rapids  is the second largest city in Iowa and is the county seat of Linn County. The city lies on both banks of the Cedar River, 20 miles  north of Iowa City and 100 miles  northeast of Des Moines, the state\'s capital and largest city. Until massive flooding in 2008, the city\'s government was headquartered in the Veterans Memorial Building, near the Linn County Courthouse and jail on Mays Island in the Cedar River; Cedar Rapids was one of a few cities in the world, along with Paris, France, with governmental offices on a municipal island.'},{airportCode:'CMI',cityName:'Champaign, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Champaign,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Champaign  is a city in Champaign County, Illinois, United States. The city is located 135 miles  south of Chicago, 124 miles  west of Indianapolis, Indiana, and 178 mi  northeast of St. Louis, Missouri. Champaign is notable for sharing the campus of the University of Illinois at Urbana-Champaign with its sister city of Urbana. Champaign is also the home of Parkland College which serves about 18,000 students during the academic year. Due to the university and a number of well known technology startup companies, it is often referred to as the hub, or a significant landmark, of the Silicon Prairie. Champaign houses offices for Abbott, Archer Daniels Midland , Caterpillar, Deere & Company, Dow Chemical Company, IBM, State Farm, and Science Applications International Corporation , all of which are Fortune 500 companies, and for Sony.'},{airportCode:'CHS',cityName:'Charleston, South Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Charleston,_South_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/BroadStreetCharleston.jpg/250px-BroadStreetCharleston.jpg',imgDescription:'St. Michael\'s on Broad Street',cityDescription:'Charleston is the oldest and second-largest city in the U.S. state of South Carolina, the county seat of Charleston County, and the principal city in the CharlestonNorth CharlestonSummerville Metropolitan Statistical Area. The city lies just south of the geographical midpoint of South Carolina\'s coastline and is located on Charleston Harbor, an inlet of the Atlantic Ocean formed by the confluence of the Ashley and Cooper Rivers, or, as is locally expressed, "where the Cooper and Ashley Rivers come together to form the Atlantic Ocean."'},{airportCode:'CRW',cityName:'Charleston, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Charleston,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c5/Charleston_WV_skyline.jpg/250px-Charleston_WV_skyline.jpg',imgDescription:'Charleston WV skyline.jpg',cityDescription:'Charleston is the capital and largest city of the State of West Virginia. It is located at the confluence of the Elk and Kanawha Rivers in Kanawha County. As of the 2013 Census Estimate, it had a population of 50,821, while its metropolitan area had 224,743. It is a center of government, commerce, and industry. Early industries important to Charleston included salt and the first natural gas well. Later, coal became central to economic prosperity in the city and the surrounding area. Today, trade, utilities, government, medicine, and education play central roles in the city\'s economy.'},{airportCode:'CLT',cityName:'Charlotte, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Charlotte,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c1/Charlotte_collage.jpg/250px-Charlotte_collage.jpg',imgDescription:'Clockwise: UNC Charlotte, Harvey B. Gantt Center for African-American Arts + Culture, Duke Energy Center, Charlotte\'s skyline, First Presbyterian Church of Charlotte, Charlotte Main Library and NASCAR Hall of Fame building',cityDescription:'Charlotte  is the largest city in the U.S. state of North Carolina. It is the seat of Mecklenburg County and the second largest city in the Southeastern United States, just behind Jacksonville, Florida. Charlotte is the third fastest growing major city in the United States. In 2014, the estimated population of Charlotte according to the U.S. Census Bureau was 809,958, making it the 17th largest city in the United States based on population. The Charlotte metropolitan area ranks 22nd largest in the US and had a 2014 population of 2,380,314. The Charlotte metropolitan area is part of a sixteen-county market region or combined statistical area with a 2014 U.S. Census population estimate of 2,537,990. Residents of Charlotte are referred to as "Charlotteans". It is listed as a "gamma-plus" global city by the Globalization and World Cities Research Network.'},{airportCode:'CHO',cityName:'Charlottesville, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Charlottesville,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/4/4c/Charlottesville.png/100px-Charlottesville.png',imgDescription:'Official seal of Charlottesville',cityDescription:'Charlottesville is an independent city in the Commonwealth of Virginia. As of the 2010 census, the population was 43,475. It is the county seat of Albemarle County, which surrounds the city, though the two are separate legal entities. It is named after the British queen Charlotte of Mecklenburg-Strelitz.'},{airportCode:'CHA',cityName:'Chattanooga, Tennessee',wikiUrl:'https://en.wikipedia.org/wiki/Chattanooga,_Tennessee',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Chattanooga%2C_Tennessee_Skyline.JPG/250px-Chattanooga%2C_Tennessee_Skyline.JPG',imgDescription:'North Shore and Midtown neighborhoods, October 2012',cityDescription:'Chattanooga is the fourth-largest city in the U.S. state of Tennessee, with a population of 167,674 as of the 2010 census, and an estimated population of 171,279 in 2012. It is the seat of Hamilton County. Located in southeastern Tennessee in East Tennessee, on Chickamauga Lake and Nickajack Lake, which are both part of the Tennessee River, Chattanooga lies approximately 120 miles  to the northwest of Atlanta, Georgia, 120 miles  to the southwest of Knoxville, Tennessee, about 135 miles  to the southeast of Nashville, Tennessee, about 120 miles  to the northeast of Huntsville, Alabama, and about 148 miles  to the northeast of Birmingham, Alabama. Chattanooga abuts the Georgia border and is where three major interstate highways meet: I-24, I-75, and I-59.'},{airportCode:'CYS',cityName:'Cheyenne, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Cheyenne,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/CheyenneWY_downtown.jpg/320px-CheyenneWY_downtown.jpg',imgDescription:'Capitol Ave. in Downtown Cheyenne',cityDescription:'Cheyenne   is the capital and most populous city of the US state of Wyoming and the county seat of Laramie County. It is the principal city of the Cheyenne, Wyoming, Metropolitan Statistical Area which encompasses all of Laramie County. The population was 59,466 at the 2010 census. Cheyenne is the northern terminus of the extensive and fast-growing Front Range Urban Corridor that stretches from Cheyenne to Pueblo, Colorado, and has a population of 4,333,742 according to the 2010 United States Census. Cheyenne is situated on Crow Creek and Dry Creek. The Cheyenne, Wyoming Metropolitan Area had a 2010 population of 91,738, making it the 354th most populous metropolitan area in the United States.'},{airportCode:'CHI',cityName:'Chicago, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Chicago,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Chicago_montage1.jpg/300px-Chicago_montage1.jpg',imgDescription:'Clockwise from top: Downtown Chicago, the Chicago Theatre, the \'L\', Navy Pier, Millennium Park, the Field Museum, and the Sears Tower.',cityDescription:'Chicago  is the third most populous city in the United States. With over 2.7 million residents, it is the most populous city in the state of Illinois and the Midwest. The Chicago metropolitan area, often referred to as Chicagoland, has nearly 10 million people and is the third-largest in the U.S. Chicago is the seat of Cook County.'},{airportCode:'MDW',cityName:'Chicago, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Chicago,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Chicago_montage1.jpg/300px-Chicago_montage1.jpg',imgDescription:'Clockwise from top: Downtown Chicago, the Chicago Theatre, the \'L\', Navy Pier, Millennium Park, the Field Museum, and the Sears Tower.',cityDescription:'Chicago  is the third most populous city in the United States. With over 2.7 million residents, it is the most populous city in the state of Illinois and the Midwest. The Chicago metropolitan area, often referred to as Chicagoland, has nearly 10 million people and is the third-largest in the U.S. Chicago is the seat of Cook County.'},{airportCode:'CHI',cityName:'Chicago, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Chicago,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Chicago_montage1.jpg/300px-Chicago_montage1.jpg',imgDescription:'Clockwise from top: Downtown Chicago, the Chicago Theatre, the \'L\', Navy Pier, Millennium Park, the Field Museum, and the Sears Tower.',cityDescription:'Chicago  is the third most populous city in the United States. With over 2.7 million residents, it is the most populous city in the state of Illinois and the Midwest. The Chicago metropolitan area, often referred to as Chicagoland, has nearly 10 million people and is the third-largest in the U.S. Chicago is the seat of Cook County.'},{airportCode:'ORD',cityName:'Chicago, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Chicago,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Chicago_montage1.jpg/300px-Chicago_montage1.jpg',imgDescription:'Clockwise from top: Downtown Chicago, the Chicago Theatre, the \'L\', Navy Pier, Millennium Park, the Field Museum, and the Sears Tower.',cityDescription:'Chicago  is the third most populous city in the United States. With over 2.7 million residents, it is the most populous city in the state of Illinois and the Midwest. The Chicago metropolitan area, often referred to as Chicagoland, has nearly 10 million people and is the third-largest in the U.S. Chicago is the seat of Cook County.'},{airportCode:'CIC',cityName:'Chico, California',wikiUrl:'https://en.wikipedia.org/wiki/Chico,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/ChicoSquare.jpg/250px-ChicoSquare.jpg',imgDescription:'City Plaza in Chico',cityDescription:'Chico is the most populous city in Butte County, California, United States. The population was 86,187 at the 2010 census, up from 59,954 at the time of the 2000 census. The city is a cultural, economic, and educational center of the northern Sacramento Valley and home to both California State University, Chico and Bidwell Park, one of the country\'s 25 largest municipal parks and the 13th largest municipally-owned park. Bidwell Park makes up over 17% of the city.'},{airportCode:'CVG',cityName:'Cincinnati, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Cincinnati,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/Cincinnati_Skyline_from_Devou_Park.jpg/250px-Cincinnati_Skyline_from_Devou_Park.jpg',imgDescription:'Downtown Cincinnati from Devou Park in Covington, Kentucky',cityDescription:'Cincinnati  is a city in and the county seat of Hamilton County, Ohio, United States. It is the third-largest city in Ohio and the 65th-largest city in the United States. It had a population of 296,945 at the 2010 census. According to the census, the population of the metropolitan area was 2,214,954  the 28th-largest Metropolitan Statistical Area  in the United States and the largest centered in Ohio. Settled in 1788, the city is located on the north side of the confluence of the Licking with the Ohio River. The latter forms the border between the states of Ohio and Kentucky.'},{airportCode:'CKB',cityName:'Clarksburg, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Clarksburg,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/63/Clarksburg_West_Virginia.jpg/250px-Clarksburg_West_Virginia.jpg',imgDescription:'Downtown Clarksburg in 2006',cityDescription:'Clarksburg is a city in and the county seat of Harrison County, West Virginia, United States, in the north-central region of the state. It is the principal city of the Clarksburg, WV Micropolitan Statistical Area. The population of the city was 16,578 at the 2010 census. Clarksburg was named National Small City of the Year in 2011. '},{airportCode:'CLE',cityName:'Cleveland, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Cleveland,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b5/Cleveland_Skyline_2015.png/300px-Cleveland_Skyline_2015.png',imgDescription:'Cleveland Skyline 2015.png',cityDescription:'Cleveland  is a city in the U.S. state of Ohio and the county seat of Cuyahoga County, the most populous county in the state. The city is located in northeastern Ohio on the southern shore of Lake Erie, approximately 60 miles  west of the Pennsylvania border. It was founded in 1796 near the mouth of the Cuyahoga River, and became a manufacturing center owing to its location on the lake shore, as well as being connected to numerous canals and railroad lines. Cleveland\'s economy has diversified sectors that include manufacturing, financial services, healthcare, and biomedical. Cleveland is home to the Rock and Roll Hall of Fame and the Cleveland Clinic.'},{airportCode:'CVN',cityName:'Clovis, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Clovis,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/NorVaJak_Music.jpg/250px-NorVaJak_Music.jpg',imgDescription:'Norman Petty\'s NorVaJak Music, Inc.',cityDescription:'Clovis is the county seat of Curry County, New Mexico, United States, with a population of 37,775 as of the 2010 census, and a 2014 estimated population of 39,860. Clovis is located in the New Mexico portion of the Llano Estacado, in the eastern part of the state.'},{airportCode:'COD',cityName:'Cody, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Cody,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/87/Old_Cody_Post_Office_%28Cody%2C_Wyoming%29_001.jpg/250px-Old_Cody_Post_Office_%28Cody%2C_Wyoming%29_001.jpg',imgDescription:'Old Cody Post Office in Cody',cityDescription:'Cody is a city in Park County, Wyoming, United States. It is named after William Frederick Cody, better known as Buffalo Bill, from his part in the creation of the original town. The population was 9,520 at the 2010 census. It is the county seat of Park County.'},{airportCode:'CLL',cityName:'College Station, Texas',wikiUrl:'https://en.wikipedia.org/wiki/College_Station,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/TAMUcampus.jpg/250px-TAMUcampus.jpg',imgDescription:'College Station is the home of Texas A&M University.',cityDescription:'College Station is a city in Brazos County, Texas, situated in East-Central Texas in the heart of the Brazos Valley, in the center of the region known as Texas Triangle. It is 90 miles  northwest of Houston. As of the 2010 census, College Station had a population of 93,857, which had increased to an estimated population of 100,050 as of July 2013. College Station and Bryan together make up the Bryan-College Station metropolitan area, the 15th-largest metropolitan area in Texas with 228,660 people as of the 2010 census.'},{airportCode:'COS',cityName:'Colorado Springs, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Colorado_Springs,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/45/CC_COSPRINGS.jpg/325px-CC_COSPRINGS.jpg',imgDescription:'Colorado Springs with the Front Range in background',cityDescription:'Colorado Springs is a home rule municipality that is the county seat and the most populous municipality of El Paso County, Colorado, United States. Colorado Springs is located in the east central portion of the state. It is situated on Fountain Creek and is located 60 miles  south of the Colorado State Capitol in Denver.'},{airportCode:'COU',cityName:'Columbia, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Columbia,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/4/44/Mizzou_Jesse_Thumb.jpg/250px-Mizzou_Jesse_Thumb.jpg',imgDescription:'Jesse Hall and the columns on Francis Quadrangle at the University of Missouri',cityDescription:'Columbia  is a city in and the county seat of Boone County, Missouri, United States. Founded in 1820 as the county seat and home to the University of Missouri, it had a population of 108,500 at the 2010 census, and it is the principal city of the Columbia Metropolitan Area, the state\'s fourth most populous metropolitan area. As a midwestern college town, the city has a reputation for progressive politics, public art, and powerful journalism. The tripartite establishment of Stephens College , The University of Missouri , and Columbia College  has long made the city a center of education, culture, and athletic competition. These three schools surround Downtown Columbia on the east, south, and north; at the center is the Avenue of the Columns, which connects Francis Quadrangle and Jesse Hall to the Boone County Courthouse and the City Hall. Originally an agricultural town, today the cultivation of the mind is Columbia\'s chief economic concern. Never a major center of manufacturing, the city also depends on healthcare, insurance, and technology businesses. Several companiesShelter Insurance, Carfax, and Slackers CDs and Games among themwere founded in the city. Cultural institutions include the State Historical Society of Missouri, the Museum of Art and Archaeology, and the annual True/False Film Festival. The Missouri Tigers, the state\'s only major athletic program, play football at Faurot Field and basketball at Mizzou Arena as members of the Southeastern Conference.'},{airportCode:'CAE',cityName:'Columbia, South Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Columbia,_South_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/02/Fall_skyline_of_Columbia_SC_from_Arsenal_Hill.jpg/250px-Fall_skyline_of_Columbia_SC_from_Arsenal_Hill.jpg',imgDescription:'Skyline of downtown Columbia',cityDescription:'Columbia is the capital of and largest city in the U.S. state of South Carolina, with a population of 129,272 as of the 2010 United States Census. As of July 1, 2013, the city\'s population was estimated to be 133,358 . The city serves as the county seat of Richland County, and a portion of the city extends into neighboring Lexington County. It is the center of the Columbia metropolitan statistical area, which had a population of 767,598 as of the 2010 United States Census, growing to 800,495 by July 1, 2013, according to 2014 U.S. Census estimates. The name Columbia was a poetic term used for the United States, originating from the name of Christopher Columbus.'},{airportCode:'CSG',cityName:'Columbus, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Columbus,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/13/Columbus_Georgia_skyline.jpeg/300px-Columbus_Georgia_skyline.jpeg',imgDescription:'Downtown Columbus skyline on the banks of the Chattahoochee River',cityDescription:'Columbus is a city in the U.S. state of Georgia and is the county seat of Muscogee County, with which it is consolidated. According to the 2013 estimates from the U.S. Census Bureau, Columbus has a population of 202,824 residents in the city and 316,554 in the Columbus-Phenix City metropolitan area. The metro area joins the nearby Alabama cities of Auburn and Opelika to form the Columbus-Auburn-Opelika Combined Statistical Area, which has an estimated population of 501,649. Situated at the heart of the Chattahoochee Valley, Columbus is Georgia\'s second-largest city and fourth-largest metropolitan area.'},{airportCode:'CLU',cityName:'Columbus, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/Columbus,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/NorthChristianChurch.jpg/250px-NorthChristianChurch.jpg',imgDescription:'North Christian Church, designed by Eero Saarinen, one of the city\'s modern architectural landmarks',cityDescription:'Columbus  is a city in and the county seat of Bartholomew County, Indiana, United States. The population was 44,061 at the 2010 census. In its built environment, the relatively small city has provided a unique place for noted Modern Architecture. Located about 40 miles  south of Indianapolis, on the east fork of the White River, it is the state\'s 20th largest city. It is also the principal city of the Columbus, Indiana metropolitan statistical area, which encompasses all of Bartholomew County.'},{airportCode:'GTR',cityName:'Columbus, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Columbus,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/Columbus_MS.jpg/300px-Columbus_MS.jpg',imgDescription:'Columbus MS.jpg',cityDescription:'Columbus is a city in Lowndes County, Mississippi that lies primarily east, but also north and northeast of the Tombigbee River, which is also referred to as the Tennessee-Tombigbee Waterway. It is approximately 146 miles  northeast of Jackson, 92 miles  north of Meridian, 63 miles  south of Tupelo, 60 miles  northwest of Tuscaloosa, Alabama, and 120 miles  west of Birmingham, Alabama. The population was 25,944 at the 2000 census. The population was 23,640 at the 2010 census. The population in 2012 was estimated to be 23,452. It is the county seat of Lowndes County and the principal city of the Columbus Micropolitan Statistical Area, which is part of the larger Columbus-West Point Combined Statistical Area. Columbus is also part of the area of northeast Mississippi called The Golden Triangle, consisting of Columbus, West Point and Starkville, in the counties of Lowndes, Clay and Oktibbeha.'},{airportCode:'OLU',cityName:'Columbus, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Columbus,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/Columbus_Loup_River_Bridge_from_NW_1.JPG/250px-Columbus_Loup_River_Bridge_from_NW_1.JPG',imgDescription:'Bridge carrying U.S. Highway 30 and U.S. Highway 81 across the Loup River at Columbus',cityDescription:'Columbus is a city in and the county seat of Platte County, in the state of Nebraska in the Midwestern United States. The population was 22,111 at the 2010 census.'},{airportCode:'CMH',cityName:'Columbus, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Columbus,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/Montage_Columbus_1.jpg/250px-Montage_Columbus_1.jpg',imgDescription:'Images, from top left to right: Downtown Columbus, Ohio Statehouse Capitol Square, University Hall (Ohio State University), Short North, Nationwide Arena, Santa Maria replica',cityDescription:'Columbus  is the capital and largest city of the U.S. state of Ohio. It is the 15th largest city in the United States, with a population of 835,957 . It is the core city of the Columbus, OH Metropolitan Statistical Area , which encompasses a ten county area. Under the Metropolitan Statistical Area  model, it is the third largest metropolitan area in Ohio, virtually tied with the Cleveland MSA and slightly behind the Cincinnati MSA .'},{airportCode:'CDV',cityName:'Cordova, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Cordova,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/Cordova_Alaska_aerial_view.jpg/250px-Cordova_Alaska_aerial_view.jpg',imgDescription:'Aerial view of Cordova, Alaska',cityDescription:'Cordova  is a small town located near the mouth of the Copper River in the Valdez-Cordova Census Area, Alaska, United States, at the head of Orca Inlet on the east side of Prince William Sound. The population was 2,239 at the 2010 census. Cordova was named Puerto Cordova by Spanish explorer Salvador Fidalgo in 1790. No roads connect Cordova to other Alaskan towns, so a plane or ferry is required to travel there. In the Exxon Valdez oil spill of March 1989, an oil tanker ran aground northwest of Cordova, affecting ecology and fishing.'},{airportCode:'CRP',cityName:'Corpus Christi, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Corpus_Christi,_Texas',imgUrl:undefined,imgDescription:undefined,cityDescription:'Corpus Christi  is a coastal city in the South Texas region of the U.S. state of Texas. The county seat of Nueces County, it also extends into Aransas, Kleberg, and San Patricio Counties. The city\'s political boundaries encompass Nueces Bay and Corpus Christi Bay. Its zoned boundaries include small land parcels or water inlets of three neighboring counties.'},{airportCode:'DAL',cityName:'Dallas, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Dallas,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Dallas_Collage_Montage.png/330px-Dallas_Collage_Montage.png',imgDescription:'Top to bottom, left to right: Downtown Dallas skyline, Old Red Museum, NorthPark Center, Dallas City Hall, Dallas Museum of Art, Winspear Opera House, Perot Museum of Nature and Science, State Fair of Texas at Fair Park, Dallas Union Station, the Dallas Arboretum and Botanical Garden, and the American Airlines Center',cityDescription:'Dallas  is a major city in Texas and is the largest urban center of the fourth most populous metropolitan area in the United States. The city proper ranks ninth in the U.S. and third in Texas after Houston and San Antonio. The city\'s prominence arose from its historical importance as a center for the oil and cotton industries, and its position along numerous railroad lines. The bulk of the city is in Dallas County, of which it is the county seat; however, sections of the city are located in Collin, Denton, Kaufman, and Rockwall counties. According to the 2010 United States Census, the city had a population of 1,197,816. The United States Census Bureau\'s estimate for the city\'s population increased to 1,281,047, as of 2014.'},{airportCode:'DFW',cityName:'Dallas, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Dallas,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Dallas_Collage_Montage.png/330px-Dallas_Collage_Montage.png',imgDescription:'Top to bottom, left to right: Downtown Dallas skyline, Old Red Museum, NorthPark Center, Dallas City Hall, Dallas Museum of Art, Winspear Opera House, Perot Museum of Nature and Science, State Fair of Texas at Fair Park, Dallas Union Station, the Dallas Arboretum and Botanical Garden, and the American Airlines Center',cityDescription:'Dallas  is a major city in Texas and is the largest urban center of the fourth most populous metropolitan area in the United States. The city proper ranks ninth in the U.S. and third in Texas after Houston and San Antonio. The city\'s prominence arose from its historical importance as a center for the oil and cotton industries, and its position along numerous railroad lines. The bulk of the city is in Dallas County, of which it is the county seat; however, sections of the city are located in Collin, Denton, Kaufman, and Rockwall counties. According to the 2010 United States Census, the city had a population of 1,197,816. The United States Census Bureau\'s estimate for the city\'s population increased to 1,281,047, as of 2014.'},{airportCode:'DAY',cityName:'Dayton, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Dayton,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/db/Montage_dayton_1.jpg/300px-Montage_dayton_1.jpg',imgDescription:'Montage dayton 1.jpg',cityDescription:'Dayton  is the sixth largest city in the state of Ohio and is the county seat of Montgomery County. In the 2010 census, the population was 141,527; the Dayton metropolitan area had 841,502 residents, making it the fourth-largest metropolitan area in Ohio, after only the urban agglomerations of Cleveland, Cincinnati and Columbus, and the 63rd largest in the United States. The Dayton-Springfield-Greenville Combined Statistical Area had a population of 1,080,044 in 2010 and is the 43rd largest in the United States. Dayton is situated within the Miami Valley region of Ohio just north of the CincinnatiNorthern Kentucky metropolitan area.'},{airportCode:'DAB',cityName:'Daytona Beach, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Daytona_Beach,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/DaytonaBeach_Collage-2009-26-04.png/250px-DaytonaBeach_Collage-2009-26-04.png',imgDescription:'From top, left to right: Welcome sign when entering Daytona Beach; Daytona Beach Bandshell; Ocean Walk Shoppes; Daytona Beach Pier; Daytona International Speedway',cityDescription:'Daytona Beach is a city in Volusia County, Florida, United States. It lies about 51 miles  northeast of Orlando, 86 miles  southeast of Jacksonville, and 242 miles  northwest of Miami. In the 2010 U.S. Census, it had a population of 61,005. It is a principal city of the DeltonaDaytona BeachOrmond Beach, FL metropolitan statistical area, which was home to 590,289 people in 2010. Daytona Beach is also a principal city of the Fun Coast region of Florida.'},{airportCode:'DEC',cityName:'Decatur, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Decatur,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d4/Decaturillinois121.JPG/250px-Decaturillinois121.JPG',imgDescription:'Decatur downtown',cityDescription:'Decatur  is the largest city and the county seat of Macon County in the U.S. state of Illinois. The city was founded in 1829 and is located along the Sangamon River and Lake Decatur in Central Illinois. In 2014 the city\'s estimated population was 74,010.'},{airportCode:'DEN',cityName:'Denver, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Denver,_Colorado',imgUrl:undefined,imgDescription:undefined,cityDescription:'Denver   is the capital and most populous municipality of the U.S. state of Colorado. As of 2014, Denver is also the most populous county in Colorado. Denver is located in the South Platte River Valley on the western edge of the High Plains just east of the Front Range of the Rocky Mountains. The Denver downtown district is located immediately east of the confluence of Cherry Creek with the South Platte River, approximately 12 mi  east of the foothills of the Rocky Mountains. Denver is nicknamed the Mile-High City because its official elevation is exactly one mile  above sea level, making it one of the highest major cities in the United States. The 105th meridian west of Greenwich, the longitudinal reference for the Mountain Time Zone, passes directly through Denver Union Station.'},{airportCode:'DSM',cityName:'Des Moines, Iowa'},{airportCode:'DTW',cityName:'Detroit, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Detroit,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/Detroit_Montage_3.png/320px-Detroit_Montage_3.png',imgDescription:'From top to bottom, left to right: Downtown Detroit skyline and the Detroit River, Fox Theatre, Dorothy H. Turkel House in Palmer Woods, Belle Isle Conservatory, The Spirit of Detroit, Fisher Building, Eastern Market, Old Main at Wayne State University, Ambassador Bridge, and the Detroit Institute of Arts',cityDescription:'Detroit  is the most populous city in the U.S. state of Michigan, the fourth-largest city in the Midwest and the largest city on the United StatesCanada border. It is the seat of Wayne County, the most populous county in the state. Detroit\'s metropolitan area, known as Metro Detroit, is home to 5.3 million people, making it the fourteenth-most populous metropolitan area in the United States and the second-largest in the Midwestern United States . It is a major port on the Detroit River, a strait that connects the Great Lakes system to the Saint Lawrence Seaway. The City of Detroit anchors the third-largest economic region in the Midwest, behind Chicago and Minneapolis, and the thirteenth-largest in the United States.'},{airportCode:'DTT',cityName:'Detroit, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Detroit,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/Detroit_Montage_3.png/320px-Detroit_Montage_3.png',imgDescription:'From top to bottom, left to right: Downtown Detroit skyline and the Detroit River, Fox Theatre, Dorothy H. Turkel House in Palmer Woods, Belle Isle Conservatory, The Spirit of Detroit, Fisher Building, Eastern Market, Old Main at Wayne State University, Ambassador Bridge, and the Detroit Institute of Arts',cityDescription:'Detroit  is the most populous city in the U.S. state of Michigan, the fourth-largest city in the Midwest and the largest city on the United StatesCanada border. It is the seat of Wayne County, the most populous county in the state. Detroit\'s metropolitan area, known as Metro Detroit, is home to 5.3 million people, making it the fourteenth-most populous metropolitan area in the United States and the second-largest in the Midwestern United States . It is a major port on the Detroit River, a strait that connects the Great Lakes system to the Saint Lawrence Seaway. The City of Detroit anchors the third-largest economic region in the Midwest, behind Chicago and Minneapolis, and the thirteenth-largest in the United States.'},{airportCode:'DVL',cityName:'Devils Lake, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Devils_Lake,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/Downtown_Devils_Lake.jpg/250px-Downtown_Devils_Lake.jpg',imgDescription:'Downtown Devils Lake',cityDescription:'Devils Lake is a city in Ramsey County, North Dakota, United States. It is the county seat of Ramsey County. The population was 7,141 at the 2010 census. It is named after the nearby body of water, Devils Lake. The first house in Devils Lake was built in 1882. It was surveyed in 1883 and named Creelsburg and later Creel City, after the surveyor, Heber M. Creel. In 1884 it was renamed Devils Lake.'},{airportCode:'DIK',cityName:'Dickinson, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Dickinson,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Stark_County_Courthouse%2C_Dickinson.jpg/250px-Stark_County_Courthouse%2C_Dickinson.jpg',imgDescription:'Stark County Courthouse in Dickinson',cityDescription:'Dickinson is a city in Stark County, North Dakota, United States. It is the county seat of Stark County. The population was 17,787 at the 2010 census. The U.S. Census Bureau estimated 2014 population is 22,322.'},{airportCode:'DLG',cityName:'Dillingham, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Dillingham,_Alaska',imgUrl:undefined,imgDescription:undefined,cityDescription:'Dillingham  , also known as Curyung and  Kanakanak, is a city in Dillingham Census Area, Alaska, United States. As of the 2010 census, the population of the city was 2,329.'},{airportCode:'DDC',cityName:'Dodge City, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Dodge_City,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Dodge_City_Longhorn.jpg/250px-Dodge_City_Longhorn.jpg',imgDescription:'"El Capitan" cattle drive monument (2008)',cityDescription:'Dodge City is the county seat of Ford County, Kansas, United States, named after nearby Fort Dodge. The city is famous in American culture for its history as a wild frontier town of the Old West. As of the 2010 census, the city population was 27,340.'},{airportCode:'DHN',cityName:'Dothan, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Dothan,_Alabama',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/37/FosterFestDothanDowntown.jpg/250px-FosterFestDothanDowntown.jpg',imgDescription:'FosterFest in downtown Dothan',cityDescription:'Dothan  is a city in the southeastern corner of the U.S. state of Alabama, situated approximately 20 miles  west of the Georgia state line and 16 miles  north of Florida. It is the seat of Houston County, with portions extending into nearby Dale County and Henry County. Its name derives from Genesis 37:17: "let us go to Dothan." According to the 2010 census the city\'s population was 65,496.'},{airportCode:'DUJ',cityName:'Du Bois, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Du_Bois,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/DuBois%2C_Pennsylvania.jpg/250px-DuBois%2C_Pennsylvania.jpg',imgDescription:'Downtown DuBois',cityDescription:'DuBois  DOO-boys is a city in Clearfield County, Pennsylvania, United States, 100 miles  northeast of Pittsburgh. The population was 7,794 at the 2010 census. It is the principal city in the DuBois, PA Micropolitan Statistical Area. DuBois is also one of two principal cities, the other being State College, that make up the larger State College-DuBois, PA Combined Statistical Area.'},{airportCode:'DBQ',cityName:'Dubuque, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Dubuque,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/84/Dubuque_IA_-_overview.jpg/300px-Dubuque_IA_-_overview.jpg',imgDescription:'Downtown Dubuque, Iowa, Oct 2008',cityDescription:'Dubuque i  is a city in and the county seat of Dubuque County, Iowa, United States, located along the Mississippi River. In 2013, its population was 58,253, making it the tenth-largest city in the state'},{airportCode:'DLH',cityName:'Duluth, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Duluth,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/Duluth_Skyline.jpg/250px-Duluth_Skyline.jpg',imgDescription:'Duluth Skyline.jpg',cityDescription:'Duluth i  is a seaport city in the U.S. state of Minnesota and the county seat of Saint Louis County. Duluth has a population of 86,238 and is the second-largest city on Lake Superior\'s shores, after Thunder Bay, Ontario, on the lake\'s Canadian border; it does, however, have the largest metropolitan area on the lake. The Duluth MSA had a population of 279,771 in 2010, the second-largest in Minnesota. The combined urban population of Duluth and its adjacent communities  including Proctor, Hermantown, and Superior, Wisconsin  totals over 131,000, based on 2010 census figures.'},{airportCode:'DRO',cityName:'Durango, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Durango,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/2/2c/Durango-downtown.jpg',imgDescription:'Downtown Durango, Colorado',cityDescription:'The City of Durango is the Home Rule Municipality that is the county seat and the most populous municipality of La Plata County, Colorado, United States. The United States Census Bureau reported a population of 16,887 in the 2010 census.'},{airportCode:'DUT',cityName:'Dutch Harbor, Un Island, Alaska'},{airportCode:'EAU',cityName:'Eau Claire, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Eau_Claire,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/36/Eau_Claire_-_Barstow_street_looking_north_2005.jpg/250px-Eau_Claire_-_Barstow_street_looking_north_2005.jpg',imgDescription:'Barstow Street',cityDescription:'Eau Claire  is a city in Chippewa and Eau Claire counties in the west-central part of the U.S. state of Wisconsin. Located almost entirely in Eau Claire County, for which it is the county seat, the city had a population of 65,883 at the 2010 census, making it the state\'s ninth-largest city. Eau Claire is the principal city of the Eau Claire, Wisconsin Metropolitan Statistical Area, which is a part of the Eau Claire-Menomonie Combined Statistical Area.'},{airportCode:'EEK',cityName:'Eek, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Eek,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/Eek%2C_AK_from_a_bush_plane.jpg/250px-Eek%2C_AK_from_a_bush_plane.jpg',imgDescription:'Eek, AK from a bush plane',cityDescription:'Eek  is a city in Bethel Census Area, Alaska, United States. At the 2010 census the population was 296.'},{airportCode:'IPL',cityName:'El Centro, California',wikiUrl:'https://en.wikipedia.org/wiki/El_Centro,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f8/Courthouse_night.JPG/250px-Courthouse_night.JPG',imgDescription:'Imperial County Courthouse in El Centro',cityDescription:'El Centro is a city in and county seat of Imperial County, the largest city in the Imperial Valley, east anchor of the Southern California Border Region, and the core urban area and principal city of the El Centro metropolitan area which encompasses all of Imperial County. El Centro is also the largest American city to lie entirely below sea level . The city, located in the far southeastern corner of California, is near the major Southern California city of San Diego and the Mexican city of Mexicali.'},{airportCode:'ELD',cityName:'El Dorado, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/El_Dorado,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0c/ChrisLitherlandElDorado.jpg/250px-ChrisLitherlandElDorado.jpg',imgDescription:'Jefferson Street in downtown El Dorado\'s Union Square District',cityDescription:'El Dorado is a city in and the county seat of Union County, Arkansas, USA. According to estimates, the 2012 census, the population of the city is 18,491, which represents a decline of 2.1 percent from the 2010 tabulation of 18,884.'},{airportCode:'ELP',cityName:'El Paso, Texas',wikiUrl:'https://en.wikipedia.org/wiki/El_Paso,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/62/Elpcollage_scaled.jpg/250px-Elpcollage_scaled.jpg',imgDescription:'From upper left: downtown El Paso skyline, star on the Franklin Mountains, The Cathedral of Saint Patrick, Wyler Aerial Tramway, North Franklin Peak, downtown El Paso at night',cityDescription:'El Paso  is the county seat of El Paso County, Texas, United States, and lies in far West Texas. In 1659, Fray Garcia de San Francisco, established Our Lady of Guadalupe Mission of El Paso del Norte. Around this mission, the village of El Paso del Norte grew into what is now the El PasoJurez region. El Paso stands on the Rio Grande , across the border from Ciudad Jurez, Chihuahua, Mexico. The two cities, along with Las Cruces , form a combined international metropolitan area, sometimes referred as the Paso del Norte or El PasoJurezLas Cruces. The region of over 2.7 million people constitutes the largest bilingual-binational work force in the Western Hemisphere.'},{airportCode:'EKO',cityName:'Elko, Nevada',wikiUrl:'https://en.wikipedia.org/wiki/Elko,_Nevada',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/2012-09-30_14_28_33_View_of_downtown_Elko_in_Nevada_from_a_bluff_to_the_south.jpg/250px-2012-09-30_14_28_33_View_of_downtown_Elko_in_Nevada_from_a_bluff_to_the_south.jpg',imgDescription:'Downtown Elko',cityDescription:'Coordinates: 4050N 11546W  40.833; -115.767 Elko  is the largest city and county seat of Elko County, Nevada, United States. The population was 18,297 at the 2010 census. The city straddles the Humboldt River.'},{airportCode:'ELM',cityName:'Elmira, New York',wikiUrl:'https://en.wikipedia.org/wiki/Elmira,_New_York',imgUrl:undefined,imgDescription:undefined,cityDescription:'Elmira  is a city in Chemung County, New York, US. It is the principal city of the Elmira, New York Metropolitan Statistical Area, which encompasses Chemung County, New York. The population was 29,200 at the 2010 census. It is the county seat of Chemung County.'},{airportCode:'WDG',cityName:'Enid, Oklahoma',wikiUrl:'https://en.wikipedia.org/wiki/Enid,_Oklahoma',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/76/East_on_Broadway.JPG/250px-East_on_Broadway.JPG',imgDescription:'East on Broadway.JPG',cityDescription:'Enid  is a city in Garfield County, Oklahoma, United States. As of the 2010 census, the population was 49,379, making it the ninth largest city in Oklahoma. It is the county seat of Garfield County. Enid was founded during the opening of the Cherokee Outlet in the Land Run of 1893, and is named after Enid, a character in Alfred, Lord Tennyson\'s Idylls of the King. In 1991, the Oklahoma state legislature designated Enid the "Purple Martin Capital of Oklahoma." Enid holds the nickname of "Queen Wheat City" and "Wheat Capital" of Oklahoma and the United States for its immense grain storage capacity, and has the third largest grain storage capacity in the world.'},{airportCode:'ERI',cityName:'Erie, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Erie,_Pennsylvania',imgUrl:undefined,imgDescription:undefined,cityDescription:'Erie  is a city located in northwestern Pennsylvania, United States. Named for the lake and the Native American tribe that resided along its southern shore, Erie is the state\'s fourth-largest city , with a population of 102,000. It was the third-largest city in the state until 1999. It is the 2nd largest city in Western Pennsylvania . Erie\'s Metropolitan Area consists of approximately 280,000 residents and an Urbanized Area population of approximately 195,000. The city is the seat of government for Erie County and the principal city of the Erie, PA Metropolitan Statistical Area.'},{airportCode:'ESC',cityName:'Escanaba, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Escanaba,_Michigan',imgUrl:undefined,imgDescription:undefined,cityDescription:'Escanaba  is a city in Delta County in the U.S. state of Michigan, located in the banana belt on the state\'s Upper Peninsula. The population was 12,616 at the 2010 census, making it the third-largest city in the Upper Peninsula after Marquette and Sault Ste. Marie. It is the seat of government of Delta County.'},{airportCode:'EUG',cityName:'Eugene, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/Eugene,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Photocollageofeugene.png/300px-Photocollageofeugene.png',imgDescription:'Downtown Eugene from Skinner Butte, Clockwise: Lane County Farmers\' Market, Hiking on Spencer Butte, University of Oregon Autzen Stadium, Delta Ponds pedestrian bridge',cityDescription:'Eugene  is a city of the Pacific Northwest located in the U.S. state of Oregon. It is located at the south end of the Willamette Valley, near the confluence of the McKenzie and Willamette rivers, about 50 miles  east of the Oregon Coast.'},{airportCode:'ACV',cityName:'Eureka, California',wikiUrl:'https://en.wikipedia.org/wiki/Eureka,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9f/Humboldt_Bay_and_Eureka_aerial_view.jpg/250px-Humboldt_Bay_and_Eureka_aerial_view.jpg',imgDescription:'Aerial view: Eureka on Humboldt Bay',cityDescription:'Eureka is the principal city and county seat of Humboldt County in the Redwood Empire region of California. The city is located on U.S. Route 101 on the shores of Humboldt Bay, 270 miles  north of San Francisco and 100 miles  south of the Oregon border. At the 2010 census, the population of the city was 27,191, and the population of Greater Eureka was 45,034.'},{airportCode:'EVV',cityName:'Evansville, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/Evansville,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Evansvilleskyline.jpg/250px-Evansvilleskyline.jpg',imgDescription:'Downtown Evansville at nightfall',cityDescription:'Located in the United States of America, Evansville is the commercial, medical, and cultural hub of Southwestern Indiana and the Illinois-Indiana-Kentucky tri-state area. It is the third-largest city in the state of Indiana and the largest city in Southern Indiana. As of the 2010 census, the city had a total population of 117,429 and a metropolitan population of 358,676. It is the county seat of Vanderburgh County.'},{airportCode:'FAI',cityName:'Fairbanks, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Fairbanks,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9c/Downtown_Fairbanks%2C_Alaska.jpg/250px-Downtown_Fairbanks%2C_Alaska.jpg',imgDescription:'Downtown Fairbanks, Alaska',cityDescription:'Fairbanks  is a home rule city and the borough seat of the Fairbanks North Star Borough in the U.S. state of Alaska.'},{airportCode:'FAR',cityName:'Fargo, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Fargo,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a0/Fargo_North_Dakota.jpg/300px-Fargo_North_Dakota.jpg',imgDescription:'The skyline of downtown Fargo as seen from Main Avenue, facing north.',cityDescription:'Fargo is the most populous city in the State of North Dakota, accounting for nearly 16% of the state population. Fargo is also the county seat of Cass County. According to the 2014 United States Census estimates, its population was 115,863. Fargo, along with its twin city of Moorhead, Minnesota, as well as adjacent West Fargo, North Dakota and Dilworth, Minnesota, form the core of the Fargo-Moorhead, ND-MN Metropolitan Statistical Area, which in 2014 contained a population of 228,291. In 2014, Forbes magazine ranked Fargo as the fourth fastest-growing small city in the United States.'},{airportCode:'FMN',cityName:'Farmington, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Farmington,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Farmington_New_Mexico_Civic_Center.jpg/250px-Farmington_New_Mexico_Civic_Center.jpg',imgDescription:'Farmington Civic Center',cityDescription:'Farmington is a city in San Juan County in the US state of New Mexico. As of the 2013 population estimate from the United States Census Bureau the city had a total population of 45,426 people. Farmington  makes up one of the four Metropolitan Statistical Areas  in New Mexico. The U.S. Census Bureau\'s population estimate in 2011 for Farmington was about 45,256.'},{airportCode:'XNA',cityName:'Fayetteville, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/Fayetteville,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/Fayetteville_collage.png/250px-Fayetteville_collage.png',imgDescription:'Clockwise from top: Fayetteville skyline around the Historic Square, Donald W. Reynolds Razorback Stadium, Old Main, Wilson Park, the Fayetteville Depot, and the Washington County Courthouse.',cityDescription:'Fayetteville is the third-largest city in Arkansas and county seat of Washington County. The city is centrally located within the county and has been home of the University of Arkansas since the institution\'s founding in 1871. Fayetteville is on the outskirts of the Boston Mountains, deep within the Ozarks. Known as Washington until 1829, the city was named after Fayetteville, Tennessee, where many of the settlers were from. It was incorporated on November 3, 1836 and was rechartered in 1867. The four-county Northwest Arkansas Metropolitan Statistical Area is ranked 105th in terms of population in the United States with 463,204 in 2010 according to the United States Census Bureau. The city had a population of 73,580 at the 2010 Census.'},{airportCode:'FAY',cityName:'Fayetteville, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Fayetteville,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Iron_Mike.JPG/250px-Iron_Mike.JPG',imgDescription:'Iron Mike statue in front of the Airborne & Special Operations Museum, Downtown Fayetteville',cityDescription:'Fayetteville  is a city in Cumberland County, North Carolina, United States. It is the county seat of Cumberland County, and is best known as the home of Fort Bragg, a major U.S. Army installation northwest of the city.'},{airportCode:'FLG',cityName:'Flagstaff, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Flagstaff,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Flagstaff_downtown_SFmtn.jpg/250px-Flagstaff_downtown_SFmtn.jpg',imgDescription:'Downtown Flagstaff in 2000',cityDescription:'Flagstaff is a city located in northern Arizona, in the southwestern United States. In 2013, the city\'s estimated population was 68,667. The combined metropolitan area of Flagstaff has an estimated population of 136,539. It is the county seat of Coconino County. The city is named after a ponderosa pine flagpole made by a scouting party from Boston  to celebrate the United States Centennial on July 4, 1876.'},{airportCode:'FNT',cityName:'Flint, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Flint,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/Flinttemplate_connorcoyne.png/250px-Flinttemplate_connorcoyne.png',imgDescription:'Top: Skyline as seen from the Flint River.  Middle: GM Powertrain, Longway Planetarium.  Bottom: Former site of Buick City, South Saginaw St., Citizens Bank Weatherball.',cityDescription:'Flint is the largest city and county seat of Genesee County, Michigan. Located along the Flint River, 66 miles  northwest of Detroit, it is the largest city in the Flint/Tri-Cities region of Michigan. According to the 2010 census, Flint has a population of 102,434, making it the seventh largest city in Michigan. The Flint metropolitan area is located entirely within Genesee County. It is the fourth largest metropolitan area in Michigan with a population of 425,790 in 2010.'},{airportCode:'FLO',cityName:'Florence, South Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Florence,_South_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/U.S._Post_Office_%28Florence%2C_South_Carolina%29_1938.jpg/250px-U.S._Post_Office_%28Florence%2C_South_Carolina%29_1938.jpg',imgDescription:'U.S. Post Office in Florence',cityDescription:'Florence  is a city located in Florence County, South Carolina, United States. The city is the county seat of the Florence County and the primary city within the Florence metropolitan area. The area forms the core of the historical "Pee Dee" region of South Carolina, which includes the eight counties of northeastern South Carolina, along with sections of southeastern North Carolina. The U.S. Census Bureau estimated the city\'s population at 37,326, representing an increase of .7 percent.'},{airportCode:'FOD',cityName:'Fort Dodge, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Dodge,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Fort_Dodge_Iowa.jpg/250px-Fort_Dodge_Iowa.jpg',imgDescription:'Central Avenue',cityDescription:'Fort Dodge is a city in and the county seat of Webster County, Iowa, United States, along the Des Moines River. The population was 25,206 in the 2010 census, an increase from 25,136 in the 2000 census. Fort Dodge is a major commercial center for North Central and Northwest Iowa. It is located on U.S. Routes 20 and 169.'},{airportCode:'FLL',cityName:'Fort Lauderdale, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Lauderdale,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a4/Ft_Lauderdale_Skyline.jpg/250px-Ft_Lauderdale_Skyline.jpg',imgDescription:'Downtown Fort Lauderdale',cityDescription:'Fort Lauderdale   is a city in the U.S. state of Florida, on the Atlantic coast 23 miles  north of Miami. It is the county seat of Broward County. As of the 2010 census, the city had a population of 165,521. It is a principal city of the South Florida metropolitan area, which was home to 5,564,635 people at the 2010 census.'},{airportCode:'TBN',cityName:'Fort Leonard Wood, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Leonard_Wood,_Missouri',imgUrl:undefined,imgDescription:undefined,cityDescription:'Fort Leonard Wood is a census-designated place  in Pulaski County, Missouri, United States. The population was 13,667 at the 2000 census. It is named in honor of Major General Leonard Wood, who was awarded the Medal of Honor. The Fort Leonard Wood Micropolitan Statistical Area comprises Pulaski County.'},{airportCode:'RSW',cityName:'Fort Myers, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Myers,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/63/Fort_Myers_FL_Downtown_HD_1933_crths_pano01.jpg/250px-Fort_Myers_FL_Downtown_HD_1933_crths_pano01.jpg',imgDescription:'Sidney and Berne Davis Art Museum in downtown Fort Myers',cityDescription:'Fort Myers is the county seat and commercial center of Lee County, Florida. Fort Myers is a gateway to the Southwest Florida region and a major tourist destination within Florida. The winter homes of Thomas Edison  and Henry Ford  are a primary tourist attraction in the region. The city is named after Colonel Abraham Myers. The geographic statistical area is serviced by Southwest Florida International Airport , located southeast of the city.'},{airportCode:'FSM',cityName:'Fort Smith, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Smith,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/71/GarrisonFSM.jpg/253px-GarrisonFSM.jpg',imgDescription:'Garrison Avenue  Fort Smith, AR.',cityDescription:'Fort Smith is the second-largest city in Arkansas and one of the two county seats of Sebastian County. As of the 2010 Census, the population was 86,209. With an estimated population of 87,443 in 2012, it is the principal city of the Fort Smith, Arkansas-Oklahoma Metropolitan Statistical Area, a region of 298,592 residents that encompasses the Arkansas counties of Crawford, Franklin, and Sebastian and the Oklahoma counties Le Flore and Sequoyah.'},{airportCode:'VPS',cityName:'Fort Walton Beach, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Walton_Beach,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b0/Fort_Walton_Beach_City_Hall.JPG/250px-Fort_Walton_Beach_City_Hall.JPG',imgDescription:'Fort Walton Beach City Hall, September 2014',cityDescription:'Fort Walton Beach is a city in southern Okaloosa County, Florida, United States. As of 2010, the population estimate for Fort Walton Beach was 19,507 recorded by the U.S. Census Bureau. It is a principal city of the Fort Walton BeachCrestviewDestin Metropolitan Statistical Area.'},{airportCode:'FWA',cityName:'Fort Wayne, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Wayne,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Downtown_Fort_Wayne%2C_Indiana_Skyline_from_Old_Fort%2C_May_2014.jpg/250px-Downtown_Fort_Wayne%2C_Indiana_Skyline_from_Old_Fort%2C_May_2014.jpg',imgDescription:'Downtown Fort Wayne',cityDescription:'Coordinates: 410449.62N 850820.94W  41.0804500; -85.1391500'},{airportCode:'FYU',cityName:'Fort Yukon, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Fort_Yukon,_Alaska',imgUrl:undefined,imgDescription:undefined,cityDescription:'Fort Yukon  is a city in the Yukon-Koyukuk Census Area in the U.S. state of Alaska. The population, predominately Gwich\'in Alaska Natives, was 583 at the 2010 census.'},{airportCode:'FAT',cityName:'Fresno, California',wikiUrl:'https://en.wikipedia.org/wiki/Fresno,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/Downtown_Fresno_Night.png/250px-Downtown_Fresno_Night.png',imgDescription:'Downtown Fresno',cityDescription:'Fresno , the county seat of Fresno County, is a city in the U.S. state of California. As of 2015, the city\'s population was 520,159, making it the fifth largest city in California, the largest inland city in California and the 34th largest in the nation. Fresno is in the center of the San Joaquin Valley and is the largest city in the Central Valley, which contains the San Joaquin Valley. It is approximately 220 miles  north west of Los Angeles, 170 miles  south of the state capital, Sacramento, or 185 miles  south of San Francisco. The name Fresno means \'ash tree\' in Spanish, and an ash leaf is featured on the city\'s flag.'},{airportCode:'GNV',cityName:'Gainesville, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Gainesville,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/33/Gainesvillehippodrome.jpg/250px-Gainesvillehippodrome.jpg',imgDescription:'Downtown Gainesville at night',cityDescription:'Gainesville is the county seat and largest city in Alachua County, Florida, and the principal city of the Gainesville, Florida Metropolitan Statistical Area . The population of Gainesville in the 2013 US Census was 127,488, a 2.4% growth from 2010. Gainesville is the largest city in the region of North Central Florida. In addition, it is also a component of the Gainesville-Lake City Combined Statistical Area, which had a 2013 population of 337,925.'},{airportCode:'GCK',cityName:'Garden City, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Garden_City,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e1/Garden_City%2C_KS%2C_welcome_sign_IMG_5933.JPG/250px-Garden_City%2C_KS%2C_welcome_sign_IMG_5933.JPG',imgDescription:'Garden City, KS, welcome sign IMG 5933.JPG',cityDescription:'Garden City is a city in and the county seat of Finney County, Kansas, United States. As of the 2010 census, the city population was 26,658. The city is home to Garden City Community College and the Lee Richardson Zoo, the largest zoological park in western Kansas.'},{airportCode:'GCC',cityName:'Gillette, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Gillette,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/Gilette_WY.jpg/250px-Gilette_WY.jpg',imgDescription:'Gillette seen from I-90',cityDescription:'Gillette is a city in and the county seat of Campbell County, Wyoming, United States. The population was estimated at 31,797 as of 1 July 2013. Gillette is centrally located in an area involved with the development of vast quantities of American coal, oil, and coalbed methane gas. The city calls itself the "Energy Capital of the Nation," noting that the state of Wyoming provides nearly 35% of the nation\'s coal. Over the last decade Gillette saw a population increase of 48% from the 2000 census of 19,646 residents.'},{airportCode:'GDV',cityName:'Glendive, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Glendive,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0f/Glendive_city_hall.jpg/250px-Glendive_city_hall.jpg',imgDescription:'Glendive City Hall',cityDescription:'Glendive is a city in and the county seat of Dawson County, Montana, United States. Glendive was established by the Northern Pacific Railway when they built the transcontinental railroad across the northern tier of the western United States from Minnesota to the Pacific Coast. The town was the headquarters for the Yellowstone Division that encompassed 875 route miles ; 546  in main line and 328  in branches with the main routes from Mandan, North Dakota, to Billings, Montana, and from Billings to Livingston, Montana. The town of Glendive is an agricultural and ranching hub of eastern Montana. The town is tucked between the Yellowstone River and the Badlands, named for the rugged terrain and jagged rock formations that are known to exist in the area. Makoshika State Park is located just east of Glendive.'},{airportCode:'GFK',cityName:'Grand Forks, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Grand_Forks,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/16/FEMA_-_29438_-_Photograph_by_Brenda_Riskey_taken_on_05-17-2006_in_North_Dakota.jpg/250px-FEMA_-_29438_-_Photograph_by_Brenda_Riskey_taken_on_05-17-2006_in_North_Dakota.jpg',imgDescription:'Aerial view of downtown Grand Forks in 2006.',cityDescription:'Grand Forks is the third-largest city in the State of North Dakota  and the county seat of Grand Forks County. According to the 2010 census, the city\'s population was 52,838, while that of the city and surrounding metropolitan area was 98,461. Grand Forks, along with its twin city of East Grand Forks, Minnesota, forms the center of the Grand Forks, ND-MN Metropolitan Statistical Area, which is often called Greater Grand Forks or The Grand Cities.'},{airportCode:'GRI',cityName:'Grand Island, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Grand_Island,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/Hall_County_Courthouse%2C_Grand_Island.jpg/250px-Hall_County_Courthouse%2C_Grand_Island.jpg',imgDescription:'Hall County Courthouse in Grand Island',cityDescription:'Grand Island is a city in and the county seat of Hall County, Nebraska, United States. The population was 48,520 at the 2010 census.'},{airportCode:'GJT',cityName:'Grand Junction, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Grand_Junction,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/Grand-junction-skyline.jpg/250px-Grand-junction-skyline.jpg',imgDescription:'Grand-junction-skyline.jpg',cityDescription:'The City of Grand Junction is the home rule municipality that is the county seat and the most populous municipality of Mesa County, Colorado, United States. The city has a councilmanager form of government, and is most populous municipality in all of western Colorado. Grand Junction is situated 247 miles  west-southwest of the Colorado State Capitol in Denver. As of the 2010 census, the population of the city was 58,566. Grand Junction is the 15th most populous city in the State of Colorado and the most populous city on the Colorado Western Slope. Grand Junction serves as a major commercial and transportation hub within the large area between the Green River and the Continental Divide. It is the principal city of the Grand Junction Metropolitan Statistical Area which had a population of 146,723 in 2010 census.'},{airportCode:'GRR',cityName:'Grand Rapids, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Grand_Rapids,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Grand_Rapids_montage.jpg/290px-Grand_Rapids_montage.jpg',imgDescription:'Images from top to bottom, left to right: downtown cityscape, Meyer May House, Gerald R. Ford Presidential Museum,La Grande Vitesse, pedestrian bridge over the Grand River, Van Andel Arena, Grand Valley State University\'s CookDeVos Center on the Medical Mile',cityDescription:'Grand Rapids is the second-largest city in the U.S. state of Michigan, and the largest city in West Michigan. It is located on the Grand River about 30 miles east of Lake Michigan. As of the 2010 census, the city population was 188,040. In 2010, the Grand Rapids metropolitan area had a population of 1,005,648, and the combined statistical area of Grand Rapids-Muskegon-Holland had a population of 1,321,557. Grand Rapids is the county seat of Kent County, Michigan.'},{airportCode:'GBD',cityName:'Great Bend, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Great_Bend,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Downtown_Great_Bend_Kansas_5-5-2012.jpg/250px-Downtown_Great_Bend_Kansas_5-5-2012.jpg',imgDescription:'Downtown Great Bend (2012)',cityDescription:'Great Bend is a city in and the county seat of Barton County, Kansas, United States. It is named for its location at the point where the course of the Arkansas River bends east then southeast. As of the 2010 census, the population of the city was 15,995.'},{airportCode:'GTF',cityName:'Great Falls, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Great_Falls,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Panorama_Great_Falls.JPG/250px-Panorama_Great_Falls.JPG',imgDescription:'Great Falls, Montana as viewed from Interstate 15, looking due north',cityDescription:'Great Falls is a city in and the county seat of Cascade County, Montana, United States. The 2013 census estimate put the population at 59,351. The population was 58,505 at the 2010 census. It is the principal city of the Great Falls, Montana Metropolitan Statistical Area, which encompasses all of Cascade County and has a population of 82,384. Great Falls was the largest city in Montana from 1950 to 1970, when Billings surpassed it. Great Falls remained the second largest city in Montana until 2000, when it was passed by Missoula. Since then Great Falls has been the third largest city in the state.'},{airportCode:'GRB',cityName:'Green Bay, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Green_Bay,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Downtown_Green_Bay_CityDeck_along_the_Fox_River.jpg/250px-Downtown_Green_Bay_CityDeck_along_the_Fox_River.jpg',imgDescription:'Downtown Green Bay',cityDescription:'Green Bay is a city in and the county seat of Brown County in the State of Wisconsin, located at the head of Green Bay, a sub-basin of Lake Michigan, at the mouth of the Fox River. It has an elevation of 581 feet  above sea level and is located 112 miles  north of Milwaukee. The population was 104,057 at the 2010 census. It is the third-largest city in the state of Wisconsin, after Milwaukee and Madison. It is also the third-largest city on the west shore of Lake Michigan, after Chicago and Milwaukee. Green Bay is home to the National Football League Green Bay Packers.'},{airportCode:'LWB',cityName:'Greenbrier, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Greenbrier,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/d/de/Greenbrier_County_wv_seal.png/75px-Greenbrier_County_wv_seal.png',imgDescription:'Seal of Greenbrier County, West Virginia',cityDescription:'Greenbrier County , is a county located in the U.S. state of West Virginia. As of the 2010 census, the population was 35,480. Its county seat is Lewisburg. The county was formed in 1778 from Botetourt and Montgomery counties in Virginia.'},{airportCode:'GSO',cityName:'Greensboro, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Greensboro,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/Greensboro_Skyline.jpg/250px-Greensboro_Skyline.jpg',imgDescription:'Greensboro skyline',cityDescription:'Greensboro   is a city in the U.S. state of North Carolina. It is the third-largest city by population in North Carolina and the largest city in Guilford County and the surrounding Piedmont Triad metropolitan region. According to the 2012 U.S. Census Estimate, Greensboro\'s population is 277,080. It is located at the intersection of three major interstate highways  in the Piedmont region of central North Carolina.'},{airportCode:'GLH',cityName:'Greenville, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Greenville,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e2/Washington_Avenue_Greenville.jpg/250px-Washington_Avenue_Greenville.jpg',imgDescription:'Washington Avenue Greenville.jpg',cityDescription:'Greenville is a city in Washington County, Mississippi, United States. The population was 34,400 at the 2010 census. It is the county seat of Washington County, located in the area of historic cotton plantations and culture known as the Mississippi Delta.'},{airportCode:'PGV',cityName:'Greenville, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Greenville,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fe/Uptown_Greenville%2C_NC.jpg/280px-Uptown_Greenville%2C_NC.jpg',imgDescription:'Aerial View of Uptown Greenville',cityDescription:'Greenville is the county seat of Pitt County, principal city of the Greenville metropolitan area, and the 10th largest city in the state of North Carolina. Greenville is the health, entertainment, and educational hub of North Carolina\'s Tidewater and Coastal Plain. The city\'s official population as of the 2013 United States census estimate is 89,130 residents while the Greenville Metropolitan Area includes 174,263 people. In January 2008 and January 2010, Greenville was named one of the nation\'s "100 Best Communities for Young People" by the America\'s Promise Alliance. In June 2012, Greenville was ranked in the top ten of the nation\'s "Best Small Places For Business And Careers" by Forbes Magazine. In 2010 Greenville was ranked twenty-fourth in mid-city business growth and development by Forbes Magazine.'},{airportCode:'GSP',cityName:'Greenville, South Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Greenville,_South_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c9/Greenvillenightskyline.jpg/320px-Greenvillenightskyline.jpg',imgDescription:'Skyline of Downtown Greenville',cityDescription:'Greenville  is the seat of Greenville County in upstate South Carolina, United States. The city\'s mayor is Knox White, who has served as the mayor of Greenville since December 1995. With a population of 62,252 as of 2014, it is the sixth-largest municipality in the state. The population of the surrounding area was 400,492 as of 2010, making it the third-largest urban area in South Carolina as well as the fastest growing. Greenville is the largest city in the Greenville-Anderson-Mauldin Metropolitan Statistical Area. The MSA had a population of 850,965 in 2013, making it the largest in South Carolina and the fourth largest in the Carolinas.'},{airportCode:'GPT',cityName:'Gulfport, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Gulfport,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ab/Gulfport_Sign.jpg/251px-Gulfport_Sign.jpg',imgDescription:'Highway sign along U.S. Route 90',cityDescription:'Gulfport is the second largest city in Mississippi after the state capital Jackson. It is the larger of the two principal cities of the Gulfport-Biloxi, Mississippi Metropolitan Statistical Area, which is included in the Gulfport-Biloxi-Pascagoula, Mississippi Combined Statistical Area. As of the 2010 census, the city of Gulfport had a total population of 67,793. Gulfport is co-county seat with Biloxi of Harrison County, Mississippi. Gulfport is also home to the US Navy Atlantic Fleet Seabees.'},{airportCode:'GUC',cityName:'Gunnison, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Gunnison,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/Vienna_Bakery-Johnson_Restaurant.JPG/250px-Vienna_Bakery-Johnson_Restaurant.JPG',imgDescription:'Vienna Bakery-Johnson Restaurant in Gunnison',cityDescription:'The City of Gunnison is the county seat and the most populous municipality of Gunnison County, Colorado, United States. As of the 2010 census, the city had a population of 5,854. It was named in honor of John W. Gunnison, a United States Army officer who surveyed for the transcontinental railroad in 1853. Gunnison is a Home Rule municipality which reserves the right to choose how it is governed.'},{airportCode:'HGR',cityName:'Hagerstown, Maryland',wikiUrl:'https://en.wikipedia.org/wiki/Hagerstown,_Maryland',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/e/eb/Hagerstown_md_seal.png/100px-Hagerstown_md_seal.png',imgDescription:'Official seal of Hagerstown, Maryland',cityDescription:'Hagerstown  is a city in Washington County, Maryland. It is the county seat of Washington County, and by many definitions, the largest city in a region known as Western Maryland . The population of Hagerstown city proper at the 2010 census was 39,662, and the population of the Hagerstown-Martinsburg Metropolitan Area  was 269,140. Hagerstown ranks as Maryland\'s sixth largest incorporated city.'},{airportCode:'HNM',cityName:'Hana, Maui, Hawaii'},{airportCode:'CMX',cityName:'Hancock, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Hancock,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/HancockMichiganPanoramaM26.jpg/250px-HancockMichiganPanoramaM26.jpg',imgDescription:'Hancock panorama from Houghton',cityDescription:'Hancock is a city in Houghton County, Michigan, United States and is located on Copper Island, which is part of the Keweenaw Peninsula, on the Keewenaw Waterway directly opposite Houghton, Michigan. The population was 4,634 at the 2010 census.'},{airportCode:'HRL',cityName:'Harlingen, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Harlingen,_Texas',imgUrl:undefined,imgDescription:undefined,cityDescription:'Harlingen  is a city in Cameron County in the heart of the Rio Grande Valley of south Texas, United States, about 30 miles  from the coast of the Gulf of Mexico. The city covers more than 40 square miles  and is the second largest city in Cameron County, as well as the sixth largest in the Rio Grande Valley. As of the 2010 census the city had a population of 64,849, for a growth rate of 12.5% since the 2000 census. It is the city with the least expensive cost of living in the United States.'},{airportCode:'MDT',cityName:'Harrisburg, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Harrisburg,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Harrisburg%2C_Pennsylvania_photomontage.JPG/250px-Harrisburg%2C_Pennsylvania_photomontage.JPG',imgDescription:'From top to bottom, left to right: Harrisburg skyline; Market Square in Downtown Harrisburg; Pennsylvania State Capitol; Metro Bank Park; Walnut Street Bridge; Susquehanna River',cityDescription:'Harrisburg  is the capital city of the U.S. state of Pennsylvania and the county seat of Dauphin County. With a population of 49,673, it is the tenth-largest city in the U.S. state of Pennsylvania. It lies on the east bank of the Susquehanna River, 105 miles  west-northwest of Philadelphia and 204 miles  east of Pittsburgh.'},{airportCode:'HRO',cityName:'Harrison, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/Harrison,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c1/Harrison_AR_downtown.jpg/250px-Harrison_AR_downtown.jpg',imgDescription:'Historic downtown Harrison',cityDescription:'Harrison is a city in Boone County, Arkansas, United States. It is the county seat. It named after General M. LaRue Harrison, a surveyor that laid out the city along Crooked Creek at Stifler Springs. According to 2012 Census Bureau estimates, the population of the city was 13,163, up from 12,943 at the 2010 census.'},{airportCode:'BDL',cityName:'Hartford, Connecticut',wikiUrl:'https://en.wikipedia.org/wiki/Hartford,_Connecticut',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/Hartford_CT.JPG/260px-Hartford_CT.JPG',imgDescription:'Hartford CT.JPG',cityDescription:'Hartford is the capital of Connecticut and the historic seat of Hartford County until Connecticut disbanded county government in 1960. As of the 2010 Census, Hartford\'s population was 124,775, making it Connecticut\'s fourth-largest city after the coastal cities of Bridgeport, New Haven, and Stamford.'},{airportCode:'HVR',cityName:'Havre, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Havre,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Havre_Montana_RR_Station.jpg/250px-Havre_Montana_RR_Station.jpg',imgDescription:'The Havre railroad stationthe sculpture is "U.S.  Canada Friendship"',cityDescription:'Havre   is the county seat and largest town in Montanas Hill County. It is said to be named after the city of Le Havre in France. As of 2014 , the U.S. Census Bureau estimated the citys population was 9,792. Havre is listed as #4 in "Montana\'s Most Dangerous Cities" ranking.'},{airportCode:'HYS',cityName:'Hays, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Hays,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/Hays_KS%2C_10_x_Main_NW_corner_1.JPG/250px-Hays_KS%2C_10_x_Main_NW_corner_1.JPG',imgDescription:'Main Street in Downtown Hays (2014)',cityDescription:'Hays is a city in and the county seat of Ellis County, Kansas, United States. The largest city in northwestern Kansas, it is the economic and cultural center of the region. It is also a college town, home to Fort Hays State University. As of the 2010 census, the city population was 20,510.'},{airportCode:'HLN',cityName:'Helena, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Helena,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Helena_Montana_2006.jpg/250px-Helena_Montana_2006.jpg',imgDescription:'Helena, Montana in 2006',cityDescription:'Helena  is the capital city of the U.S. State of Montana and the county seat of Lewis and Clark County. The 2010 census put the population at 28,190 and the Lewis and Clark County population at 63,395. Helena is the principal city of the Helena Micropolitan Statistical Area, which includes all of Lewis and Clark and Jefferson counties; its population is 77,414 according to the 2014 Census Estimate.'},{airportCode:'HIB',cityName:'Hibbing, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Hibbing,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Street_in_Hibbing%2C_MN.jpg/300px-Street_in_Hibbing%2C_MN.jpg',imgDescription:'Street in Hibbing, Minnesota in August 2007',cityDescription:'Hibbing is a city in Saint Louis County, Minnesota, United States. The population was 16,361 at the 2010 census. The city was built on the rich iron ore of the Mesabi Iron Range. At the edge of town is the largest open-pit iron mine in the world, the HullRustMahoning Open Pit Iron Mine. U.S. Highway 169, State Highway 37, State Highway 73, Howard Street, and 1st Avenue are five of the main routes in Hibbing. The Range Regional Airport offers daily commercial flights between Hibbing and Minneapolis, as well as hosting many private pilots and the Minnesota Department of Natural Resources fire fighting aircraft.'},{airportCode:'HHH',cityName:'Hilton Head Island, South Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Hilton_Head_Island,_South_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a4/Harbour_Town_July_2007.jpg/250px-Harbour_Town_July_2007.jpg',imgDescription:'Harbour Town Marina in Sea Pines Resort with the Harbour Town Lighthouse',cityDescription:'Hilton Head Island, sometimes referred to as simply Hilton Head, is a Lowcountry resort town located on an island of the same name in Beaufort County, South Carolina, United States. It is 20 miles  northeast of Savannah, Georgia, and 95 miles  southwest of Charleston. The island is named after Captain William Hilton, who in 1663, identified a headland near the entrance to Port Royal Sound, which he named "Hilton\'s Head" after himself. The island features 12 miles  of beachfront on the Atlantic Ocean and is a popular vacation destination. In 2004, an estimated 2.25 million visitors pumped more than $1.5 billion into the local economy. The year-round population was 37,099 at the 2010 census, although during the peak of summer vacation season the population can swell to 275,000. Over the past decade, the island\'s population growth rate was 32%. Hilton Head Island is a primary city within the Hilton Head Island-Bluffton-Beaufort, SC Metropolitan Statistical Area.'},{airportCode:'HOB',cityName:'Hobbs, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Hobbs,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Hobbs_New_Mexico_Public_Library.jpg/250px-Hobbs_New_Mexico_Public_Library.jpg',imgDescription:'Hobbs Public Library',cityDescription:'Hobbs is a city in Lea County, New Mexico, United States. The population was 34,122 at the 2010 Census, increasing from 28,657 at the 2000 census.'},{airportCode:'HOM',cityName:'Homer, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Homer,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/Homerfromslough.JPG/250px-Homerfromslough.JPG',imgDescription:'Downtown Homer seen from Beluga Slough',cityDescription:'Homer is a city located in Kenai Peninsula Borough in the U.S. state of Alaska. According to the 2010 Census, the population is 5,003. Long known as The "Halibut Fishing Capital of the World." Homer is also nicknamed "the end of the road," and more recently, "the cosmic hamlet by the sea."'},{airportCode:'HNL',cityName:'Honolulu, Oahu, Hawaii'},{airportCode:'MKK',cityName:'Hoolehua, Molokai, Hawaii'},{airportCode:'EFD',cityName:'Houston, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Houston,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/2/24/Houston_Images.jpg/250px-Houston_Images.jpg',imgDescription:'Clockwise from top: Sam Houston monument, Downtown Houston, Houston Ship Channel, The Galleria, University of Houston, and the Christopher C. Kraft Jr. Mission Control Center',cityDescription:'Houston  is the most populous city in Texas and the fourth most populous city in the United States. With a census-estimated 2014 population of 2.239 million people, within a land area of 599.6 square miles , it also is the largest city in the Southern United States, as well as the seat of Harris County. It is the principal city of HoustonThe WoodlandsSugar Land, which is the fifth most populated metropolitan area in the United States.'},{airportCode:'HOU',cityName:'Houston, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Houston,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/2/24/Houston_Images.jpg/250px-Houston_Images.jpg',imgDescription:'Clockwise from top: Sam Houston monument, Downtown Houston, Houston Ship Channel, The Galleria, University of Houston, and the Christopher C. Kraft Jr. Mission Control Center',cityDescription:'Houston  is the most populous city in Texas and the fourth most populous city in the United States. With a census-estimated 2014 population of 2.239 million people, within a land area of 599.6 square miles , it also is the largest city in the Southern United States, as well as the seat of Harris County. It is the principal city of HoustonThe WoodlandsSugar Land, which is the fifth most populated metropolitan area in the United States.'},{airportCode:'IAH',cityName:'Houston, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Houston,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/2/24/Houston_Images.jpg/250px-Houston_Images.jpg',imgDescription:'Clockwise from top: Sam Houston monument, Downtown Houston, Houston Ship Channel, The Galleria, University of Houston, and the Christopher C. Kraft Jr. Mission Control Center',cityDescription:'Houston  is the most populous city in Texas and the fourth most populous city in the United States. With a census-estimated 2014 population of 2.239 million people, within a land area of 599.6 square miles , it also is the largest city in the Southern United States, as well as the seat of Harris County. It is the principal city of HoustonThe WoodlandsSugar Land, which is the fifth most populated metropolitan area in the United States.'},{airportCode:'EFD',cityName:'Houston, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Houston,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/2/24/Houston_Images.jpg/250px-Houston_Images.jpg',imgDescription:'Clockwise from top: Sam Houston monument, Downtown Houston, Houston Ship Channel, The Galleria, University of Houston, and the Christopher C. Kraft Jr. Mission Control Center',cityDescription:'Houston  is the most populous city in Texas and the fourth most populous city in the United States. With a census-estimated 2014 population of 2.239 million people, within a land area of 599.6 square miles , it also is the largest city in the Southern United States, as well as the seat of Harris County. It is the principal city of HoustonThe WoodlandsSugar Land, which is the fifth most populated metropolitan area in the United States.'},{airportCode:'HTS',cityName:'Huntington, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Huntington,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/HWV_Collage.jpg/250px-HWV_Collage.jpg',imgDescription:'Clockwise: the Paul Ambrose Trail for Health (PATH), Fourth Avenue, the downtown skyline as seen from across the Ohio River, Harris Riverfront Park, and the Huntington Welcome Center at Heritage Station.',cityDescription:'Huntington is a city in Cabell and Wayne counties in the U.S. state of West Virginia, located at the confluence of the Guyandotte River and the Ohio River. Most of the city is in Cabell County, for which it is the county seat. The first permanent settlement, Holderby\'s Landing, was founded in 1775 in what was then the Colony of Virginia. The City of Huntington was founded as the western terminus of the Chesapeake and Ohio Railway in 1871.'},{airportCode:'HSV',cityName:'Huntsville, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Huntsville,_Alabama',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/28/HsvMontage.jpg/300px-HsvMontage.jpg',imgDescription:'Clockwise from top: Big Spring Park, the Old Times Building, the Madison County Courthouse, the Von Braun Center, and Governors Drive',cityDescription:'Huntsville is a city located primarily in Madison County in the central part of the far northern region of the U.S. State of Alabama. Huntsville is the county seat of Madison County. The city extends west into neighboring Limestone County. Huntsville\'s population was 180,105 as of the 2010 census. The Huntsville Metropolitan Area\'s population was 417,593. Huntsville is the fourth-largest city in Alabama and the largest city in the five-county Huntsville-Decatur Combined Statistical Area, which at the 2013 census estimate had a total population of 683,871. In 2013, the Huntsville metropolitan area became the 2nd largest in Alabama with a population of 435,737.'},{airportCode:'HON',cityName:'Huron, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Huron,_South_Dakota',imgUrl:undefined,imgDescription:undefined,cityDescription:'Huron is a city in Beadle County, South Dakota, United States. The population was 12,592 at the 2010 census. It is the county seat of Beadle County. Huron was the home of now-defunct Huron University . Huron is also the home of the South Dakota State Fair. The Huron Plainsman, also referred to as the Plainsman, is the newspaper. The city was named after the Huron Indians. It is currently the ninth largest city in South Dakota, but it once was the fourth.'},{airportCode:'HYA',cityName:'Hyannis, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Hyannis,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/Sailboat_in_Hyannis_Harbor.jpg/250px-Sailboat_in_Hyannis_Harbor.jpg',imgDescription:'A sailboat in Hyannis Harbor',cityDescription:'Hyannis  is the largest of the seven villages in the town of Barnstable, Massachusetts, in the United States. It is the commercial and transportation hub of Cape Cod and was designated an urban area as of the 1990 census. Because of this, many refer to Hyannis as the "Capital of the Cape". It contains a majority of the Barnstable Town offices and two important shopping districts: the historic downtown Main Street and the Route 132 Commercial District, including Cape Cod Mall and Independence Park, headquarters of Cape Cod Potato Chips. Cape Cod Hospital in Hyannis is the largest on Cape Cod.'},{airportCode:'IDA',cityName:'Idaho Falls, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Idaho_Falls,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/8/89/Idaho_Falls%2C_Idaho_city_seal.png/100px-Idaho_Falls%2C_Idaho_city_seal.png',imgDescription:'Official seal of Idaho Falls',cityDescription:'Idaho Falls is a city in and the county seat of Bonneville County, Idaho, United States, and is the largest city in Eastern Idaho. As of the 2010 census, the population of Idaho Falls was 56,813, with a metro population of 136,108. As of 2013, the population was estimated at 58,292.'},{airportCode:'IND',cityName:'Indianapolis, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/Indianapolis,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b5/IndianapolisC12.png/250px-IndianapolisC12.png',imgDescription:'Clockwise from top: Downtown Indianapolis skyline, as seen from IUPUI, the Indiana Statehouse, Lucas Oil Stadium, Indianapolis Motor Speedway, the Indiana World War Memorial Plaza, and the Soldiers\' and Sailors\' Monument.',cityDescription:'Indianapolis  is the capital of the U.S. state of Indiana and the county seat of Marion County. With an estimated population of 848,788 in 2014, Indianapolis is the largest city in Indiana, second largest in the American Midwest, and 14th largest in the U.S. IndianapolisCarmelAnderson is the 33rd largest metropolitan area in the U.S., with nearly 2 million inhabitants. Residents of the city are occasionally referred to as "Indianapolitans," although this archaic term is rarely used.'},{airportCode:'INL',cityName:'International Falls, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/International_Falls,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/90/International_Falls%2C_Minnesota_1.jpg/250px-International_Falls%2C_Minnesota_1.jpg',imgDescription:'International Falls, Minnesota 1.jpg',cityDescription:'International Falls is a city in and the county seat of Koochiching County, Minnesota, United States. The population was 6,424 at the 2010 census.'},{airportCode:'IYK',cityName:'Inyokern, California',wikiUrl:'https://en.wikipedia.org/wiki/Inyokern,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/c/c4/Inyokern.jpg/250px-Inyokern.jpg',imgDescription:'Inyokern entrance sign',cityDescription:'Inyokern  is a census-designated place  in Kern County, California, United States. Inyokern is located 8 miles  west of Ridgecrest, at an elevation of 2434 feet . It is on the western side of the Indian Wells Valley. The population was 1,099 at the 2010 census, up from 984 at the 2000 census. It was a railroad town established along the Southern Pacific railroad Lone Pine Branch . It is served by Inyokern Airport.'},{airportCode:'IMT',cityName:'Iron Mountain, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Iron_Mountain,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/07/2009-0619-IronMountain-CH.jpg/250px-2009-0619-IronMountain-CH.jpg',imgDescription:'Iron Mountain City Hall',cityDescription:'Iron Mountain is a city in the U.S. state of Michigan. The population was 7,624 at the 2010 census. It is the county seat of Dickinson County, in the state\'s Upper Peninsula. Iron Mountain was named for the valuable iron ore found in the vicinity.'},{airportCode:'IWD',cityName:'Ironwood, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Ironwood,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/2009-0617-downtown-Ironwood.jpg/250px-2009-0617-downtown-Ironwood.jpg',imgDescription:'Downtown Ironwood',cityDescription:'Ironwood is a city in Gogebic County in the U.S. state of Michigan, about 18 miles  south of Lake Superior. The population was 5,387 at the 2010 census. The city is on US 2 and is situated opposite the Montreal River from Hurley, Wisconsin. It is the westernmost city in Michigan, situated on the same line of longitude  as Clinton, Iowa and St. Louis, Missouri.'},{airportCode:'ISP',cityName:'Islip, New York',wikiUrl:'https://en.wikipedia.org/wiki/Islip,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/Islip_Town_Hall.JPG/250px-Islip_Town_Hall.JPG',imgDescription:'Islip Town Hall, the heart of both the Town and Hamlet of Islip',cityDescription:'Islip  is one of ten towns in Suffolk County, New York . Located on the South Shore of Long Island, the town population was 335,543 at the 2010 census. Within the Town of Islip is a smaller, unincorporated hamlet and census-designated place also named Islip.'},{airportCode:'ITH',cityName:'Ithaca, New York',wikiUrl:'https://en.wikipedia.org/wiki/Ithaca,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Ithaca_Montage.jpg/250px-Ithaca_Montage.jpg',imgDescription:'From top left: Ithaca during winter, Ithaca during autumn, Cornell University, Ithaca Commons (downtown), Hemlock Gorge in Ithaca, Ithaca Falls',cityDescription:'The city of Ithaca  is in central New York and is the county seat of Tompkins County, as well as the largest community in the Ithaca-Tompkins County metropolitan area. This contains the municipalities of the Town of Ithaca, the village of Cayuga Heights, and other towns and villages in Tompkins County. The city of Ithaca is located on the southern shore of Cayuga Lake, in Central New York. It is named for the Greek island of Ithaca.'},{airportCode:'JAC',cityName:'Jackson Hole, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Jackson_Hole,_Wyoming',imgUrl:undefined,imgDescription:undefined,cityDescription:'Jackson Hole is the valley floor between the Teton Mountain Range and the Snake River, located along the border of Wyoming and Idaho. The name "hole" was used by early trappers or mountain men, who primarily entered the valley from the north and east and had to descend along relatively steep slopes, giving the sensation of entering a hole. These low-lying valleys are surrounded by mountains and contain rivers and streams, which were good habitat for beaver and other fur-bearing animals.'},{airportCode:'JAN',cityName:'Jackson, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Jackson,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/62/JacksonMissColl.png/250px-JacksonMissColl.png',imgDescription:'Images top, left to right: Mississippi State Capitol, Old Mississippi State Capitol, Lamar Life Building, Mississippi Governor\'s Mansion',cityDescription:'Jackson is the capital of and the largest city in the U.S. state of Mississippi. It is located primarily in Hinds County, serving as one of two county seats there; segments of the city overlap Madison County and Rankin County. Jackson is on the Pearl River, which drains into the Gulf of Mexico, and it is part of the Jackson Prairie region of the state. The city is named after General Andrew Jackson, who was honored for his role in the Battle of New Orleans during the War of 1812 and later served as U.S. President.'},{airportCode:'MKL',cityName:'Jackson, Tennessee'},{airportCode:'JAX',cityName:'Jacksonville, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Jacksonville,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/35/JXFL2011N.png/250px-JXFL2011N.png',imgDescription:'Top, left to right: Downtown Jacksonville, statue of Andrew Jackson, Prime F. Osborn III Convention Center, EverBank Field, Veterans Memorial Arena, Florida Theatre',cityDescription:'Jacksonville is the largest city by population in the U.S. state of Florida, and the largest city by area in the contiguous United States. It is the county seat of Duval County, with which the city government consolidated in 1968. Consolidation gave Jacksonville its great size and placed most of its metropolitan population within the city limits; with an estimated population of 853,382 in 2014, it is the most populous city proper in Florida and the Southeast, and the 12th most populous in the United States. Jacksonville is the principal city in the Jacksonville metropolitan area, with a population of 1,345,596 in 2010.'},{airportCode:'OAJ',cityName:'Jacksonville, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Jacksonville,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/f/f3/Jacksonville_NC_1904_Courthouse.jpg/250px-Jacksonville_NC_1904_Courthouse.jpg',imgDescription:'The 1904 Onslow County Courthouse with Highway Patrol car parked on the corner of Old Bridge and Court Streets.',cityDescription:'Jacksonville  is a city in Onslow County, North Carolina, United States. As of the 2010 United States census, the population stood at 70,145, which makes Jacksonville the 14th largest city in North Carolina. Jacksonville is the principal city of and is included in the Jacksonville, North Carolina metropolitan area. In 2014, Forbes magazine ranked Jacksonville as the fifth fastest-growing small city in the United States. Demographically, Jacksonville is the youngest city in the United States with an average age of 22.8 years old, which can be attributed to the large military presence. The low age may also be in part due to the population drastically going up over the past 80 years, from a mere 783 in the 1930 census to 70,145 in the 2010 census.'},{airportCode:'JMS',cityName:'Jamestown, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Jamestown,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6e/World%27s_Largest_Buffalo_Monument_2009.jpg/250px-World%27s_Largest_Buffalo_Monument_2009.jpg',imgDescription:'World\'s Largest Buffalo Monument in Jamestown',cityDescription:'Jamestown is a city in Stutsman County, North Dakota, United States. It is the county seat of Stutsman County. The population was 15,427 at the 2010 census, making it the ninth largest city in North Dakota. Jamestown was founded in 1872.'},{airportCode:'JHW',cityName:'Jamestown, New York',wikiUrl:'https://en.wikipedia.org/wiki/Jamestown,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Downtown_Jamestown.JPG/250px-Downtown_Jamestown.JPG',imgDescription:'Downtown Jamestown, view from Washington Street.',cityDescription:'Jamestown is a city in southern Chautauqua County, New York, in the United States. The population was 31,146 at the 2010 census. Situated between Lake Erie to the northwest and the Allegheny National Forest to the south, Jamestown is the largest population center in the county. Nearby Chautauqua Lake is a fresh water resource enjoyed by fishermen, boaters and naturalists. Chautauqua Institution is approximately 17 miles away, offering music, theater, educational classes and lectures for nine weeks during the summer.'},{airportCode:'JST',cityName:'Johnstown, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Johnstown,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/JohnstownPanorama.jpg/250px-JohnstownPanorama.jpg',imgDescription:'JohnstownPanorama.jpg',cityDescription:'Johnstown is a city in Cambria County, Pennsylvania, United States, 43 miles  west-southwest of Altoona and 67 miles  east of Pittsburgh. The population was 20,978 at the 2010 census and estimated to be 20,402 in 2013. It is the principal city of the Johnstown, Pennsylvania, Metropolitan Statistical Area, which includes Cambria County.'},{airportCode:'JLN',cityName:'Joplin, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Joplin,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f0/DowntownJoplinMo.JPG/250px-DowntownJoplinMo.JPG',imgDescription:'Aerial view of downtown Joplin, 2009. The bridge is 2nd Street and the intersection is 2nd St. and Virginia Ave.',cityDescription:'Joplin  is a city in southern Jasper County and northern Newton County in the southwestern corner of the US state of Missouri. Joplin is the largest city in Jasper County, though it is not the county seat. As of the 2010 census, the city population was 50,150. Joplin is the main hub of the three county Joplin-Miami, Oklahoma Metropolitan area.'},{airportCode:'JNU',cityName:'Juneau, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Juneau,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/Downtown_Juneau_and_Douglas_Island.jpg/300px-Downtown_Juneau_and_Douglas_Island.jpg',imgDescription:'Aerial view of Downtown Juneau, the cruise ship port, and Douglas Island from the Mount Roberts Tramway.',cityDescription:'The City and Borough of Juneau  is the capital city of Alaska. It is a unified municipality located on the Gastineau Channel in the Alaskan panhandle, and it is the second largest city in the United States by area. Juneau has been the capital of Alaska since 1906, when the government of what was then the District of Alaska was moved from Sitka as dictated by the U.S. Congress in 1900. The municipality unified on July 1, 1970, when the city of Juneau merged with the city of Douglas and the surrounding Greater Juneau Borough to form the current municipality, which is larger by area than both Rhode Island and Delaware.'},{airportCode:'OGG',cityName:'Kahului, Maui, Hawaii',wikiUrl:'https://en.wikipedia.org/wiki/Kahului,_Maui,_Hawaii',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/AirViewKahului.jpg/250px-AirViewKahului.jpg',imgDescription:'Aerial view of Kahului from the southwest',cityDescription:'Kahului is a census-designated place  in Maui County, on the island of Maui, in the U.S. state of Hawaii. Kahului hosts Maui\'s main airport , deep-draft harbor, light industrial areas, and commercial shopping centers. The population was 26,337 at the 2010 census.'},{airportCode:'AZO',cityName:'Kalamazoo, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Kalamazoo,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7c/Kalamazoo.jpg/250px-Kalamazoo.jpg',imgDescription:'Kalamazoo.jpg',cityDescription:'Kalamazoo  is a city in the southwest region of the U.S. state of Michigan. It is the county seat of Kalamazoo County. Kalamazoo is located geographically in Western and Southern Michigan. As of the 2010 census, Kalamazoo had a total population of 74,262. Kalamazoo is the major city of the Kalamazoo-Portage Metropolitan Statistical Area, which has a population of 326,589 as of 2010.'},{airportCode:'LUP',cityName:'Kalaupapa, Molokai, Hawaii'},{airportCode:'FCA',cityName:'Kalispell, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Kalispell,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9c/Kalispell_MT_looking_toward_Glacier_National_Park_from_Lone_Pine_State_Park_January_27_2010.JPG/250px-Kalispell_MT_looking_toward_Glacier_National_Park_from_Lone_Pine_State_Park_January_27_2010.JPG',imgDescription:'Kalispell looking toward Glacier National Park from Lone Pine State Park',cityDescription:'Kalispell  is a city in, and the county seat of, Flathead County, Montana. The 2013 Census estimates put Kalispell\'s population at 20,972. The Kalispell Micropolitan Statistical Area has a population of 93,068 and it is the largest city and commercial center of northwest Montana. The name Kalispell is a Salish word meaning "flat land above the lake". Kalispell is also the gateway to Glacier National Park.'},{airportCode:'MCI',cityName:'Kansas City, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Kansas_City,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/89/Kansas_City_Montage.jpg/250px-Kansas_City_Montage.jpg',imgDescription:'From top left: the Liberty Memorial, the Nelson-Atkins Museum of Art, the Kansas City skyline, the Country Club Plaza, Arrowhead Stadium, and Kauffman Stadium',cityDescription:'Kansas City, or K.C., is the largest city, and second largest metropolitan area, in the state of Missouri. It is the 37thlargest city by population in the United States and the 23rdlargest by area. It is the central city of the Kansas City metropolitan area, which straddles the KansasMissouri border. It was founded in the 1830s as a Missouri River port at its confluence with the Kansas River coming in from the west. Originally called Kansas after the river, this became confusing upon the establishment of Kansas Territory in 1854. The name Kansas City was assigned to distinguish the two.'},{airportCode:'JHM',cityName:'Kapalua, Maui, Hawaii'},{airportCode:'EAR',cityName:'Kearney, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Kearney,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/GPRRAMKearney.jpg/250px-GPRRAMKearney.jpg',imgDescription:'The Great Platte River Road Archway Monument, which spans Interstate 80',cityDescription:'Kearney  is a city in and the county seat of Buffalo County, Nebraska, United States. The population was 30,787 at the 2010 census. It is home to the University of Nebraska-Kearney. The westward push of the railroad as the Civil War ended gave birth to the community.'},{airportCode:'ENA',cityName:'Kenai, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Kenai,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7a/Kenai_AK_aerial.jpg/250px-Kenai_AK_aerial.jpg',imgDescription:'Aerial view of part of downtown Kenai.  The intersection of Willow Street and Barnacle Way is in the center of the foreground.  Cook Inlet and Mount Redoubt are in the background.',cityDescription:'Kenai   is a city in Kenai Peninsula Borough in the U.S. state of Alaska. The population was 7,100 as of the 2010 census.'},{airportCode:'EYW',cityName:'Key West, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Key_West,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Key_west_2001.JPG/250px-Key_west_2001.JPG',imgDescription:'Aerial photo of Key West, looking north, March 2001.',cityDescription:'Key West is a city in Monroe County, Florida, United States. The city encompasses the island of Key West, the part of Stock Island north of U.S. 1  , Sigsbee Park , Fleming Key , and Sunset Key . Both Fleming Key and Sigsbee Park are part of Naval Air Station Key West and are inaccessible by civilians. Key West is the county seat of Monroe County. Key West is the southernmost city in the Continental United States. It also contains the southern terminus of U.S. 1, State Road A1A, the East Coast Greenway and, before 1935, the Florida East Coast Railway.'},{airportCode:'GRK',cityName:'Killeen, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Killeen,_Texas',imgUrl:undefined,imgDescription:undefined,cityDescription:'Killeen is a city in Bell County, Texas, United States. According to the 2010 United States Census, the city\'s population was 127,921, making it the 22nd most populous city in Texas. It is the "principal city" of the KilleenTempleFort Hood Metropolitan Statistical Area.'},{airportCode:'AKN',cityName:'King Salmon, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/King_Salmon,_Alaska',imgUrl:undefined,imgDescription:undefined,cityDescription:'King Salmon is a census-designated place  in Bristol Bay Borough in the U.S. state of Alaska. It is two hundred and eighty-four miles southwest of Anchorage. As of the 2010 census the population was 374. It is home to Katmai National Park and Preserve. King Salmon is the borough seat of neighboring Lake and Peninsula Borough, but does not serve that purpose in its own borough, whose borough seat is in Naknek.'},{airportCode:'IGM',cityName:'Kingman, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Kingman,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5b/Kingman_courthouse.jpg/250px-Kingman_courthouse.jpg',imgDescription:'Mohave County Courthouse in Kingman',cityDescription:'Kingman  is the county seat of Mohave County, Arizona,. According to the 2010 census, the population of the city is 28,068. The nearby communities of Butler and Golden Valley bring the Kingman area total population to over 66,000. Kingman is located 33 miles  east of Bullhead City, Arizona, 85 miles  southeast of Las Vegas, Nevada, about 150 miles  west of Flagstaff, Arizona, about 60 miles  northeast of Needles, California, about 165 miles  northwest of Phoenix, Arizona, about 205 miles  east of Barstow, California and about 250 miles  northeast of Los Angeles, California.'},{airportCode:'IRK',cityName:'Kirksville, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Kirksville,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4c/Kirksville_Square.jpg/250px-Kirksville_Square.jpg',imgDescription:'Kirksville Square (2004)',cityDescription:'Kirksville is a city in and the county seat of Adair County, Missouri, United States. Located in the Benton Township, its population was 17,505 at the 2010 census. Kirksville is home of Truman State University and A.T. Still University.'},{airportCode:'LMT',cityName:'Klamath Falls, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/Klamath_Falls,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/03/Klamath_Falls_downtown.JPG/250px-Klamath_Falls_downtown.JPG',imgDescription:'Downtown Klamath Falls',cityDescription:'Klamath Falls   is a city in and the county seat of Klamath County, Oregon, United States. The city was originally called Linkville when George Nurse founded the town in 1867. It was named after the Link River, on whose falls the city was sited. The name was changed to Klamath Falls in 1893. The population was 20,840 at the 2010 census. The city is situated on the south east shore of the Upper Klamath Lake and about 25 miles  north of the California-Oregon border.'},{airportCode:'TYS',cityName:'Knoxville, Tennessee',wikiUrl:'https://en.wikipedia.org/wiki/Knoxville,_Tennessee',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b2/Knoxville_TN_skyline.jpg/250px-Knoxville_TN_skyline.jpg',imgDescription:'The City of Knoxville, Tennessee',cityDescription:'Knoxville is a city in the U.S. state of Tennessee, and the county seat of Knox County. The city had an estimated population of 183,270 in 2013, and a population of 178,874 as of the 2010 census, making it the state\'s third largest city after Nashville and Memphis. Knoxville is the principal city of the Knoxville Metropolitan Statistical Area, which, in 2013, had an estimated population of 852,715. The KMSA is, in turn, the central component of the Knoxville-Sevierville-La Follette Combined Statistical Area, which, in 2013, had a population of 1,096,961.'},{airportCode:'ADQ',cityName:'Kodiak, Alaska'},{airportCode:'LSE',cityName:'La Crosse, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/La_Crosse,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c4/La_Crosse%2C_Wisconsin_Skyline.JPG/250px-La_Crosse%2C_Wisconsin_Skyline.JPG',imgDescription:'UW-La Crosse campus and downtown La Crosse as seen from the east bluffs',cityDescription:'La Crosse is a city in the U.S. state of Wisconsin and the county seat of La Crosse County. Lying alongside the Mississippi River, La Crosse is the largest city on Wisconsin\'s western border.'},{airportCode:'LFT',cityName:'Lafayette, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Lafayette,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9d/LafayetteCollage.jpg/300px-LafayetteCollage.jpg',imgDescription:'Hub City',cityDescription:'Lafayette  is a city located along the Vermilion River in southwestern Louisiana. The city of Lafayette is the fourth-largest in the state, with a population of 120,623 at the 2010 census. The combined statistical area of LafayetteOpelousas-Morgan City was 611,774 according to 2012 estimates. Lafayette is the parish seat of Lafayette Parish, Louisiana. Its nickname is The Hub City.'},{airportCode:'LCH',cityName:'Lake Charles, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Lake_Charles,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/LC_Collage4.jpg/300px-LC_Collage4.jpg',imgDescription:'Clockwise from left: Downtown skyline; Golden Nugget Casino; L\'Auberge du Lac Casino; Israel LaFleur Bridge; McNeese State University entrance plaza.',cityDescription:'Lake Charles  is the fifth-largest incorporated city in the U.S. state of Louisiana, located on Lake Charles, Prien Lake, and the Calcasieu River. Founded in 1861 in Calcasieu Parish, it is a major industrial, cultural, and educational center in the southwest region of the state.'},{airportCode:'LNY',cityName:'Lanai City, Lanai, Hawaii'},{airportCode:'LNS',cityName:'Lancaster, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Lancaster,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/Lancaster_Pennsylvania_downtown.jpg/250px-Lancaster_Pennsylvania_downtown.jpg',imgDescription:'Skyline of Lancaster, Pennsylvania',cityDescription:'Lancaster  is a city located in South Central Pennsylvania which serves as the seat of Pennsylvania\'s Lancaster County and one of the oldest inland towns in the United States, . With a population of 59,322, it ranks eighth in population among Pennsylvania\'s cities. The Lancaster metropolitan area population is 507,766, making it the 101st largest metropolitan area in the US and 2nd largest in the South Central Pennsylvania area.'},{airportCode:'LAN',cityName:'Lansing, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Lansing,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Lansing_skyline_brobb_11_2009.jpg/275px-Lansing_skyline_brobb_11_2009.jpg',imgDescription:'Lansing skyline brobb 11 2009.jpg',cityDescription:'Lansing  is the capital of the U.S. state of Michigan. It is located mostly in Ingham County, although portions of the city extend west into Eaton County and north into Clinton County. The 2010 Census placed the city\'s population at 114,297, making it the fifth largest city in Michigan. The population of its Metropolitan Statistical Area  was 464,036, while the even larger Combined Statistical Area  population, which includes Shiawassee County, was 534,684. It was named the new state capital of Michigan in 1847, ten years after its admittance as a state.'},{airportCode:'LAR',cityName:'Laramie, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Laramie,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Downtown_Laramie_e.jpg/250px-Downtown_Laramie_e.jpg',imgDescription:'Downtown Laramie',cityDescription:'Laramie is a city in, and the county seat of Albany County, Wyoming, United States. The population was 30,816 at the 2010 census. Located on the Laramie River in southeastern Wyoming, the city is west of Cheyenne, at the junction of Interstate 80 and U.S. Route 287.'},{airportCode:'LRD',cityName:'Laredo, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Laredo,_Texas',imgUrl:undefined,imgDescription:undefined,cityDescription:'Laredo  is the county seat of Webb County, Texas, United States, located on the north bank of the Rio Grande in South Texas, across from Nuevo Laredo, Tamaulipas, Mexico. According to the 2010 census, the city population was 236,191, making it the tenth-most populous city in the state of Texas and third-most populated on the Mexican border, after San Diego, California and El Paso, Texas. Its metropolitan area is the 178th-largest in the US and includes all of Webb county, with a population of 250,304. Laredo is also part of the cross-border Laredo-Nuevo Laredo Metropolitan Area with an estimated population of 636,516.'},{airportCode:'LRU',cityName:'Las Cruces, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Las_Cruces,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Las_Cruces.jpg/250px-Las_Cruces.jpg',imgDescription:'View of Las Cruces with the Organ Mountains to the east',cityDescription:'Las Cruces, also known as "The City of the Crosses", is the county seat of Doa Ana County, New Mexico, United States. As of the 2010 census the population was 97,618, and in 2014 the estimated population was 101,408, making it the second largest city in the state, after Albuquerque. Las Cruces is the largest city in both Doa Ana County and southern New Mexico. The Las Cruces metropolitan area had an estimated population of 213,676 in 2014. It is the principal city of a metropolitan statistical area which encompasses all of Doa Ana County and is part of the larger El PasoLas Cruces combined statistical area.'},{airportCode:'LAS',cityName:'Las Vegas, Nevada',wikiUrl:'https://en.wikipedia.org/wiki/Las_Vegas,_Nevada',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/63/LasVegasMontage6.jpg/350px-LasVegasMontage6.jpg',imgDescription:'In order from top left, clockwise: 1.World Market Center Las Vegas; 2.Fremont East; 3.Lou Ruvo Center for Brain Health; 4.Smith Center for the Performing Arts; 5.Downtown Las Vegas with the Las Vegas Valley in the background; 6. Grand Central Parkway Interchange; 7.Symphony Park; 8.Downtown Arts District; 9.Las Vegas industrial district looking North away from the Las Vegas Strip during First Friday',cityDescription:'Las Vegas  officially the City of Las Vegas and often known as simply Vegas, is a city in the United States, the most populous city in the state of Nevada, the county seat of Clark County, and the city proper of the Las Vegas Valley. Las Vegas is an internationally renowned major resort city known primarily for gambling, shopping, fine dining and nightlife and is the leading financial and cultural center for Southern Nevada.'},{airportCode:'LBE',cityName:'Latrobe, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Latrobe,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/43/Latrobe_PA_MainStreet.jpg/250px-Latrobe_PA_MainStreet.jpg',imgDescription:'Looking down Main Street',cityDescription:'Latrobe  is a city in Westmoreland County, Pennsylvania in the United States and part of the Pittsburgh metropolitan area.'},{airportCode:'PIB',cityName:'Laurel, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Laurel,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Lauren_Rogers_museum.jpg/250px-Lauren_Rogers_museum.jpg',imgDescription:'Lauren Rogers Museum of Art in Laurel',cityDescription:'Laurel is a city in Jones County, Mississippi, United States. As of the 2010 census, the city had a total population of 18,548.'},{airportCode:'LAW',cityName:'Lawton, Oklahoma',wikiUrl:'https://en.wikipedia.org/wiki/Lawton,_Oklahoma',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d4/Old_Lawton_High_School.jpg/250px-Old_Lawton_High_School.jpg',imgDescription:'New Lawton City Hall',cityDescription:'The city of Lawton  is the county seat of Comanche County, in the State of Oklahoma. Located in southwestern Oklahoma, about 87 mi  southwest of Oklahoma City, it is the principal city of the Lawton, Oklahoma Metropolitan Statistical Area. According to the 2010 census, Lawton\'s population was 96,867, making it the fifth-largest city in the state.'},{airportCode:'LWS',cityName:'Lewiston, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Lewiston,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/MG_9750.jpg/240px-MG_9750.jpg',imgDescription:'Lewiston from the north',cityDescription:'Lewiston is a city in north central Idaho and the county seat of Nez Perce County. It is the second-largest city in the northern Idaho region, behind Coeur d\'Alene, and ninth-largest in the state. Lewiston is the principal city of the Lewiston, ID - Clarkston, WA Metropolitan Statistical Area, which includes all of Nez Perce County and Asotin County, Washington. As of the 2010 census, the population of Lewiston was 31,894, up from 30,904 in 2000.'},{airportCode:'LEW',cityName:'Lewiston, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Lewiston,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Lew2maine.jpg/250px-Lew2maine.jpg',imgDescription:'Skyline of Lewiston',cityDescription:'Lewiston is a city in Androscoggin County in Maine, and the second-largest city in the state. The population was 36,592 at the 2010 census. It is one of two principal cities of and included within the Lewiston-Auburn, Maine metropolitan New England city and town area and the Lewiston-Auburn, Maine Metropolitan Statistical Area, which as of 2006 census estimates has a combined population of 107,702. It is also part of the extended Portland-Lewiston-South Portland, Maine combined statistical area, which has a combined population 621,219 as of 2006 estimates.'},{airportCode:'LWT',cityName:'Lewistown, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Lewistown,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7f/LewistownMontana.jpg/250px-LewistownMontana.jpg',imgDescription:'Mainstreet Lewistown',cityDescription:'Lewistown  is a city in and the county seat of Fergus County, Montana, United States. The population was 5,901 at the 2010 census. Lewistown is located in central Montana, the geographic center of the state, southeast of Great Falls. First planned in 1882, it was the site of an 1880s gold rush.'},{airportCode:'LEX',cityName:'Lexington, Kentucky',wikiUrl:'https://en.wikipedia.org/wiki/Lexington,_Kentucky',imgUrl:undefined,imgDescription:undefined,cityDescription:'Lexington, consolidated with Fayette County, is the second-largest city in Kentucky and the 61st largest in the United States. Known as the "Horse Capital of the World", it is the heart of the state\'s Bluegrass region. With a mayor-alderman form of government, it is one of two cities in Kentucky designated by the state as first-class; the other is the state\'s largest city of Louisville. In the 2014 U.S. Census Estimate, the city\'s population was 310,797, anchoring a metropolitan area of 489,435 people and a combined statistical area of 708,677 people.'},{airportCode:'LBL',cityName:'Liberal, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Liberal,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/93/Liberal%2C_KS%2C_welcome_sign_IMG_5968.JPG/250px-Liberal%2C_KS%2C_welcome_sign_IMG_5968.JPG',imgDescription:'Welcome sign on U.S. Route 83 (2010)',cityDescription:'Liberal is the county seat of Seward County, Kansas, United States. As of the 2010 census, the city population was 20,525.'},{airportCode:'LIH',cityName:'Lihue, Kauai, Hawaii'},{airportCode:'LNK',cityName:'Lincoln, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Lincoln,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/97/Skyline_of_Downtown_Lincoln%2C_Nebraska%2C_USA_%282015%29.jpg/250px-Skyline_of_Downtown_Lincoln%2C_Nebraska%2C_USA_%282015%29.jpg',imgDescription:'Downtown Lincoln skyline',cityDescription:'Lincoln  is the capital of the State of Nebraska and the second-most populous city in Nebraska. Lincoln is also the county seat of Lancaster County Lincoln is located in the southeastern part of Nebraska and is in the Lincoln metropolitan  area. Lincoln\'s population in 2014 was estimated at 272,996.'},{airportCode:'LIT',cityName:'Little Rock, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/Little_Rock,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a8/Little_Rock_collage.png/250px-Little_Rock_collage.png',imgDescription:'Clockwise from top: Little Rock skyline, William J. Clinton Presidential Library, War Memorial Stadium, the River Market District, and the Arkansas State Capitol',cityDescription:'Little Rock is the capital and the most populous city of the U.S. state of Arkansas. It is also the county seat of Pulaski County. It was incorporated on November 7, 1831 on the south bank of the Arkansas River very near the geographic center of the state. The city derives its name from a rock formation along the river, named "La Petite Roche" by the French in 1799. The capital of the Arkansas Territory was moved to Little Rock from Arkansas Post in 1821. The city\'s population was 193,524 at the 2010 census. The five-county Little Rock-North Little Rock-Conway, AR Metropolitan Statistical Area  is ranked 75th in terms of population in the United States with 724,385 residents according to the 2013 estimate by the United States Census Bureau.'},{airportCode:'LGB',cityName:'Long Beach, California',wikiUrl:'https://en.wikipedia.org/wiki/Long_Beach,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/LBCmontagebytisoy.JPG/250px-LBCmontagebytisoy.JPG',imgDescription:'Images from top, left to right: Long Beach skyline from Bluff Park, RMS Queen Mary, Aquarium of the Pacific Blue Cavern exhibit, Hanjin Terminal at Port of Long Beach, Villa Riviera, Metro Blue Line, Long Beach Lighthouse',cityDescription:'Long Beach is a city in Los Angeles County in Southern California, on the Pacific coast of the United States. The city is the 36th-largest city in the United States and the seventh-largest in California. As of 2010, its population was 462,257. In addition, Long Beach is the second largest city in the Greater Los Angeles Area  and a principal city of the Los Angeles metropolitan area.'},{airportCode:'GGG',cityName:'Longview, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Longview,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/LongView.jpg/250px-LongView.jpg',imgDescription:'LongView.jpg',cityDescription:'Longview is a city in Gregg and Harrison counties in the U.S. state of Texas. As of the 2010 Census, the population was 80,455. Most of the city is located in Gregg County, of which it is the county seat; a small part extends into the western part of neighboring Harrison County. It is located in East Texas, where Interstate 20 and U.S. Highways 80 and 259 converge just north of the Sabine River.'},{airportCode:'QLA',cityName:'Los Angeles, California',wikiUrl:'https://en.wikipedia.org/wiki/Los_Angeles,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/57/LA_Skyline_Mountains2.jpg/266px-LA_Skyline_Mountains2.jpg',imgDescription:'Los Angeles skyline',cityDescription:'Los Angeles  , officially the City of Los Angeles and often known by its initials L.A., is the second-largest city in the United States after New York City, the most populous city in the U.S. state of California, and the county seat of Los Angeles County. Situated in Southern California, Los Angeles is known for its mediterranean climate, ethnic diversity, sprawling metropolis, and as a major center of the American entertainment industry. Los Angeles lies in a large coastal basin surrounded on three sides by mountains reaching up to and over 10,000 feet .'},{airportCode:'LBB',cityName:'Lubbock, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Lubbock,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c7/LubbockSkyline2013.jpg/250px-LubbockSkyline2013.jpg',imgDescription:'Downtown Lubbock Skyline',cityDescription:'Lubbock  is the county seat of Lubbock County, Texas, United States. The city is located in the northwestern part of the state, a region known historically and geographically as the Llano Estacado and ecologically is part of the southern end of the High Plains. According to a 2014 Census estimate, Lubbock had a population of 243,839, making it the 85th most populous city in the United States of America and the 11th most populous city in the state of Texas. The city is the economic center of the Lubbock metropolitan area, which had an estimated 2014 population of 305,644.'},{airportCode:'LYH',cityName:'Lynchburg, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Lynchburg,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Lynchburg%2C_Virginia_downtown_skyline.jpg/250px-Lynchburg%2C_Virginia_downtown_skyline.jpg',imgDescription:'Downtown Lynchburg skyline',cityDescription:'Lynchburg is an independent city in the Commonwealth of Virginia. As of the 2010 census, the population was 75,568. The 2014 census estimates an increase to 79,047. Located in the foothills of the Blue Ridge Mountains along the banks of the James River, Lynchburg is known as the "City of Seven Hills" or the "Hill City". Lynchburg was the only major city in Virginia that was not captured by the Union before the end of the American Civil War.'},{airportCode:'MCN',cityName:'Macon, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Macon,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3e/DowntownMaconGa.jpg/250px-DowntownMaconGa.jpg',imgDescription:'Downtown Macon',cityDescription:'Macon   is a city located in the state of Georgia, United States. Macon lies near the geographic center of the state, approximately 85 miles  south of Atlanta, hence the city\'s nickname "the Heart of Georgia". Settled near the fall line of the Ocmulgee River, Macon is the county seat of Bibb County and had a 2014 estimated population of 153,691. Macon is the principal city of the Macon metropolitan area, which had an estimated population of 231,259 in 2014. Macon is also the largest city in the Macon-Warner Robins Combined Statistical Area , a larger trading area with an estimated 417,473 residents in 2014; the CSA abuts the Atlanta metropolitan area just to the north.'},{airportCode:'MSN',cityName:'Madison, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Madison,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Madison_Wisconsin_img_1196.jpg/300px-Madison_Wisconsin_img_1196.jpg',imgDescription:'Madison Wisconsin img 1196.jpg',cityDescription:'Madison is the capital of the State of Wisconsin and the county seat of Dane County. As of July 1, 2013, Madison had an estimated population of 243,344, making it the second largest city in Wisconsin, after Milwaukee, and the 83rd largest in the United States. The city forms the core of the United States Census Bureau\'s Madison Metropolitan Statistical Area, which includes all of Dane County and neighboring Iowa, Green, and Columbia counties. The Madison Metropolitan Statistical Area had a 2010 population of 568,593.'},{airportCode:'MHT',cityName:'Manchester, New Hampshire',wikiUrl:'https://en.wikipedia.org/wiki/Manchester,_New_Hampshire',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a4/Manch-DownTown.jpg/300px-Manch-DownTown.jpg',imgDescription:'Downtown Manchester looking south along Elm Street',cityDescription:'Manchester is the largest city in the U.S. state of New Hampshire, the tenth largest city in New England, and the largest city in northern New England, an area comprising the states of Maine, New Hampshire, and Vermont. It was first named by the merchant and inventor Samuel Blodget . Blodget\'s vision was to create a great industrial center similar to that of Manchester in England, which was the world\'s first industrialized city. It is located in Hillsborough County along the banks of the Merrimack River, which divides the city into eastern and western sections. Manchester is near the northern end of the Northeast megalopolis. As of the 2010 census, the city had a population of 109,565, and its 2014 population estimate was 110,448. As of the 2014 population estimate, Manchester is the largest New England city north of Boston, including other Massachusetts cities. The Manchester-Nashua metropolitan area, with an estimated population in 2014 of 405,184, is home to nearly one-third of the population of New Hampshire.'},{airportCode:'MHK',cityName:'Manhattan, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Manhattan,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6a/Riley_%28Kansas%29_County_Courthouse_1.jpg/250px-Riley_%28Kansas%29_County_Courthouse_1.jpg',imgDescription:'Riley County Courthouse (2005)',cityDescription:'Manhattan is a city in northeastern Kansas in the United States, located at the junction of the Kansas River and Big Blue River. It is the county seat of Riley County, although it also extends into Pottawatomie County. As of the 2010 census, the city population was 52,281.'},{airportCode:'MBL',cityName:'Manistee, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Manistee,_Michigan',imgUrl:undefined,imgDescription:undefined,cityDescription:'Manistee is a city in the U.S. state of Michigan. The population was 6,226 at the 2010 census. It is the county seat of Manistee County. The name "Manistee" is from an Ojibwe word first applied to the principal river of the county. The derivation is not certain, but it may be from ministigweyaa, "river with islands at its mouth". Other sources claim that it was an Ojibwe term meaning "spirit of the woods".'},{airportCode:'MWA',cityName:'Marion, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Marion,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/Marionillinoistownsquare.JPG/250px-Marionillinoistownsquare.JPG',imgDescription:'Marion town square',cityDescription:'Marion is a city in and the county seat of Williamson County, Illinois, United States. The population was 17,193 at the 2010 census. It is part of a dispersed urban area that developed out of the early 20th Century coal fields.'},{airportCode:'MQT',cityName:'Marquette, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Marquette,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/30/Marquette%2C_MI_-_Front_Street_1909.jpg/250px-Marquette%2C_MI_-_Front_Street_1909.jpg',imgDescription:'Front Street in downtown Marquette, 1909',cityDescription:'Marquette is a city in the U.S. state of Michigan and the county seat of Marquette County. The population was 21,355 at the 2010 census, making it the most populated city of the Upper Peninsula. Marquette is a major port on Lake Superior, known primarily for shipping iron ore, and is the home of Northern Michigan University. In 2012, Marquette was listed among the 10 best places to retire in the U.S. by CBS Money Watch.'},{airportCode:'MVY',cityName:'Martha\'s Vineyard, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Martha%27s_Vineyard,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Martha%27s_Vineyard_map.png/220px-Martha%27s_Vineyard_map.png',imgDescription:'Martha\'s Vineyard map.png',cityDescription:'Martha\'s Vineyard  is an island located south of Cape Cod in Massachusetts, known for being an affluent summer colony. It includes the smaller Chappaquiddick Island, which is usually connected to the larger island, though storms and hurricanes have been known to separate the two islands. The last such separation of the islands was in 2007, and as of April 2, 2015, the two islands are again connected.'},{airportCode:'MCW',cityName:'Mason City, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Mason_City,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/4/49/MC_building.jpg/250px-MC_building.jpg',imgDescription:'Principal Financial Group Building in Downtown Mason City',cityDescription:'Mason City is a city in and the county seat of Cerro Gordo County, Iowa, United States. The population was 28,079 in the 2010 census, a decline from 29,172 in the 2000 census. The Mason City Micropolitan Statistical Area includes all of Cerro Gordo and Worth counties. It is commonly referred to as the "River City", as the city grew up centered on the Winnebago River.'},{airportCode:'MSS',cityName:'Massena, New York'},{airportCode:'MFE',cityName:'McAllen, Texas',wikiUrl:'https://en.wikipedia.org/wiki/McAllen,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e4/Mcallen.jpg/250px-Mcallen.jpg',imgDescription:'Mcallen.jpg',cityDescription:'McAllen is the twenty-first most populous city in Texas and the largest city in Hidalgo County, Texas. It is located at the southern tip of Texas in the Rio Grande Valley  and is part of the Southern United States. It is on the Rio Grande, across from the Mexican city of Reynosa, and is about 70 miles  west of South Padre Island and the Gulf of Mexico. The 2012 estimates put the city\'s population at 140,717 and the McAllenEdinburgMission metropolitan area at 804,934; making up most of the population of Hidalgo County . It is ranked the sixth largest metropolitan area by population in the state of Texas. The ReynosaMcAllen Metropolitan Area counts a population of nearly 1.5 million.'},{airportCode:'MCK',cityName:'McCook, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/McCook,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8e/McCook%2C_Nebraska_Norris_from_E_1.JPG/250px-McCook%2C_Nebraska_Norris_from_E_1.JPG',imgDescription:'George Norris Avenue',cityDescription:'McCook is a city and county seat of Red Willow County, Nebraska, United States. The population was 7,698 at the 2010 census.'},{airportCode:'MFR',cityName:'Medford, Oregon'},{airportCode:'MLB',cityName:'Melbourne, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Melbourne,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2d/Historic_Downtown_Melbourne.jpg/300px-Historic_Downtown_Melbourne.jpg',imgDescription:'Downtown Melbourne',cityDescription:'Melbourne  is a city in Brevard County, Florida, United States. As of the 2010 census, the population was 76,068. The municipal area is the second largest by size and by population in the county. Melbourne is a principal city of the Palm Bay  Melbourne  Titusville, Florida Metropolitan Statistical Area. In 1969 the city was expanded by merging with nearby Eau Gallie.'},{airportCode:'MEM',cityName:'Memphis, Tennessee',wikiUrl:'https://en.wikipedia.org/wiki/Memphis,_Tennessee',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/Memphis_TN_Photo_Collage.png/300px-Memphis_TN_Photo_Collage.png',imgDescription:'From top to bottom and left to right: Downtown Memphis skyline, Beale Street, Graceland, Memphis Pyramid, Beale Street Landing, and the Hernando de Soto Bridge',cityDescription:'Memphis is a city in the southwestern corner of the U.S. state of Tennessee and the county seat of Shelby County. The city is located on the fourth Chickasaw Bluff, south of the confluence of the Wolf and Mississippi rivers.'},{airportCode:'MEI',cityName:'Meridian, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Meridian,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Downtown_Meridian_from_City_Hall.jpg/250px-Downtown_Meridian_from_City_Hall.jpg',imgDescription:'A view of downtown from the third floor of Meridian City Hall; the 16-story    Threefoot Building dominates the skyline',cityDescription:'Meridian is the sixth largest city in the U.S. State of Mississippi. It is the county seat of Lauderdale County and the principal city of the Meridian, Mississippi Micropolitan Statistical Area. Along major highways, the city is 93 mi  east of Jackson, Mississippi; 154 mi  west of Birmingham, Alabama; 202 mi  northeast of New Orleans, Louisiana; and 231 mi  southeast of Memphis, Tennessee.'},{airportCode:'MIA',cityName:'Miami, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Miami,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ad/Miami_collage_20110330.jpg/250px-Miami_collage_20110330.jpg',imgDescription:'A collage of images of Miami.',cityDescription:'Miami  is a city located on the Atlantic coast in southeastern Florida and the county seat of Miami-Dade County. The 44th-most populated city proper in the United States, with a population of 417,650, it is the principal, central, and most populous city of the Miami metropolitan area, and the most populous metropolis in the Southeastern United States after Washington, D.C. According to the U.S. Census Bureau, Miami\'s metro area is the eighth-most populous and fourth-largest urban area in the United States, with a population of around 5.5 million.'},{airportCode:'MAF',cityName:'Midland, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Midland,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Midland44_Skyline.jpg/250px-Midland44_Skyline.jpg',imgDescription:'Downtown Midland in 2007',cityDescription:'Midland is a city in and the county seat of Midland County, Texas, United States, on the Southern Plains of the state\'s western area. A small portion of the city extends into Martin County. At the 2010 census, the population of Midland was 111,147, and a 2013 estimate of 123,933 making it the twenty-fifth most populous city in the state of Texas. Due to the oil boom in Midland, certain officials have estimated the population to be hovering around 155,000 to 165,000. The population of the Midland metropolitan area, composed of Midland County, grew 4.6 percent to 151,662 between July 1, 2011, and July 1, 2012, according to the U.S. Census Bureau. It is the principal city of the Midland, Texas Metropolitan Statistical Area, which includes all of Midland County. The metropolitan area is also a component of the larger MidlandOdessa, Texas Combined Statistical Area, which had an estimated population of 295,987 on July 1, 2012. People in Midland are called Midlanders.'},{airportCode:'MLS',cityName:'Miles City, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Miles_City,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Miles_city_2008.jpg/250px-Miles_city_2008.jpg',imgDescription:'Main Street in Miles City',cityDescription:'Miles City is a city in and the county seat of Custer County, Montana, United States. The population was 8,410 at the 2010 census.'},{airportCode:'MKE',cityName:'Milwaukee, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Milwaukee,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/MilwaukeeCollage_2.png/300px-MilwaukeeCollage_2.png',imgDescription:'Clockwise from top left: Milwaukee skyline and Lake Michigan, Milwaukee Art Museum, Milwaukee Central Library, Allen-Bradley Clock Tower, Marquette Hall at Marquette University, Milwaukee City Hall, Miller Park, and the Basilica of St. Josaphat.',cityDescription:'Milwaukee  is the largest city in the State of Wisconsin and the fifth-largest city in the Midwestern United States. It is the county seat of Milwaukee County and is located on the southwestern shore of Lake Michigan. According to 2010 census data, the City of Milwaukee has a population of 594,833. Milwaukee is the main cultural and economic center of the MilwaukeeRacineWaukesha Metropolitan Area with a population of 2,043,904 as of an official 2014 estimate.'},{airportCode:'MSP',cityName:'Minneapolis, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Minneapolis,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/57/MinneapolisCollage.jpg/300px-MinneapolisCollage.jpg',imgDescription:'Clockwise from top: Downtown Minneapolis, Downtown, TCF Bank Stadium, the Guthrie Theater, Minnehaha Falls, and First Avenue and 7th St Entry nightclub',cityDescription:'Minneapolis  is the county seat of Hennepin County, and larger of the Twin Cities, the 14th-largest metropolitan area in the United States, containing approximately 3.8 million residents. As of 2016, Minneapolis is the largest city in the state of Minnesota and 46th-largest in the United States with 407,207 residents. Minneapolis and Saint Paul anchor the second-largest economic center in the Midwest, behind Chicago.'},{airportCode:'MOT',cityName:'Minot, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Minot,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/2009-0521-CDNtrip026-ND-Minot.jpg/250px-2009-0521-CDNtrip026-ND-Minot.jpg',imgDescription:'Downtown Minot, 2009',cityDescription:'Minot  is a city located in north central North Dakota, United States. It is most widely known for the Air Force base located approximately 15 miles  north of the city. With a population of 40,888 at the 2010 census, Minot is the fourth largest city in the state. In 2012, the Minot Area Development Corporation estimated that there were between 46,000 and 47,000 permanent residents within city limits. The city is the county seat of Ward County and is a trading center for a large portion of northern North Dakota, southwestern Manitoba, and southeastern Saskatchewan. Founded in 1886 during the construction of the Great Northern Railway, Minot is also known as "Magic City", commemorating its remarkable growth in size over a short time.'},{airportCode:'MSO',cityName:'Missoula, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Missoula,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f8/Missoula_Collage_Wikipedia_8.jpg/300px-Missoula_Collage_Wikipedia_8.jpg',imgDescription:'Downtown Missoula',cityDescription:'Missoula i  is a city in the U.S. state of Montana and is the county seat of Missoula County. It is located along the Clark Fork River near its confluences with the Bitterroot and Blackfoot Rivers in western Montana and at the convergence of five mountain ranges, thus is often described as the "hub of five valleys". In 2014 , the United States Census Bureau estimated the city\'s population at 69,821 and the population of the Missoula Metropolitan Area at 112,684. Since 2000, Missoula has been the second most populous city in Montana. Missoula is home to the University of Montana, a public research university.'},{airportCode:'MOB',cityName:'Mobile, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Mobile,_Alabama',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Mobile_Montage-2.jpg/300px-Mobile_Montage-2.jpg',imgDescription:'From top: Pincus Building, Old City Hall and Southern Market, Fort Cond, Barton Academy, Cathedral Basilica of the Immaculate Conception, and the skyline of downtown Mobile from the Mobile River.',cityDescription:'Mobile  is the county seat of Mobile County, Alabama, United States. The population within the city limits was 195,111 as of the 2010 United States Census, making it the third most populous city in the State of Alabama, the most populous in Mobile County, and the largest municipality on the Gulf Coast between New Orleans, Louisiana, and St. Petersburg, Florida.'},{airportCode:'MOD',cityName:'Modesto, California',wikiUrl:'https://en.wikipedia.org/wiki/Modesto,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/Modesto_Arch.JPG/250px-Modesto_Arch.JPG',imgDescription:'Modesto Arch.JPG',cityDescription:'Modesto  , officially being the City of Modesto, is the county seat and largest city of Stanislaus County, California, United States. With a population of approximately 201,165 at the 2010 census, Modesto ranks as the 18th largest city in the state of California. The Modesto Census County Division, which includes the cities of Ceres and Riverbank, has a population of 312,842 as of 2010.'},{airportCode:'MLI',cityName:'Moline, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Moline,_Illinois',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b1/Moline%2C_Illinois_Montage.jpg/250px-Moline%2C_Illinois_Montage.jpg',imgDescription:'Clockwise from top: Interstate 74 Bridge, Downtown Moline, I wireless Center, the city at night, John Deere World Headquarters, a Velie Monocoupe in Quad City International Airport',cityDescription:'Moline  is a city located in Rock Island County, Illinois, United States. With a population of 43,977 in 2010, it is the largest city in Rock Island County. Moline is one of the Quad Cities, along with neighboring East Moline and Rock Island in Illinois and the cities of Davenport and Bettendorf in Iowa. The Quad Cities has a population estimate of 381,342. The city is the ninth-most populated city in Illinois outside of the Chicago Metropolitan Area. The corporate headquarters of Deere & Company is located in Moline, as was Montgomery Elevator, which was founded and headquartered in Moline until 1997, when it was acquired by Kone Elevator, which has its U.S. Division headquartered in Moline. Quad City International Airport, Niabi Zoo, Black Hawk College, and the Quad Cities campus of Western Illinois University-Quad Cities. Moline is a retail hub for the Illinois Quad Cities, as South Park Mall and numerous big-box shopping plazas are located in the city.'},{airportCode:'MLU',cityName:'Monroe, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Monroe,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/Francis_Towers.jpg/200px-Francis_Towers.jpg',imgDescription:'Francis Tower',cityDescription:'Monroe  is the eighth-largest city in the U.S. state of Louisiana. it is the parish seat of Ouachita Parish. In the official 2010 census, Monroe had a population of 48,815. The municipal population declined by 8.1 percent over the past decade; it was 53,107 in the 2000 census. After a recheck in 2012, the Census Bureau changed the 2010 population from 48,815 to 49,147. Mayor Jamie Mayo, however, maintains that the Monroe population is more than 50,000 and indicated that he will pursue a continued challenge to the count.'},{airportCode:'MRY',cityName:'Monterey, California',wikiUrl:'https://en.wikipedia.org/wiki/Monterey,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/MontereyWharf%26Harbor.jpg/300px-MontereyWharf%26Harbor.jpg',imgDescription:'Fisherman\'s Wharf and downtown rooftops, seen from  Monterey Bay',cityDescription:'The City of Monterey in Monterey County is located on the southern edge of Monterey Bay, on Central California\'s Pacific coast in California. It stands at an elevation of 26 feet  above sea level, on a land area of 8.466 sq mi . The 2010 census recorded a population of 27,810.'},{airportCode:'MGM',cityName:'Montgomery, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Montgomery,_Alabama',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/Montgomery%2Cal.png/250px-Montgomery%2Cal.png',imgDescription:'Images top, left to right: Alabama State Capitol, Dexter Avenue Baptist Church, Frank M. Johnson, Jr., Federal Building and United States Courthouse, First White House of the Confederacy',cityDescription:'Montgomery  is the capital of the U.S. state of Alabama and is the county seat of Montgomery County. Named for Richard Montgomery, it is located on the Alabama River, in the Gulf Coastal Plain. As of the 2010 Census, Montgomery had a population of 205,764. It is the second-largest city in Alabama, after Birmingham, and the 103rd largest in the United States. The Montgomery Metropolitan Statistical Area had a 2010 estimated population of 374,536. It is the fourth-largest in the state and 136th among United States metropolitan areas.'},{airportCode:'MTJ',cityName:'Montrose, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Montrose,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/MontroseMain-1.jpg/250px-MontroseMain-1.jpg',imgDescription:'Main Street',cityDescription:'The City of Montrose is the Home Rule Municipality that is the county seat and the most populous municipality of Montrose County, Colorado, United States. The city population was 19,132 at the 2010 United States Census. The main road that leads in and out of Montrose is U.S. Highway 50.'},{airportCode:'MGW',cityName:'Morgantown, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Morgantown,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/59/MotownDOWNTOWN.PNG/350px-MotownDOWNTOWN.PNG',imgDescription:'Downtown Morgantown from Fife Avenue',cityDescription:'Morgantown is a city in and the county seat of Monongalia County, West Virginia. Situated along the banks of the Monongahela River, Morgantown is the largest city in North-Central West Virginia, and the base of the Morgantown, West Virginia Metropolitan Statistical Area. It has a permanent population of 29,660 per the 2010 census, with West Virginia University adding several thousand seasonal residents to the city and surrounding area from September through May. Morgantown is best known as the home of West Virginia University and the one-of-a-kind Morgantown Personal Rapid Transit system.'},{airportCode:'MWH',cityName:'Moses Lake, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Moses_Lake,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ab/Aerial_view_of_Moses_Lake_%26_Potholes_Reservoir%2C_Washington_01A.jpg/240px-Aerial_view_of_Moses_Lake_%26_Potholes_Reservoir%2C_Washington_01A.jpg',imgDescription:'Aerial view of Moses Lake & Potholes Reservoir',cityDescription:'Moses Lake is a city in Grant County, Washington, United States. The population was 20,366 as of the 2010 census. Moses Lake is the largest city in Grant County.'},{airportCode:'MSL',cityName:'Muscle Shoals, Alabama',wikiUrl:'https://en.wikipedia.org/wiki/Muscle_Shoals,_Alabama',imgUrl:undefined,imgDescription:undefined,cityDescription:'Muscle Shoals is the largest city in Colbert County, Alabama, United States. As of the 2010 census, the population of Muscle Shoals was 13,146. The estimated population in 2014 was 13,614.'},{airportCode:'MKG',cityName:'Muskegon, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Muskegon,_Michigan',imgUrl:undefined,imgDescription:undefined,cityDescription:'Muskegon  is a city in the U.S. state of Michigan, and is the largest populated city on the eastern shores of Lake Michigan. At the 2010 census the city population was 38,401. The city is the county seat of Muskegon County. It is located at the southwest corner of Muskegon Township, but is administratively autonomous.'},{airportCode:'MRY',cityName:'Monterey, California',wikiUrl:'https://en.wikipedia.org/wiki/Monterey,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/MontereyWharf%26Harbor.jpg/300px-MontereyWharf%26Harbor.jpg',imgDescription:'Fisherman\'s Wharf and downtown rooftops, seen from  Monterey Bay',cityDescription:'The City of Monterey in Monterey County is located on the southern edge of Monterey Bay, on Central California\'s Pacific coast in California. It stands at an elevation of 26 feet  above sea level, on a land area of 8.466 sq mi . The 2010 census recorded a population of 27,810.'},{airportCode:'ACK',cityName:'Nantucket, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Nantucket,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/Nantucket-08-2004.jpg/250px-Nantucket-08-2004.jpg',imgDescription:'Nantucket',cityDescription:'Nantucket  is an island 30 miles  south of Cape Cod, in the American state of Massachusetts. Together with the small islands of Tuckernuck and Muskeget, it constitutes the Town of Nantucket, and the conterminous Nantucket County, which are consolidated. As of the 2010 census, the population was 10,172, making it the least-populous county in Massachusetts. Part of the town is designated the Nantucket CDP, or census-designated place. The region of Surfside on Nantucket is the southernmost settlement in Massachusetts.'},{airportCode:'BNA',cityName:'Nashville, Tennessee',wikiUrl:'https://en.wikipedia.org/wiki/Nashville,_Tennessee',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/Nashville_collage_2009.jpg/250px-Nashville_collage_2009.jpg',imgDescription:'From top left: 2nd Avenue, Kirkland Hall at Vanderbilt University, the Parthenon, the Nashville skyline, Nissan Stadium, Dolly Parton performing at the Grand Ole Opry, and Ryman Auditorium',cityDescription:'Nashville is the capital of the U.S. state of Tennessee and the county seat of Davidson County. Nashville is the second largest city in Tennessee, after Memphis, and is the fourth largest city in the Southeastern United States. It is located on the Cumberland River in the north-central part of the state. The city is a center for the music, healthcare, publishing, banking and transportation industries, and is home to numerous colleges and universities. Reflecting the city\'s position in state government, Nashville is home to the Tennessee Supreme Court\'s courthouse for Middle Tennessee. It is known as a center of the music industry, earning it the nickname "Music City".'},{airportCode:'EWN',cityName:'New Bern, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/New_Bern,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/93/New_Bern_City_Hall.jpg/250px-New_Bern_City_Hall.jpg',imgDescription:'New Bern City Hall',cityDescription:'New Bern  is a city in Craven County, North Carolina, United States. As of the 2010 census it had a population of 29,524, which had risen to an estimated 30,242 as of 2013. It is the county seat of Craven County and the principal city of the New Bern Metropolitan Statistical Area.'},{airportCode:'HVN',cityName:'New Haven, Connecticut',wikiUrl:'https://en.wikipedia.org/wiki/New_Haven,_Connecticut',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/New_Haven_montage_2.jpg/270px-New_Haven_montage_2.jpg',imgDescription:'Montage of New Haven. Clockwise from top left: Downtown New Haven skyline, East Rock Park, summer festivities on the New Haven Green, shops along Upper State Street, Five Mile Point Lighthouse, Harkness Tower, and Connecticut Hall at Yale.',cityDescription:'New Haven , in the U.S. state of Connecticut, is the principal municipality in Greater New Haven, which had a total population of 862,477 in 2010. It is located on New Haven Harbor on the northern shore of the Long Island Sound in New Haven County, Connecticut, which in turn comprises the outer limits of the New York metropolitan area. It is the second-largest city in Connecticut , with a population of 129,779 people as of the 2010 United States Census. According to a census of 1 July 2012, by the Census Bureau, the city had a population of 130,741.'},{airportCode:'MSY',cityName:'New Orleans, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/New_Orleans,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/New_Orleans%2C_Louisiana_montage.jpg/330px-New_Orleans%2C_Louisiana_montage.jpg',imgDescription:'From top left: A typical New Orleans mansion off St. Charles Avenue, a streetcar passing by Loyola University and Tulane University, the skyline of the Central Business District, Jackson Square, and a view of Royal Street in the French Quarter',cityDescription:'New Orleans ) is a major United States port and the largest city and metropolitan area in the state of Louisiana. The population of the city was 343,829 as of the 2010 U.S. Census. The New Orleans metropolitan area  had a population of 1,167,764 in 2010 and was the 46th largest in the United States. The New OrleansMetairieBogalusa Combined Statistical Area, a larger trading area, had a 2010 population of 1,452,502.'},{airportCode:'LGA',cityName:'New York, New York',wikiUrl:'https://en.wikipedia.org/wiki/New_York,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9d/NYC_Montage_2014_4_-_Jleon.jpg/295px-NYC_Montage_2014_4_-_Jleon.jpg',imgDescription:'Clockwise, from top: Midtown Manhattan, Times Square, the Unisphere in Queens, the Brooklyn Bridge, Lower Manhattan with One World Trade Center, Central Park, the headquarters of the United Nations, and the Statue of Liberty',cityDescription:'New Yorkoften called New York City or the City of New York to distinguish it from the State of New York, of which it is a partis the most populous city in the United States and the center of the New York metropolitan area, the premier gateway for legal immigration to the United States and one of the most populous urban agglomerations in the world. A global power city, New York exerts a significant impact upon commerce, finance, media, art, fashion, research, technology, education, and entertainment, its fast pace defining the term New York minute. Home to the headquarters of the United Nations, New York is an important center for international diplomacy and has been described as the cultural and financial capital of the world.'},{airportCode:'JFK',cityName:'New York, New York',wikiUrl:'https://en.wikipedia.org/wiki/New_York,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9d/NYC_Montage_2014_4_-_Jleon.jpg/295px-NYC_Montage_2014_4_-_Jleon.jpg',imgDescription:'Clockwise, from top: Midtown Manhattan, Times Square, the Unisphere in Queens, the Brooklyn Bridge, Lower Manhattan with One World Trade Center, Central Park, the headquarters of the United Nations, and the Statue of Liberty',cityDescription:'New Yorkoften called New York City or the City of New York to distinguish it from the State of New York, of which it is a partis the most populous city in the United States and the center of the New York metropolitan area, the premier gateway for legal immigration to the United States and one of the most populous urban agglomerations in the world. A global power city, New York exerts a significant impact upon commerce, finance, media, art, fashion, research, technology, education, and entertainment, its fast pace defining the term New York minute. Home to the headquarters of the United Nations, New York is an important center for international diplomacy and has been described as the cultural and financial capital of the world.'},{airportCode:'NYC',cityName:'New York, New York',wikiUrl:'https://en.wikipedia.org/wiki/New_York,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9d/NYC_Montage_2014_4_-_Jleon.jpg/295px-NYC_Montage_2014_4_-_Jleon.jpg',imgDescription:'Clockwise, from top: Midtown Manhattan, Times Square, the Unisphere in Queens, the Brooklyn Bridge, Lower Manhattan with One World Trade Center, Central Park, the headquarters of the United Nations, and the Statue of Liberty',cityDescription:'New Yorkoften called New York City or the City of New York to distinguish it from the State of New York, of which it is a partis the most populous city in the United States and the center of the New York metropolitan area, the premier gateway for legal immigration to the United States and one of the most populous urban agglomerations in the world. A global power city, New York exerts a significant impact upon commerce, finance, media, art, fashion, research, technology, education, and entertainment, its fast pace defining the term New York minute. Home to the headquarters of the United Nations, New York is an important center for international diplomacy and has been described as the cultural and financial capital of the world.'},{airportCode:'EWR',cityName:'Newark, New Jersey',wikiUrl:'https://en.wikipedia.org/wiki/Newark,_New_Jersey',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Rutgers_Newark_campus_003.jpg/280px-Rutgers_Newark_campus_003.jpg',imgDescription:'Campus of Rutgers-Newark and Downtown',cityDescription:'Newark  is the largest city  in the U.S. state of New Jersey, and the county seat of Essex County. One of the nation\'s major air, shipping, and rail hubs, the city had a population of 277,140 in 2010, making it the nation\'s 67th most-populous municipality, after being ranked 63rd in the nation in 2000.'},{airportCode:'SWF',cityName:'Newburgh, New York',wikiUrl:'https://en.wikipedia.org/wiki/Newburgh,_New_York',imgUrl:undefined,imgDescription:undefined,cityDescription:'Newburgh  is a city located in Orange County, New York, United States, 60 miles  north of New York City, and 90 miles  south of Albany, on the Hudson River. Newburgh is a part of the New York metropolitan area. The Newburgh area was first settled in the early 18th century by the Germans and British. During the American Revolution, Newburgh served as the headquarters of the Continental Army. Prior to its chartering in 1865, the city of Newburgh was part of the town of Newburgh; the town now borders the city to the north and west. East of the city is the Hudson River; the city of Beacon, New York across the river, and connected to Newburgh via the NewburghBeacon Bridge. The entire southern boundary of the city is with the town of New Windsor. Most of this boundary is formed by Quassaick Creek.'},{airportCode:'PHF',cityName:'Newport News, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Newport_News,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/6/68/Downtown_Newport_News.jpg/200px-Downtown_Newport_News.jpg',imgDescription:'The downtown Newport News skyline as seen from 26th Street and I-664 overpass in August 2013.',cityDescription:'Newport News is an independent city located in the U.S. state of Virginia. As of the 2010 census, the population was 180,719. In 2013, the population was estimated to be 183,412, making it the fifth-most populous city in Virginia.'},{airportCode:'OME',cityName:'Nome, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Nome,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/33/Nome_Alaska_%281%29.jpg/250px-Nome_Alaska_%281%29.jpg',imgDescription:'Steadman Street facing North from Front Street. Nome in May 2002',cityDescription:'Nome  is a city in the Nome Census Area in the Unorganized Borough of the U.S. state of Alaska. The city is located on the southern Seward Peninsula coast on Norton Sound of the Bering Sea. According to the 2010 Census, the city population was 3,598. The 2014 population estimate was 3,788, suggesting a slight increase. Nome was incorporated on April 9, 1901, and was once the most populous city in Alaska. Nome lies within the region of the Bering Straits Native Corporation.'},{airportCode:'ORF',cityName:'Norfolk, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Norfolk,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/Seal_of_Norfolk%2C_Virginia.png/100px-Seal_of_Norfolk%2C_Virginia.png',imgDescription:'Official seal of Norfolk, Virginia',cityDescription:'Norfolk  is an independent city in the Commonwealth of Virginia, United States of America. At the 2010 census, the population was 242,803; in 2013, the population was estimated to be 246,392 making it the second-most populous city in Virginia, behind neighboring Virginia Beach.'},{airportCode:'OTH',cityName:'North Bend, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/North_Bend,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/North_Bend_aerial.jpg/250px-North_Bend_aerial.jpg',imgDescription:'North Bend from above, looking toward the Pacific Ocean',cityDescription:'North Bend is a city in Coos County, Oregon, United States with a population of 9,695 as of the 2010 census. North Bend is surrounded on three sides by Coos Bay, an S-shaped water inlet and estuary where the Coos River enters Coos Bay and borders the city of Coos Bay to the south. North Bend became an incorporated city in 1903.'},{airportCode:'LBF',cityName:'North Platte, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/North_Platte,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Golden_Spike_Tower%2C_North_Platte.JPG/250px-Golden_Spike_Tower%2C_North_Platte.JPG',imgDescription:'Golden Spike Tower and visitor center at Union Pacific\'s Bailey Yards',cityDescription:'North Platte is a city in and the county seat of Lincoln County, Nebraska, United States. It is located in the southwestern part of the state, along Interstate 80, at the confluence of the North and South Platte Rivers forming the Platte River. The population was 24,733 at the 2010 census.'},{airportCode:'OAK',cityName:'Oakland, California',wikiUrl:'https://en.wikipedia.org/wiki/Oakland,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d5/OAKLAND%2C_CA%2C_USA_-_Skyline_and_Bridge.JPG/300px-OAKLAND%2C_CA%2C_USA_-_Skyline_and_Bridge.JPG',imgDescription:'Oakland skyline, with the old eastern span of the San FranciscoOakland Bay Bridge in background',cityDescription:'Oakland  is a major West Coast port city in the U.S. state of California. Oakland is the third largest city in the San Francisco Bay Area, the eighth-largest city in California, and the 45th-largest city in the U.S. with a population of 413,775 as of 2014 . It serves as a trade center for the San Francisco Bay Area; its Port of Oakland is the busiest port for San Francisco Bay, all of Northern California, and fifth busiest in the United States. Incorporated in 1852, Oakland is the county seat of Alameda County. It is also the principal city of the Bay Area Region known as the East Bay. The city is situated directly across the bay, six miles  east of San Francisco.'},{airportCode:'OGS',cityName:'Ogdensburg, New York',wikiUrl:'https://en.wikipedia.org/wiki/Ogdensburg,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/Ogdensburg_NY.JPG/270px-Ogdensburg_NY.JPG',imgDescription:'Ogdensburg NY.JPG',cityDescription:'Ogdensburg is a city in St. Lawrence County, New York, United States. The population was 11,128 at the 2010 census. In the late 18th century, European-American settlers named the community after American land owner and developer Samuel Ogden.'},{airportCode:'OKC',cityName:'Oklahoma City, Oklahoma',wikiUrl:'https://en.wikipedia.org/wiki/Oklahoma_City,_Oklahoma',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/Oklahoma_City_montage.png/250px-Oklahoma_City_montage.png',imgDescription:'From top left to clockwise: downtown skyline, SkyDance Bridge, City Hall, Gold Star Memorial Building, Chesapeake Energy Arena, Oklahoma City National Memorial, Oklahoma State Capitol.',cityDescription:'Oklahoma City is the capital and largest city of the state of Oklahoma. The county seat of Oklahoma County, the city ranks 27th among United States cities in population. The population grew following the 2010 Census, with the population estimated to have increased to 620,602 as of July 2014. As of 2014, the Oklahoma City metropolitan area had a population of 1,322,429, and the Oklahoma City-Shawnee Combined Statistical Area had a population of 1,459,758  residents, making it Oklahoma\'s largest metropolitan area. Oklahoma City\'s city limits extend into Canadian, Cleveland, and Pottawatomie counties, though much of those areas outside of the core Oklahoma County area are suburban or rural . The city ranks as the eighth-largest city in the United States by land area .'},{airportCode:'OMA',cityName:'Omaha, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Omaha,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4e/Heartland_of_America_Park%2C_Omaha%2C_Nebraska.jpg/250px-Heartland_of_America_Park%2C_Omaha%2C_Nebraska.jpg',imgDescription:'View of Downtown Omaha from Heartland of America Park',cityDescription:'Omaha  is the largest city in the state of Nebraska, United States, and is the county seat of Douglas County. It is located in the Midwestern United States on the Missouri River, about 10 miles  north of the mouth of the Platte River. Omaha is the anchor of the Omaha-Council Bluffs metropolitan area, which includes Council Bluffs, Iowa, across the Missouri River from Omaha. According to the 2010 census, Omaha\'s population was 408,958, making it the nation\'s 41st-largest city. According to the 2014 Population Estimates, Omaha\'s population was 446,599. Including its suburbs, Omaha formed the 60th-largest metropolitan area in the United States in 2013 with an estimated population of 895,151 residing in eight counties. The Omaha-Council Bluffs-Fremont, NE-IA Combined Statistical Area is 931,667, according to the U.S. Census Bureau\'s 2013 estimate. There are nearly 1.3 million residents within a 50-mile  radius of the city\'s center, forming the Greater Omaha area.'},{airportCode:'ONT',cityName:'Ontario, California',wikiUrl:'https://en.wikipedia.org/wiki/Ontario,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/81/Ontario_Convention_Center.jpg/255px-Ontario_Convention_Center.jpg',imgDescription:'The Ontario Convention Center in September 2006.',cityDescription:'Ontario is a city located in southwestern San Bernardino County, California, United States, 35 miles  east of downtown Los Angeles. Located in the western part of the Inland Empire region, it lies just east of the Los Angeles county line and is part of the Greater Los Angeles Area. As of the 2010 Census, the city had a population of 163,924, up from 158,007 at the 2000 census, making it the county\'s fourth most populous city after San Bernardino, Fontana, and Rancho Cucamonga.'},{airportCode:'SNA',cityName:'Orange County, California',wikiUrl:'https://en.wikipedia.org/wiki/Orange_County,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/The_City_of_Newport_Beach_July_2014_photo_D_Ramey_Logan.jpg/310px-The_City_of_Newport_Beach_July_2014_photo_D_Ramey_Logan.jpg',imgDescription:'The City of Newport Beach July 2014 photo D Ramey Logan.jpg',cityDescription:'Orange County is a county in the U.S. state of California. As of the 2010 census, the population was 3,010,232 making it the third-most populous county in California, the sixth-most populous in the United States, and more populous than twenty-one U.S. states. Its county seat is Santa Ana. It is the second most densely populated county in the state, second only to San Francisco County. The county\'s four largest cities, Anaheim, Santa Ana, Irvine, and Huntington Beach each have populations exceeding 200,000. Several of Orange County\'s cities are on the Pacific coast, including Huntington Beach, Newport Beach, Laguna Beach, and San Clemente.'},{airportCode:'MCO',cityName:'Orlando, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Orlando,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e3/Orlando_Skyline.jpg/263px-Orlando_Skyline.jpg',imgDescription:'Downtown Orlando',cityDescription:'Orlando  is a city in the U.S. state of Florida, and the county seat of Orange County. Located in Central Florida, it is the center of the Orlando metropolitan area, which had a population of 2,134,411 at the 2010 census, making it the 26th largest metropolitan area in the United States, the sixth largest metropolitan area in the Southern United States, and the third largest metropolitan area in the state of Florida. In 2010, Orlando had a city-proper population of 238,300, making it the 77th largest city in the United States, the fifth largest city in Florida, and the state\'s largest inland city.'},{airportCode:'OSH',cityName:'Oshkosh, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Oshkosh,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1f/Downtown_Oshkosh%2C_Wisconsin%2C_in_2006.jpg/250px-Downtown_Oshkosh%2C_Wisconsin%2C_in_2006.jpg',imgDescription:'Downtown Oshkosh',cityDescription:'Oshkosh is a city in Winnebago County, Wisconsin, United States, located where the Fox River enters Lake Winnebago from the west. The population was 66,083 at the 2010 census. The city is located adjacent to and partially within the Town of Oshkosh.'},{airportCode:'OWB',cityName:'Owensboro, Kentucky',wikiUrl:'https://en.wikipedia.org/wiki/Owensboro,_Kentucky',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Owensboro2ndStAnn.JPG/250px-Owensboro2ndStAnn.JPG',imgDescription:'Historic District in downtown Owensboro',cityDescription:'Owensboro is a home rule-class city in and the county seat of Daviess County, Kentucky, United States. It is the 4th-largest city in the state by population. It is located on U.S. Route 60 about 107 miles  southwest of Louisville, and is the principal city of the Owensboro metropolitan area. The city\'s population was 57,265 at the 2010 census, with an estimated population of 58,374 in 2014. The metropolitan population was estimated at 116,506 that same year.'},{airportCode:'OXR',cityName:'Oxnard, California',wikiUrl:'https://en.wikipedia.org/wiki/Oxnard,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/e/e9/Oxnard_gateway.jpg/250px-Oxnard_gateway.jpg',imgDescription:'Oxnard gateway monument sign.',cityDescription:'Oxnard  is a city in the United States, located along the coast of Southern California. It is the 19th most populous city in California and the most populous in Ventura County. The city lies approximately 30 miles west of the Los Angeles city limits, and is part of the larger Greater Los Angeles area. The population of Oxnard is 203,585 as of the 2012 Financial Report. Oxnard is the most populous city in the Oxnard-Thousand Oaks-Ventura, CA Metropolitan Statistical Area, which is listed as one of the wealthiest areas in America, with its residents making well above the average national income. In 2013, Oxnard was ranked as one of the safest cities in America with violent crime rates well below the national average.'},{airportCode:'PAH',cityName:'Paducah, Kentucky',wikiUrl:'https://en.wikipedia.org/wiki/Paducah,_Kentucky',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/1884_Paducah%2CKentucky_Flood.jpg/250px-1884_Paducah%2CKentucky_Flood.jpg',imgDescription:'1884 Paducah Flood',cityDescription:'Paducah  is the county seat of McCracken County, Kentucky, United States. The largest city in the Jackson Purchase region, it is located at the confluence of the Tennessee and the Ohio Rivers, halfway between St. Louis, Missouri, to the northwest and Nashville, Tennessee, to the southeast. The population was 25,024 during the 2010 U.S. Census. Twenty blocks of the city\'s downtown have been designated as a historic district and listed on the National Register of Historic Places.'},{airportCode:'PGA',cityName:'Page, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Page,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/db/Page_AZ.jpg/250px-Page_AZ.jpg',imgDescription:'View of Lake Powell Boulevard in Page',cityDescription:'Page is a city in Coconino County, Arizona, United States, near the Glen Canyon Dam and Lake Powell. As of the 2010 census, the population of the city was 7,247.'},{airportCode:'PSP',cityName:'Palm Springs, California',wikiUrl:'https://en.wikipedia.org/wiki/Palm_Springs,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Downtown_Palm_Springs_CA.JPG/250px-Downtown_Palm_Springs_CA.JPG',imgDescription:'Downtown Palm Springs',cityDescription:'Palm Springs is a desert resort city in Riverside County, California, United States, within the Coachella Valley. It is located approximately 55 mi  east of San Bernardino, 107 mi  east of Los Angeles, 123 mi  northeast of San Diego, and 268 mi  west of Phoenix, Arizona. The population was 44,552 as of the 2010 census. Palm Springs covers approximately 94 square miles , making it the largest city in the county by land area.'},{airportCode:'PFN',cityName:'Panama City, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Panama_City,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Panama_City_FL_City_Hall.jpg/300px-Panama_City_FL_City_Hall.jpg',imgDescription:'Panama City\'s city hall in November 2013.',cityDescription:'Panama City is a city and the county seat of Bay County, Florida, United States. Located along U.S. Route 98, it is the largest city between Tallahassee and Pensacola. It is the more populated of two principal cities of the Panama City-Lynn Haven, Florida Metropolitan Statistical Area. As of the 2010 census, the city population was 36,484. When Panama City was incorporated in 1909, its original city limits were 15th Street  on the north, Balboa Avenue on the west and Bay Avenue on the east.'},{airportCode:'PKB',cityName:'Parkersburg, West Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Parkersburg,_West_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Boreman_view.jpg/250px-Boreman_view.jpg',imgDescription:'Downtown Parkersburg as viewed from Fort Boreman Historical Park in 2006',cityDescription:'Parkersburg is a city in and the county seat of Wood County, West Virginia, United States. Located at the confluence of the Ohio and Little Kanawha rivers, it is the state\'s fourth-largest city and the largest city in the ParkersburgMariettaVienna Metropolitan Statistical Area. The population was 31,492 at the 2010 census. Its peak of population was more than 44,000 in 1960. The city is about 14 miles south of Marietta, Ohio.'},{airportCode:'PSC',cityName:'Pasco, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Pasco,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/City_Hall_in_Pasco%2C_Washington_%28panorama%29.jpg/250px-City_Hall_in_Pasco%2C_Washington_%28panorama%29.jpg',imgDescription:'Pasco City Hall',cityDescription:'Pasco  is a city in and the county seat of Franklin County, Washington, United States.'},{airportCode:'PLN',cityName:'Pellston, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Pellston,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Pellston_Michigan_Downtown_Looking_South_US31.jpg/250px-Pellston_Michigan_Downtown_Looking_South_US31.jpg',imgDescription:'Looking south in downtown Pellston on US 31',cityDescription:'Pellston is a village in Emmet County in the U.S. state of Michigan. The population was 822 at the 2010 census. The village is the home of Pellston Regional Airport. Its motto is "Icebox of the Nation"; Pellston recorded the state of Michigan\'s record low temperature, at 53 F . in 1933, and every winter is regularly called out in national weather reports, along with towns such as Big Piney, Wyoming, Fraser, Colorado and International Falls, Minnesota, as one of the coldest spots in the nation.'},{airportCode:'PDT',cityName:'Pendleton, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/Pendleton,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Pendleton_Oregon_downtown.jpg/250px-Pendleton_Oregon_downtown.jpg',imgDescription:'Main Street in Downtown Pendleton',cityDescription:'Pendleton is a city in Umatilla County, Oregon, United States. Developed along the Umatilla River, Pendleton was named in 1868 by the county commissioners for George H. Pendleton, Democratic candidate for vice-president in the 1864 presidential campaign. The population was 16,612 at the 2010 census. The city is the county seat of Umatilla County.'},{airportCode:'PNS',cityName:'Pensacola, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Pensacola,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/Collage_of_images_from_around_Pensacola.jpg/250px-Collage_of_images_from_around_Pensacola.jpg',imgDescription:'Clockwise from top: Pensacola skyline, T. T. Wentworth, Jr. Florida State Museum, University of West Florida Library, Escambia County Courthouse, William Dudley Chipley Obelisk,  National Naval Aviation Museum',cityDescription:'Pensacola  is the westernmost city in the Florida Panhandle and the county seat of Escambia County, Florida, United States. As of the 2010 census, the city had a total population of 51,923, down from 56,255 at the 2000 census. Pensacola is the principal city of the Pensacola metropolitan area, which had an estimated 461,227 residents in 2012.'},{airportCode:'PIA',cityName:'Peoria, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Peoria,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Peoria  is a city in and the county seat of Peoria County, Illinois, United States, and the largest city on the Illinois River. Established in 1691 by the French explorer Henri de Tonti, Peoria is the oldest European settlement in Illinois, and is named after the Peoria tribe. As of the 2010 census, the city was the seventh-most populated in Illinois , with a population of 115,007. The Peoria Metropolitan Statistical Area had a population of 373,590 in 2011. Peoria had a population of 118,943 in 2010, when far northern Peoria was also included. Peoria is the headquarters for Caterpillar Inc., one of the 30 companies composing the Dow Jones Industrial Average.'},{airportCode:'PHL',cityName:'Philadelphia, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Philadelphia,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/Philadelphia_Montage_by_Jleon_0310.jpg/325px-Philadelphia_Montage_by_Jleon_0310.jpg',imgDescription:'From top left, the Philadelphia skyline, a statue of Benjamin Franklin, the Liberty Bell, the Philadelphia Museum of Art, Philadelphia City Hall, and Independence Hall',cityDescription:'Philadelphia  is the largest city in the Commonwealth of Pennsylvania and the fifth-most-populous in the United States, with an estimated population in 2014 of 1,560,297. In the Northeastern United States, at the confluence of the Delaware and Schuylkill River, Philadelphia is the economic and cultural anchor of the Delaware Valley, a metropolitan area home to 7.2 million people and the eighth-largest combined statistical area in the United States.'},{airportCode:'PHX',cityName:'Phoenix, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Phoenix,_Arizona',imgUrl:undefined,imgDescription:undefined,cityDescription:'Phoenix  is the capital, and largest city, of the state of Arizona. With 1,445,632 people , Phoenix is the most populous state capital in the United States, as well as the sixth most populous city nationwide.'},{airportCode:'PIR',cityName:'Pierre, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Pierre,_South_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/PierreSD_Capitol.jpg/250px-PierreSD_Capitol.jpg',imgDescription:'The South Dakota State Capitol building near the Missouri River in downtown Pierre.',cityDescription:'Pierre   is the capital of the state of South Dakota and the county seat of Hughes County. The population was 13,646 at the 2010 census, making it the second least populous state capital after Montpelier, Vermont. Founded in 1880 on the Missouri River opposite Fort Pierre, Pierre has been the capital since South Dakota gained statehood on November 2, 1889, having been chosen for its location in the geographic center of the state. Fort Pierre itself was named after Pierre Chouteau, Jr., an American fur trader of French origin.'},{airportCode:'SOP',cityName:'Pinehurst, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Pinehurst,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Mystic_Cottage_%28Pinehurst%2C_North_Carolina%29_001.jpg/250px-Mystic_Cottage_%28Pinehurst%2C_North_Carolina%29_001.jpg',imgDescription:'Mystic Cottage (1900), historic building in the district',cityDescription:'Pinehurst is a village in Moore County, North Carolina, United States. As of the 2010 census, the city population was 13,124. It is home of the historic golf resort, Pinehurst Resort. A large portion of the central village, including the resort complexes, is a National Historic Landmark District, designated in 1996 for its landscape design  and its significance in the history of golf in the United States.'},{airportCode:'PIT',cityName:'Pittsburgh, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Pittsburgh,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c6/Montage_Pittsburgh.jpg/250px-Montage_Pittsburgh.jpg',imgDescription:'Clockwise: Cathedral of Learning at the University of Pittsburgh; Pittsburgh skyline; Carnegie Mellon University; PNC Park; Duquesne Incline',cityDescription:'Pittsburgh  is the second-largest city in the Commonwealth of Pennsylvania with a population of 305,842 and the county seat of Allegheny County. The Combined Statistical Area  population of 2,659,937 is the largest in both the Ohio Valley and Appalachia and the 20th-largest in the U.S. Pittsburgh is known as both "the Steel City" for its more than 300 steel-related businesses, as well as "the City of Bridges" for its 446 bridges. The city features 30 skyscrapers, 2 inclines, a pre-revolutionary fortification and the source of the Ohio River at the confluence of the Monongahela and Allegheny rivers. This vital link of the Atlantic coast and Midwest through the mineral-rich Alleghenies made the area coveted by the French and British Empires, Virginia, Whiskey Rebels, Civil War raiders and media networks.'},{airportCode:'PIH',cityName:'Pocatello, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Pocatello,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/Downtown_Pocatello_Idaho_2004.jpg/250px-Downtown_Pocatello_Idaho_2004.jpg',imgDescription:'Historic downtown Pocatello in 2007',cityDescription:'Pocatello  is the county seat and largest city of Bannock County, with a small portion on the Fort Hall Indian Reservation in neighboring Power County, in the southeastern part of the US state of Idaho. It is the principal city of the Pocatello metropolitan area, which encompasses all of Bannock county. As of the 2010 census the population of Pocatello was 54,255.'},{airportCode:'PNC',cityName:'Ponca City, Oklahoma',wikiUrl:'https://en.wikipedia.org/wiki/Ponca_City,_Oklahoma',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Veteran%27s_Day_parade%2C_Ponca_City%2C_Oklahoma.jpg/250px-Veteran%27s_Day_parade%2C_Ponca_City%2C_Oklahoma.jpg',imgDescription:'Veteran\'s Day Parade down Grand Avenue in front of the Ponca City Civic Center and Town Hall',cityDescription:'Ponca City  is a city in Kay and is partly in Osage counties in the U.S. state of Oklahoma, which was named after the Ponca Tribe. Ponca City had a population of 25,387 at the time of the 2010 census.'},{airportCode:'PWM',cityName:'Portland, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Portland,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Portland%2C_Maine_Montage.jpg/300px-Portland%2C_Maine_Montage.jpg',imgDescription:'Clockwise: Portland waterfront, the Portland Observatory on Munjoy Hill, the corner of Middle and Exchange Street in the Old Port, Congress Street, the Civil War Memorial in Monument Square, and winter light sculptures in Congress Square Plaza.',cityDescription:'Portland is the largest city in the U.S. state of Maine and the county seat of Cumberland County. In 2013, the city proper had a population of 66,318, growing 3 percent since the census of 2000, while the urban area had a population of 203,914. The Greater Portland metropolitan area is home to over half a million people, more than one-third of Maine\'s total population.'},{airportCode:'PDX',cityName:'Portland, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/Portland,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1a/PDX%2C_Oregon_collage.png/300px-PDX%2C_Oregon_collage.png',imgDescription:'Clockwise from top: Downtown Portland viewed from east bank of the Willamette River; the Wells Fargo Center; Portland Aerial Tram and Mount Hood; Jackson Tower and Fox Tower viewed from Pioneer Courthouse Square; St. Johns Bridge; U.S. National Bank Building',cityDescription:'Portland  is the largest city in the U.S. state of Oregon and the seat of Multnomah County. It is located in the Willamette Valley region of the Pacific Northwest, at the confluence of the Willamette and Columbia rivers. The city covers 145 square miles  and had an estimated population of 619,360 in 2014, making it the 28th most populous city in the United States. Approximately 2,348,247 people live in the Portland metropolitan statistical area , the 24th most populous MSA in the United States. Its Combined Statistical Area  ranks 17th with a population of 3,022,178. Roughly 60 percent of Oregon\'s population resides within the Portland metropolitan area.'},{airportCode:'PSM',cityName:'Portsmouth, New Hampshire',wikiUrl:'https://en.wikipedia.org/wiki/Portsmouth,_New_Hampshire',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5a/Portsmouth%2C_NH_-_Market_Square.JPG/250px-Portsmouth%2C_NH_-_Market_Square.JPG',imgDescription:'Market Square',cityDescription:'Portsmouth is a city in Rockingham County, New Hampshire, in the United States. It is the only city in the county, but only the fourth-largest community, with a population of 21,233 at the 2010 census. A historic seaport and popular summer tourist destination, Portsmouth was the home of the Strategic Air Command\'s Pease Air Force Base, later converted to Portsmouth International Airport at Pease with limited commercial air service.'},{airportCode:'PRC',cityName:'Prescott, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Prescott,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Courthouseplaza_buckeyoneil.jpg/250px-Courthouseplaza_buckeyoneil.jpg',imgDescription:'Courthouse & Buckey O\'Neill statue',cityDescription:'Prescott (Yavapai: Wi:kwatha Ksikita; English pronunciation:   PRES-kt is a city in Yavapai County, Arizona, United States. According to the 2010 Census, the population of the city is 39,843. The city is the county seat of Yavapai County. In 1864 Prescott was designated as the capital of the Arizona Territory, replacing the temporary capital at Fort Whipple. The Territorial Capital was moved to Tucson in 1867. Prescott again became the Territorial Capital in 1877, until Phoenix became the capital in 1889.'},{airportCode:'PQI',cityName:'Presque Isle, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Presque_Isle,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/City_of_Presque_Isle%2C_Maine_Montage.jpg/250px-City_of_Presque_Isle%2C_Maine_Montage.jpg',imgDescription:'Clockwise, from top:  Crown of Maine Balloon Fest in Presque Isle, Downtown, University of Maine at Presque Isle, Aroostook Band of Micmac headquarters and museum, Nordic Heritage Center, Aroostook Centre Mall, UMPI windmill, Main Street',cityDescription:'Presque Isle  is the commercial center and largest city in Aroostook County, Maine, United States. The population was 9,317 at the 2014 census. The city is home to the University of Maine at Presque Isle, Northern Maine Community College, Husson University Presque Isle, Northern Maine Fairgrounds, The Aroostook Centre Mall, and the Northern Maine Regional Airport.'},{airportCode:'PVD',cityName:'Providence, Rhode Island',wikiUrl:'https://en.wikipedia.org/wiki/Providence,_Rhode_Island',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/39/Providence_Montage_Updated.jpg/310px-Providence_Montage_Updated.jpg',imgDescription:'From top left: Downtown Providence skyline and the Providence River from the Point Street Bridge, Federal Hill, University Hall at Brown University, Roger Williams Park, the First Baptist Church in America, WaterFire at Waterplace Park, and the Rhode Island State House.',cityDescription:'Providence is the capital and most populous city in Rhode Island. Founded in 1636, it is one of the oldest cities in the United States. It is located in Providence County, and is the third-largest city in the New England region after Boston and Worcester. Providence has a city population of 179,154 and is part of the 38th-largest metropolitan population in the country, with an estimated population of 1,604,291, exceeding that of Rhode Island by about 60%, as it extends into southern Massachusetts. This can be considered in turn to be part of the Greater Boston commuting area, which contains 7.6 million people. The city is situated at the mouth of the Providence River, at the head of Narragansett Bay.'},{airportCode:'PVC',cityName:'Provincetown, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Provincetown,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/57/View_of_Provincetown_from_Pilgrim_Monument_looking_east%2C_MA%2C_USA_-_Sept%2C_2013.jpg/280px-View_of_Provincetown_from_Pilgrim_Monument_looking_east%2C_MA%2C_USA_-_Sept%2C_2013.jpg',imgDescription:'Aerial view of Provincetown, Cape Cod',cityDescription:'Provincetown  is a New England town located at the extreme tip of Cape Cod in Barnstable County, Massachusetts, in the United States. A small coastal resort town with a year-round population of just under 3,000, Provincetown has a summer population of as high as 60,000. Often called "P-town" or "P\'town", the town is known for its beaches, harbor, artists, tourist industry, and its status as a vacation destination for the LGBTQ community.'},{airportCode:'PUB',cityName:'Pueblo, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Pueblo,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f0/John_Wark_-_Pueblo_Riverwalk_at_Night.jpg/250px-John_Wark_-_Pueblo_Riverwalk_at_Night.jpg',imgDescription:'Arkansas River Walk in Pueblo',cityDescription:'Pueblo  is a Home Rule Municipality that is the county seat and the most populous city of Pueblo County, Colorado, United States. The population was 106,595 in 2010 census, making it the 246th most populous city in the United States. Pueblo is the heart of the Pueblo Metropolitan Statistical Area totaling over 160,000 people and an important part of the Front Range Urban Corridor. As of 2014, Pueblo is the primary city of the Pueblo-Caon City combined statistical area  totaling approximately 208,000 people, making it the 134th largest in the nation.'},{airportCode:'PUW',cityName:'Pullman, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Pullman,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/WSU_BryanTower.jpg/250px-WSU_BryanTower.jpg',imgDescription:'Bryan Tower on the Pullman WSU campus at twilight',cityDescription:'Pullman is the largest city in Whitman County, located in southeastern Washington state. The population was 29,799 at the 2010 census, estimated to have reached 31,682 in 2014. Originally incorporated as Three Forks, the city was later renamed after industrialist George Pullman.'},{airportCode:'UIN',cityName:'Quincy, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Quincy,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Quincy , known as Illinois\'s "Gem City," is a city on the Mississippi River and the county seat of Adams County, Illinois, United States. As of the 2010 census the city held a population of 40,633, up from 40,366 in 2000. During the 19th Century, Quincy was a thriving transportation center as riverboats and rail service linked the city to many destinations west and along the river. It was once Illinois\' second-largest city, surpassing Peoria in 1870. The city holds several historic districts, including the Downtown Quincy Historic District and the South Side German Historic District showcasing the architecture of Quincy\'s many German immigrants from the late-19th century.'},{airportCode:'RDU',cityName:'Raleigh, North Carolina',wikiUrl:'https://en.wikipedia.org/wiki/Raleigh,_North_Carolina',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5c/Downtown-Raleigh-from-Western-Boulevard-Overpass-20081012.jpeg/250px-Downtown-Raleigh-from-Western-Boulevard-Overpass-20081012.jpeg',imgDescription:'Downtown Raleigh',cityDescription:'Raleigh  is the capital of the state of North Carolina as well as the seat of Wake County in the United States. It is the second most populous city in North Carolina, after Charlotte. Raleigh is known as the "City of Oaks" for its many oak trees, which line the streets in the heart of the city. The city covers a land area of 142.8 square miles . The U.S. Census Bureau estimated the city\'s population to be 439,896 as of July 1, 2014. It is also one of the fastest-growing cities in the country. The city of Raleigh is named after Sir Walter Raleigh, who established the lost Roanoke Colony in present-day Dare County.'},{airportCode:'RAP',cityName:'Rapid City, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Rapid_City,_South_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/14/RapidCitycityscape.jpg/250px-RapidCitycityscape.jpg',imgDescription:'Downtown Rapid City',cityDescription:'Rapid City  is the second-largest city in South Dakota  and the county seat of Pennington County. Named after Rapid Creek, on which the city is established, it is set against the eastern slope of the Black Hills mountain range. The population was 67,956 as of the 2010 Census. Known as the "Gateway to the Black Hills" and the "City of Presidents", it is split by a low mountain ridge that divides the western and eastern parts of the city. Ellsworth Air Force Base is located on the outskirts of the city. Camp Rapid, a part of the United States Army National Guard, is located in the western part of the city. The historic "Old West" town of Deadwood is nearby. In the neighboring Black Hills are the popular tourist attractions of Mount Rushmore, the Crazy Horse Memorial, Custer State Park, and Wind Cave National Park.'},{airportCode:'RDD',cityName:'Redding, California',wikiUrl:'https://en.wikipedia.org/wiki/Redding,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Sundialbridge2.jpg/250px-Sundialbridge2.jpg',imgDescription:'Sundial Bridge at Turtle Bay',cityDescription:'Redding, officially the City of Redding, is the county seat of Shasta County, California in the northern part of the state. It is located on the Sacramento River, which provided transportation and power in its early years. Interstate 5 passes close to the city, which has a population of 89,861. Redding is the largest city in the Shasta Cascade region, and it is the fourth-largest city in the Sacramento Valley, behind Sacramento, Elk Grove, and Roseville.'},{airportCode:'RDM',cityName:'Redmond, Oregon',wikiUrl:'https://en.wikipedia.org/wiki/Redmond,_Oregon',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/13/Redmond%2C_Oregon%2C_Business_Hwy_97.jpg/250px-Redmond%2C_Oregon%2C_Business_Hwy_97.jpg',imgDescription:'Business Highway 97 in Redmond',cityDescription:'Redmond is a city in Deschutes County, Oregon, United States. Incorporated on July 6, 1910, the city is on the eastern side of Oregon\'s Cascade Range, in the High Desert in Central Oregon. From Redmond there is access to recreational opportunities, including mountain biking, fishing, hiking, camping, rock climbing, white-water rafting, skiing, and golf. Redmond is a full-service municipality and one of the fastest-growing industrial and residential communities in Oregon. Redmond had a population of 26,215 in 2010, and the population continues to grow at a rate of about 8 percent each year.'},{airportCode:'RNO',cityName:'Reno, Nevada',wikiUrl:'https://en.wikipedia.org/wiki/Reno,_Nevada',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Reno%2C_Nevada_photo_D_Ramey_Logan.jpg/250px-Reno%2C_Nevada_photo_D_Ramey_Logan.jpg',imgDescription:'Reno aerial September 12, 2014',cityDescription:'Reno is a city in the U.S. state of Nevada. It is located in the Northern portion of the state, approximately 36 miles  from Lake Tahoe. Known as "The Biggest Little City in the World", Reno is famous for its casinos and as the birthplace of Caesars Entertainment Corporation. It is the county seat of Washoe County, located in the northwestern part of the state. The city sits in a high desert at the foot of the Sierra Nevada and its downtown area  occupies a valley informally known as the Truckee Meadows.'},{airportCode:'RHI',cityName:'Rhinelander, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Rhinelander,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/bf/Rhinelander_Wisconsin_Downtown_Looking_East.jpg/250px-Rhinelander_Wisconsin_Downtown_Looking_East.jpg',imgDescription:'Looking east at downtown Rhinelander with view of the Oneida County Courthouse dome',cityDescription:'Rhinelander is a city in and the county seat of Oneida County, Wisconsin, United States. The population was 7,798 at the 2010 census.'},{airportCode:'RIC',cityName:'Richmond, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Richmond,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c0/Collage_of_Landmarks_in_Richmond%2C_Virginia_v_1.jpg/300px-Collage_of_Landmarks_in_Richmond%2C_Virginia_v_1.jpg',imgDescription:'Top: Skyline above the falls of the James River Middle: St. John\'s Episcopal Church, Jackson Ward, Monument Avenue. Bottom: Virginia State Capitol, Main Street Station',cityDescription:'Richmond  is the capital of the Commonwealth of Virginia, in the United States. It is the center of the Richmond Metropolitan Statistical Area  and the Greater Richmond Region. While it was incorporated in 1742, Richmond has been an independent city since 1871.'},{airportCode:'RIW',cityName:'Riverton, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Riverton,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4c/Riverton_%28WY%29_Museum.JPG/250px-Riverton_%28WY%29_Museum.JPG',imgDescription:'The Riverton Museum at Park & 7th Streets',cityDescription:'Riverton  is a city in Fremont County, Wyoming, United States. The city\'s population was 10,615 at the 2010 census.'},{airportCode:'ROA',cityName:'Roanoke, Virginia',wikiUrl:'https://en.wikipedia.org/wiki/Roanoke,_Virginia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/35/Roanoke_City_%28Virginia%29_from_Mill_Mountain_Star_at_Dusk.jpg/250px-Roanoke_City_%28Virginia%29_from_Mill_Mountain_Star_at_Dusk.jpg',imgDescription:'Downtown Roanoke from atop Mill Mountain.',cityDescription:'Roanoke is an independent city in the southern U.S. state of Virginia. As of the 2010 census, the population was 97,032. It is located in the Roanoke Valley of the Roanoke Region of Virginia.'},{airportCode:'RST',cityName:'Rochester, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Rochester,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/Roch_night.JPG/250px-Roch_night.JPG',imgDescription:'Downtown Rochester reflected in south Silver Lake',cityDescription:'Rochester is a city in the U.S. State of Minnesota and is the county seat of Olmsted County. Located on the Zumbro River\'s south fork, the city has a population of 106,769 according to the 2010 United States Census. The U.S. Census Bureau estimated that the 2014 population was 111,402. It is Minnesota\'s third-largest city and the largest city located outside of the Minneapolis-St. Paul-Bloomington Metropolitan Statistical Area. As of 2013, the Rochester metropolitan area has a population of 211,853.'},{airportCode:'ROC',cityName:'Rochester, New York',wikiUrl:'https://en.wikipedia.org/wiki/Rochester,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/30/RochesterCollageDec2015.jpg/300px-RochesterCollageDec2015.jpg',imgDescription:'(Clockwise from top left) the Downtown Rochester Skyline, High Falls (Rochester, New York), Rush Rhees Library at the University of Rochester, Kodak Tower, Times Square Building, Midtown Plaza (Rochester)',cityDescription:'Rochester  is a city on the southern shore of Lake Ontario in the western portion of the U.S. state of New York, and the seat of its Monroe County.'},{airportCode:'RKS',cityName:'Rock Springs, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Rock_Springs,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/DowntownRS.jpg/250px-DowntownRS.jpg',imgDescription:'Old Village Hall, Downtown Rock Springs',cityDescription:'Rock Springs is a city in Sweetwater County, Wyoming, United States. The population was 23,036 at the 2010 census. Rock Springs is the principal city of the Rock Springs micropolitan statistical area, which has a population of 37,975. Rock Springs is known as the Home of 56 Nationalities because of the influx of immigrants from all over the world who came to work in the coal mines that supplied the fuel to power the steam engines of the Union Pacific Railroad. The city\'s rich cultural heritage is celebrated each summer on International Day, a festival where the foods, costumes, and traditions of residents\' ancestors are recreated and enjoyed at Bunning Park in downtown Rock Springs.'},{airportCode:'RFD',cityName:'Rockford, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Rockford,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Rockford is the third largest city in the U.S. state of Illinois, the 171st most populous city in the United States, and the 148th most populous region in the United States. It is the county seat of Winnebago County and is located on both banks of the Rock River in far northern Illinois. According to 2010 census data, the City of Rockford had a population of 152,871, with an outlying metropolitan area population of 348,360, which was estimated to have decreased to 150,251 and 344,623, respectively, by July 2013.'},{airportCode:'RKD',cityName:'Rockland, Maine',wikiUrl:'https://en.wikipedia.org/wiki/Rockland,_Maine',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Rok2.jpg/250px-Rok2.jpg',imgDescription:'Rockland Downtown',cityDescription:'Rockland is a city in Knox County, Maine, in the United States. As of the 2010 census, the city population was 7,297. It is the county seat of Knox County. The city is a popular tourist destination. It is a departure point for the Maine State Ferry Service to the islands of Penobscot Bay: Vinalhaven, North Haven and Matinicus.'},{airportCode:'ROW',cityName:'Roswell, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Roswell,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/20/Roswell_NM_Main_Street.jpg/270px-Roswell_NM_Main_Street.jpg',imgDescription:'Main Street in downtown Roswell',cityDescription:'Roswell is a city in New Mexico. It is the county seat of Chaves County in the southeastern quarter of the state of New Mexico, United States. As of the 2010 census it had a population of 48,411, making it the fifth-largest city in New Mexico. It is a center for irrigated farming, dairying, ranching, manufacturing, distribution, and petroleum production. It is also the home of New Mexico Military Institute , founded in 1891. Bitter Lake National Wildlife Refuge is located a few miles northeast of the city on the Pecos River. Bottomless Lakes State Park is located 12 miles  east of Roswell on US 380.'},{airportCode:'RUT',cityName:'Rutland, Vermont',wikiUrl:'https://en.wikipedia.org/wiki/Rutland,_Vermont',imgUrl:undefined,imgDescription:undefined,cityDescription:'Rutland, Vermont may refer to:'},{airportCode:'SMF',cityName:'Sacramento, California',wikiUrl:'https://en.wikipedia.org/wiki/Sacramento,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/11/Sacramento_Capitol.jpg/86px-Sacramento_Capitol.jpg',imgDescription:'Sacramento Capitol.jpg',cityDescription:'Sacramento  is the capital city of the U.S. state of California and the seat of government of Sacramento County. It is at the confluence of the Sacramento River and the American River in the northern portion of California\'s expansive Central Valley. Its estimated 2014 population of 485,199 made it the sixth-largest city in California. Sacramento is the cultural and economic core of the Sacramento metropolitan area, which includes seven counties with a 2010 population of 2,414,783. Its metropolitan area is the fourth largest in California after the Greater Los Angeles area, the San Francisco Bay Area, and the San Diego metropolitan area, and is the 27th largest in the United States. In 2002, the Civil Rights Project at Harvard University conducted for TIME magazine named Sacramento "America\'s Most Diverse City".'},{airportCode:'MBS',cityName:'Saginaw, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Saginaw,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/79/%22Place_of_the_Sauk%22.jpg/300px-%22Place_of_the_Sauk%22.jpg',imgDescription:'Downtown Saginaw along the Saginaw River',cityDescription:'Saginaw  is a city in the State of Michigan and the seat of Saginaw County. The city of Saginaw and Saginaw County are both located in the area known as Mid-Michigan or Central Michigan. The city of Saginaw is located adjacent to Saginaw Charter Township and is considered part of the Great Lakes Bay area, along with neighboring Bay City and Midland. The Saginaw County MSA had a population of 196,542 in 2013.'},{airportCode:'SLN',cityName:'Salina, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Salina,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/Salina_water_tower.jpg/250px-Salina_water_tower.jpg',imgDescription:'Water tower in Salina (2013)',cityDescription:'Salina  is a city in and the county seat of Saline County, Kansas, United States. As of the 2010 census , the city population was 47,707. Located in one of the world\'s largest wheat-producing areas, Salina is a regional trade center for north-central Kansas. It is home to multiple colleges.'},{airportCode:'SLC',cityName:'Salt Lake City, Utah',wikiUrl:'https://en.wikipedia.org/wiki/Salt_Lake_City,_Utah',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Salt_Lake_City_montage_19_July_2011.jpg/280px-Salt_Lake_City_montage_19_July_2011.jpg',imgDescription:'Clockwise from top: The skyline in July 2011, Utah State Capitol, TRAX, Union Pacific Depot, the Block U, the City and County Building, and the Salt Lake Temple.',cityDescription:'Salt Lake City, often shortened to Salt Lake or SLC, is the capital and the most populous city in the U.S. state of Utah. With an estimated population of 191,180 in 2013, the city lies at the core of the Salt Lake City metropolitan area, which has a total population of 1,153,340 . Salt Lake City is further situated within a larger metropolis known as the Salt Lake City-Ogden-Provo Combined Statistical Area. This region is a corridor of contiguous urban and suburban development stretched along an approximately 120-mile  segment of the Wasatch Front, comprising a total population of 2,423,912 as of 2014. It is one of only two major urban areas in the Great Basin , and the largest in the Intermountain West.'},{airportCode:'SJT',cityName:'San Angelo, Texas',wikiUrl:'https://en.wikipedia.org/wiki/San_Angelo,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/83/Dwntwnsa.jpg/250px-Dwntwnsa.jpg',imgDescription:'Dwntwnsa.jpg',cityDescription:'San Angelo  is a city in and the county seat of Tom Green County, Texas, United States. Its location is in the Concho Valley, a region of West Texas between the Permian Basin to the northwest, Chihuahuan Desert to the southwest, Osage Plains to the northeast, and Central Texas to the southeast. According to a 2014 Census estimate, San Angelo has a total population of 98,975. The city is the principal city and center of the San Angelo metropolitan area, which has a population of 118,182.'},{airportCode:'SAT',cityName:'San Antonio, Texas',wikiUrl:'https://en.wikipedia.org/wiki/San_Antonio,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/SA_Montage_Nima.png/250px-SA_Montage_Nima.png',imgDescription:'From top to bottom and Left to Right: 1. San Antonio downtown from the Tower of The Americas at night. 2. The Riverwalk 3. The McNay Museum of Art 4. The Tower Life Building 5. Bexar County courthouse 6. San Antonio Public Library 7. The Tower of the Americas at night 8. The Alamo',cityDescription:'San Antonio , officially the City of San Antonio, is the seventh most populated city in the United States of America and the second most populated city in the state of Texas, with a population of 1,409,019. It was the fastest growing of the top 10 largest cities in the United States from 2000 to 2010, and the second from 1990 to 2000. The city is located in the American Southwest, the southcentral part of Texas, and the southwestern corner of an urban region known as the Texas Triangle.'},{airportCode:'SAN',cityName:'San Diego, California',wikiUrl:'https://en.wikipedia.org/wiki/San_Diego,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/ff/SD_Montage.jpg/250px-SD_Montage.jpg',imgDescription:'Images from top, left to right: San Diego Skyline, Coronado Bridge, museum in Balboa Park, Serra Museum in Presidio Park and the Old Point Loma lighthouse',cityDescription:'San Diego   is a major city in California, on the coast of the Pacific Ocean in Southern California, approximately 120 miles  south of Los Angeles and immediately adjacent to the border with Mexico.'},{airportCode:'QSF',cityName:'San Francisco, California',wikiUrl:'https://en.wikipedia.org/wiki/San_Francisco,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Golden_Gate_Bridge%2C_SF_%28cropped%29.jpg/250px-Golden_Gate_Bridge%2C_SF_%28cropped%29.jpg',imgDescription:'San Francisco and the Golden Gate Bridge from Marin Headlands',cityDescription:'San Francisco , officially the City and County of San Francisco, is the cultural, commercial, and financial center of Northern California and the only consolidated city-county in California. San Francisco encompasses a land area of about 46.9 square miles  on the northern end of the San Francisco Peninsula, which makes it the smallest county in the state. It has a density of about 18,187 people per square mile , making it the most densely settled large city  in the state of California and the second-most densely populated major city in the United States after New York City. San Francisco is the fourth-most populous city in California, after Los Angeles, San Diego and San Jose, and the 13th-most populous city in the United Stateswith a Census-estimated 2014 population of 852,469. The city and its surrounding areas are known as the San Francisco Bay Area, and are a part of the larger OMB designated San Jose-San Francisco-Oakland combined statistical area, the fifth most populous in the nation with an estimated population of 8.6 million.'},{airportCode:'SFO',cityName:'San Francisco, California',wikiUrl:'https://en.wikipedia.org/wiki/San_Francisco,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Golden_Gate_Bridge%2C_SF_%28cropped%29.jpg/250px-Golden_Gate_Bridge%2C_SF_%28cropped%29.jpg',imgDescription:'San Francisco and the Golden Gate Bridge from Marin Headlands',cityDescription:'San Francisco , officially the City and County of San Francisco, is the cultural, commercial, and financial center of Northern California and the only consolidated city-county in California. San Francisco encompasses a land area of about 46.9 square miles  on the northern end of the San Francisco Peninsula, which makes it the smallest county in the state. It has a density of about 18,187 people per square mile , making it the most densely settled large city  in the state of California and the second-most densely populated major city in the United States after New York City. San Francisco is the fourth-most populous city in California, after Los Angeles, San Diego and San Jose, and the 13th-most populous city in the United Stateswith a Census-estimated 2014 population of 852,469. The city and its surrounding areas are known as the San Francisco Bay Area, and are a part of the larger OMB designated San Jose-San Francisco-Oakland combined statistical area, the fifth most populous in the nation with an estimated population of 8.6 million.'},{airportCode:'SJC',cityName:'San Jose, California',wikiUrl:'https://en.wikipedia.org/wiki/San_Jose,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/SanJose_Infobox_Pic_Montage.jpg/250px-SanJose_Infobox_Pic_Montage.jpg',imgDescription:'Images, from top down, left to right: Downtown San Jose, Hotel De Anza, East San Jose suburbs, Lick Observatory, Plaza de Csar Chvez',cityDescription:'San Jose , sometimes stylized as San Jos, is the third-largest city by population in California, the tenth-largest by population in the United States, and the county seat of Santa Clara County. San Jose is the largest city within the Bay Area and the largest city in Northern California.'},{airportCode:'SBP',cityName:'San Luis Obispo, California',wikiUrl:'https://en.wikipedia.org/wiki/San_Luis_Obispo,_California',imgUrl:undefined,imgDescription:undefined,cityDescription:'San Luis Obispo  is a city in the U.S. state of California, located roughly midway between Los Angeles and San Francisco on the Central Coast.'},{airportCode:'SDP',cityName:'Sand Point, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Sand_Point,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/SDP_Aerial_2.jpg/250px-SDP_Aerial_2.jpg',imgDescription:'Sand Point from the air',cityDescription:'Sand Point, also known as Qagun Tayagungin, is a city in Aleutians East Borough, Alaska, United States. At the 2010 census the population was 976. It is located on northwestern Popof Island, one of the Shumagin Islands, off the Alaska Peninsula. It is the borough seat of Aleutians East Borough, and is located near the entrance to the Bering Sea.'},{airportCode:'SBA',cityName:'Santa Barbara, California',wikiUrl:'https://en.wikipedia.org/wiki/Santa_Barbara,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/07/Aerial-SantaBarbaraCA10-28-08.jpg/250px-Aerial-SantaBarbaraCA10-28-08.jpg',imgDescription:'The coastline of Santa Barbara',cityDescription:'Santa Barbara  is the county seat of Santa Barbara County, California. Situated on a south-facing section of coastline, the longest such section on the West Coast of the United States, the city lies between the steeply rising Santa Ynez Mountains and the Pacific Ocean. Santa Barbara\'s climate is often described as Mediterranean, and the city has been promoted as the "American Riviera". As of 2014, the city had an estimated population of 91,196, up from 88,410 in 2010, making it the second most populous city in the county after Santa Maria while the contiguous urban area, which includes the cities of Goleta and Carpinteria, along with the unincorporated regions of Isla Vista, Montecito, Mission Canyon, Hope Ranch, Summerland, and others, has an approximate population of 220,000. The population of the entire county in 2010 was 423,895.'},{airportCode:'SAF',cityName:'Santa Fe, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Santa_Fe,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Santa_Fe%2C_New_Mexico_Montage_1.png/277px-Santa_Fe%2C_New_Mexico_Montage_1.png',imgDescription:'Santa Fe\'s Downtown Area',cityDescription:'Santa Fe  is the capital of the state of New Mexico. It is the fourth-largest city in the state and is the seat of Santa Fe County.'},{airportCode:'SMX',cityName:'Santa Maria, California',wikiUrl:'https://en.wikipedia.org/wiki/Santa_Maria,_California',imgUrl:undefined,imgDescription:undefined,cityDescription:'Santa Maria is a city near the Southern California coast in Santa Barbara County. It is approximately 120 miles  northwest of Los Angeles . Its estimated 2014 population was 103,410, making it the most populous city in the county and the Santa Maria-Santa Barbara, CA Metro Area. The city is notable for its wine industry and Santa Maria-style barbecue. Sunset magazine called Santa Maria "The Wests Best BBQ Town.'},{airportCode:'STS',cityName:'Santa Rosa, California',wikiUrl:'https://en.wikipedia.org/wiki/Santa_Rosa,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Old_Courthouse_Square%2C_Downtown_Santa_Rosa_%28Smaller_Version%29.jpg/250px-Old_Courthouse_Square%2C_Downtown_Santa_Rosa_%28Smaller_Version%29.jpg',imgDescription:'Old Courthouse Square, Downtown Santa Rosa',cityDescription:'Santa Rosa is a city in and the county seat of Sonoma County, California, United States. Its estimated 2014 population was 174,170. Santa Rosa is the largest city in California\'s North Coast, Wine Country and the North Bay; the fifth most populous city in the San Francisco Bay Area after San Jose, San Francisco, Oakland, and Fremont; and the 28th most populous city in California.'},{airportCode:'SLK',cityName:'Saranac Lake, New York',wikiUrl:'https://en.wikipedia.org/wiki/Saranac_Lake,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/94/Saranac_Lake_-_Lake_Flower.jpg/250px-Saranac_Lake_-_Lake_Flower.jpg',imgDescription:'Lake Flower, from Riverside Park',cityDescription:'Saranac Lake is a village located in the state of New York, United States. As of the 2010 census, the population was 5,406. The village is named after Upper, Middle and Lower Saranac Lakes, which are nearby.'},{airportCode:'SRQ',cityName:'Sarasota, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Sarasota,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fe/Sarasota_Bay_and_waterfront%2C_Sarasota%2C_Florida_%282003%29.jpg/250px-Sarasota_Bay_and_waterfront%2C_Sarasota%2C_Florida_%282003%29.jpg',imgDescription:'Sarasota Bay and waterfront',cityDescription:'Sarasota is a city located in Sarasota County on the southwestern coast of the U.S. state of Florida. The area is renowned for its cultural and environmental amenities, beaches, resorts, connections to the Ringling family, and the Sarasota School of Architecture. The city is located in the southern end of the Tampa Bay Area, north of Fort Myers and Punta Gorda. Its current official limits include Sarasota Bay and several barrier islands between the bay and the Gulf of Mexico. According to the U.S. Census Bureau, in 2013 Sarasota had a population of 53,326. In 1986 it became designated as a certified local government. Sarasota is a principal city of the Sarasota metropolitan area, and is the seat of Sarasota County.'},{airportCode:'CIU',cityName:'Sault Ste. Marie, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Sault_Ste._Marie,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Soo_Michigan_skyline.JPG/250px-Soo_Michigan_skyline.JPG',imgDescription:'View of Sault Ste. Marie, Michigan, from the Canadian side of the river.',cityDescription:'Sault Ste. Marie  is a city in, and the county seat of, Chippewa County in the U.S. state of Michigan. It is situated on the northeastern end of Michigan\'s Upper Peninsula, on the Canadian border, and separated from its twin city of Sault Ste. Marie, Ontario, by the St. Marys River. The city is relatively isolated from other communities in Michigan and is 346 miles from Detroit. The population was 14,144 at the 2010 census, making it the second most populous city in the Upper Peninsula. By contrast, the Canadian Sault Ste. Marie is much larger, with more than 75,000 residents, based on more extensive industry developed in the 20th century and an economy with closer connections to other communities.'},{airportCode:'SAV',cityName:'Savannah, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Savannah,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/SavannahRooftopViewNW20140422.jpg/266px-SavannahRooftopViewNW20140422.jpg',imgDescription:'Downtown Savannah viewed from Bay Street',cityDescription:'Savannah  is the oldest city in the U.S. state of Georgia and is the county seat of Chatham County. Established in 1733 on the Savannah River, the city of Savannah became the British colonial capital of the Province of Georgia and later the first state capital of Georgia. A strategic port city in the American Revolution and during the American Civil War, Savannah is today an industrial center and an important Atlantic seaport. It is Georgia\'s fifth-largest city and third-largest metropolitan area.'},{airportCode:'BFF',cityName:'Scottsbluff, Nebraska',wikiUrl:'https://en.wikipedia.org/wiki/Scottsbluff,_Nebraska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/30/2010-1101-19-ScottsbluffNE.jpg/250px-2010-1101-19-ScottsbluffNE.jpg',imgDescription:'Aerial view of Scottsbluff.',cityDescription:'Scottsbluff is a city in Scotts Bluff County, in the western part of the state of Nebraska, in the Great Plains region of the United States. The population was 15,039 at the 2010 census. Scottsbluff is the largest city in the Nebraska Panhandle, and the 13th largest city in Nebraska.'},{airportCode:'SEA',cityName:'Seattle, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Seattle,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Space_Needle002.jpg/250px-Space_Needle002.jpg',imgDescription:'Downtown Seattle from Queen Anne Hill',cityDescription:'Seattle  is a West Coast seaport city and the seat of King County. With an estimated 662,400 residents as of 2015 , Seattle is the largest city in both the state of Washington and the Pacific Northwest region of North America. In July 2013 it was the fastest-growing major city in the United States, and remained in the top five in May 2015 with an annual growth rate of 2.1%. The Seattle metropolitan area of around 3.6 million inhabitants is the 15th largest metropolitan area in the United States. The city is situated on a narrow isthmus between Puget Sound  and Lake Washington, about 100 miles  south of the CanadaUnited States border. A major gateway for trade with Asia, Seattle is the third largest port in North America in terms of container handling as of 2015.'},{airportCode:'SHD',cityName:'Shenandoah Valley Airport, Virginia'},{airportCode:'SHR',cityName:'Sheridan, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Sheridan,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Sheridan.JPG/250px-Sheridan.JPG',imgDescription:'View of south Sheridan from I-90',cityDescription:'Sheridan is a city in Sheridan County, Wyoming, United States. The 2010 census put the population at 17,444 and a Micropolitan Statistical Area of 29,116. It is the county seat of Sheridan County.'},{airportCode:'SHV',cityName:'Shreveport, Louisiana',wikiUrl:'https://en.wikipedia.org/wiki/Shreveport,_Louisiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/Shreveport%2C_la.jpg/250px-Shreveport%2C_la.jpg',imgDescription:'City of Shreveport',cityDescription:'Shreveport  is the third largest city in the state of Louisiana and the 113th-largest city in the United States. It is the seat of Caddo Parish and extends along the Red River  into neighboring Bossier Parish. Bossier City is separated from Shreveport by the Red River. The population of Shreveport was 199,311 in 2010, and the Shreveport-Bossier City Metropolitan Area population exceeds 441,000. The Shreveport-Bossier City Metropolitan Statistical Area ranks 111th in the United States, according to the United States Census Bureau.'},{airportCode:'SDY',cityName:'Sidney, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Sidney,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1d/Richland_county_courthouse.jpg/250px-Richland_county_courthouse.jpg',imgDescription:'Richland County courthouse',cityDescription:'Sidney is a city in and the county seat of Richland County, Montana, United States, less than 10 mi  away from the North Dakota border. The population was 5,191 at the 2010 census. The city lies along the Yellowstone River and is in proximity to the badlands of the Dakotas. Sidney is approximately midway between Glendive, Montana and Williston, North Dakota.'},{airportCode:'SVC',cityName:'Silver City, New Mexico',wikiUrl:'https://en.wikipedia.org/wiki/Silver_City,_New_Mexico',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/ad/Silver_City_New_Mexico_City_Hall.jpg/250px-Silver_City_New_Mexico_City_Hall.jpg',imgDescription:'City Hall',cityDescription:'Silver City is a town in Grant County and the county seat. It is located in southwestern New Mexico, USA. In 2013 the population was 10,273. It is the county seat and the home of Western New Mexico University.'},{airportCode:'SUX',cityName:'Sioux City, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Sioux_City,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/Woodbury_County_Courthouse_setting_from_WNW_1.JPG/250px-Woodbury_County_Courthouse_setting_from_WNW_1.JPG',imgDescription:'Sioux City skyline.  In the center is the Woodbury County Courthouse; the clock tower at right is the city hall.',cityDescription:'Sioux City  is a city in Woodbury and Plymouth counties in the western part of the State of Iowa. The population was 82,684 in the 2010 census, which makes it the fourth largest city in Iowa. The bulk of the city is in Woodbury County, of which it is the county seat, though a small portion is in Plymouth County.'},{airportCode:'FSD',cityName:'Sioux Falls, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Sioux_Falls,_South_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Downtown_Sioux_Falls_61.jpg/250px-Downtown_Sioux_Falls_61.jpg',imgDescription:'Downtown Sioux Falls, near the intersection of 10th St. and Phillips Ave.',cityDescription:'Sioux Falls   is the largest city in the U.S. state of South Dakota. It is the county seat of Minnehaha County, and also extends into Lincoln County to the south. It is the 47th fastest-growing city in the United States and the fastest-growing metro area in South Dakota, with a population increase of 22% between 2000 and 2010.'},{airportCode:'SIT',cityName:'Sitka, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Sitka,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e3/Sitka.jpg/250px-Sitka.jpg',imgDescription:'View toward Sitka from the Pacific Ocean. Sitka is the only town in Southeast Alaska that faces the Gulf of Alaska head-on.',cityDescription:'The City and Borough of Sitka , formerly New Arkhangelsk, or New Archangel under Russian rule , is a unified city-borough located on Baranof Island and the southern half of Chichagof Island in the Alexander Archipelago of the Pacific Ocean , in the U.S. state of Alaska. As of the 2010 census, the population was 8,881. In terms of land area, it is the largest city-borough in the U.S., with a land area of 2,870.3 mi 2  and a total area  of 4,811.4 mi 2 . Urban Sitka, the part that is usually thought of as the "city" of Sitka, is situated on the west side of Baranof Island.'},{airportCode:'SGY',cityName:'Skagway, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Skagway,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/74/Skagway_aerial_view.jpg/250px-Skagway_aerial_view.jpg',imgDescription:'Aerial view of Skagway, Alaska.',cityDescription:'Skagway  is a first-class borough in Alaska on the Alaska Panhandle. As of the 2010 census, the population was 920. Estimates put the 2014 population at 1,012 people. The population doubles in the summer tourist season in order to deal with more than 900,000 visitors. It was formerly a city  first incorporated in 1900 that was re-incorporated as a borough on June 25, 2007.'},{airportCode:'SBN',cityName:'South Bend, Indiana',wikiUrl:'https://en.wikipedia.org/wiki/South_Bend,_Indiana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/43/City_of_South_Bend%2C_downtown_skyline.jpg/250px-City_of_South_Bend%2C_downtown_skyline.jpg',imgDescription:'South Bend\'s skyline from across the St. Joseph River',cityDescription:'The city of South Bend is the county seat of St. Joseph County, Indiana, United States, on the St. Joseph River near its southernmost bend, from which it derives its name. As of the 2010 census, the city had a total of 101,168 residents; its Metropolitan Statistical Area had a population of 318,586 and Combined Statistical Area of 721,296. It is the fourth-largest city in Indiana, serving as the economic and cultural hub of Northern Indiana. The highly ranked University of Notre Dame is located just to the north in unincorporated Notre Dame, Indiana and is an integral contributor to the region\'s economy.'},{airportCode:'GEG',cityName:'Spokane, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Spokane,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7d/SpokaneFromPalisades_20070614.jpg/310px-SpokaneFromPalisades_20070614.jpg',imgDescription:'Downtown Spokane, seen from Palisades Park looking east, in June 2007',cityDescription:'Spokane  is a city in the state of Washington, in the northwestern United States. It is the seat of Spokane County. It is located on the Spokane River west of the Rocky Mountain foothills in eastern Washington, 92 miles  south of the Canadian border, approximately 20 miles  from the WashingtonIdaho border, and 280 miles  east of Seattle along Interstate 90. The city and wider Inland Northwest region is served by Spokane International Airport, 5 miles  west of downtown Spokane. According to the 2010 Census, Spokane had a population of 208,916, making it the second largest city in Washington and the 102nd largest city in the United States.'},{airportCode:'SPI',cityName:'Springfield, Illinois',wikiUrl:'https://en.wikipedia.org/wiki/Springfield,_Illinois',imgUrl:undefined,imgDescription:undefined,cityDescription:'Springfield is the capital of the U.S. state of Illinois and the county seat of Sangamon County with a population of 116,250, as of the 2010 U.S. Census, making it the sixth most populated city in the state. It is the largest city in central Illinois. As of 2013, the city\'s population was estimated to have increased to 117,006, with just over 211,700 residents living in the Springfield Metropolitan Statistical Area, which includes Sangamon County and the adjacent Menard County. Present-day Springfield was first settled by European Americans in the late 1810s, around the time Illinois became a state. The most famous past resident is Abraham Lincoln, who lived in Springfield from 1837 until 1861, when he went to the White House as President. Major tourist attractions include a multitude of historic sites connected with Abraham Lincoln including his presidential museum, his home from 1837 to 1861, his tomb at Oak Ridge Cemetery, and the historical town of New Salem, with a short drive from the city.'},{airportCode:'CEF',cityName:'Springfield, Massachusetts',wikiUrl:'https://en.wikipedia.org/wiki/Springfield,_Massachusetts',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Springfield_Skyline%2C_MA.jpg/250px-Springfield_Skyline%2C_MA.jpg',imgDescription:'Springfield Skyline, MA.jpg',cityDescription:'Springfield is a city in Western New England, and the seat of Hampden County, Massachusetts, United States. Springfield sits on the eastern bank of the Connecticut River near its confluence with three rivers: the western Westfield River, the eastern Chicopee River, and the eastern Mill River. As of the 2010 Census, the city\'s population was 153,060. Metropolitan Springfield, as one of two metropolitan areas in Massachusetts , had an estimated population of 698,903 as of 2009.'},{airportCode:'SGF',cityName:'Springfield, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/Springfield,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/ParkCentralSquarefountainbyCVBCS.jpg/250px-ParkCentralSquarefountainbyCVBCS.jpg',imgDescription:'Park Central Square in Downtown Springfield',cityDescription:'Springfield is the third largest city in the state of Missouri and the county seat of Greene County. According to the 2010 census data, the population was 159,498, an increase of 5.2% since the 2000 census. It is one of the two principal cities of the Springfield-Branson Metropolitan Area, which has a population of 537,631 and includes the counties of Christian, Dallas, Greene, Polk, Webster, Stone and Taney. Springfield\'s nickname is the "Queen City of the Ozarks" and is known as the "Birthplace of Route 66". It is also home of several universities including Missouri State University, Drury University, and Evangel University.'},{airportCode:'VSF',cityName:'Springfield, Vermont',wikiUrl:'https://en.wikipedia.org/wiki/Springfield,_Vermont',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/56/EurekaSchoolhouse.JPG/250px-EurekaSchoolhouse.JPG',imgDescription:'The Eureka Schoolhouse (1790), Vermont\'s oldest one-room school',cityDescription:'Springfield is a town in Windsor County, Vermont, United States. The population was 9,373 at the 2010 census.'},{airportCode:'STC',cityName:'St. Cloud, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/St._Cloud,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/5th_Ave_Commercial_Bldgs_3.jpg/250px-5th_Ave_Commercial_Bldgs_3.jpg',imgDescription:'Buildings on 5th Avenue in downtown St. Cloud',cityDescription:'St. Cloud  is a city in the State of Minnesota and the largest population center in the state\'s central region. Its population is 66,462, according to the 2014 MN State Demographer\'s population estimates, making it Minnesota\'s ninth largest city. St. Cloud is the county seat of Stearns County and was named after the city of Saint-Cloud, France , which was named after the 6th-century French monk Clodoald.'},{airportCode:'SGU',cityName:'St. George, Utah',wikiUrl:'https://en.wikipedia.org/wiki/St._George,_Utah',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8a/Dtn_st_george.jpg/250px-Dtn_st_george.jpg',imgDescription:'Dtn st george.jpg',cityDescription:'St. George is a city located in the southwestern part of the U.S. state of Utah and is the county seat of Washington County, Utah. It is the principal city of the St. George Metropolitan Statistical Area. The city lies in the northeastern-most part of the Mojave Desert adjacent to Pine Valley Mountains, it\'s also at the convergence of three distinct geological areas; the Mojave Desert, Colorado Plateau, and Great Basin. It is 118 miles northeast of Las Vegas, Nevada and south-southwest of Salt Lake City along Interstate 15. The city is named after George A. Smith, a Church of Jesus Christ of Latter Day Saints Apostle.'},{airportCode:'STL',cityName:'St. Louis, Missouri',wikiUrl:'https://en.wikipedia.org/wiki/St._Louis,_Missouri',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/StLouisMontage.jpg/275px-StLouisMontage.jpg',imgDescription:'From top left: Forest Park Jewel Box, MetroLink at Lambert-St. Louis International Airport, Apotheosis of St. Louis at the Saint Louis Art Museum, The Gateway Arch and the St. Louis skyline, Busch Stadium, and the St. Louis Zoo',cityDescription:'St. Louis  is a city and port in the U.S. state of Missouri. The city developed along the western bank of the Mississippi River, which forms Missouri\'s border with Illinois. In 2010, St. Louis had a population of 319,294; a 2014 estimate put the population at 317,419, making it the 60th-most populous U.S. city and the second-largest city in the state in terms of city proper population. The St. Louis metropolitan area includes the city as well as nearby areas in Missouri and Illinois; with an estimated population of 2,905,893, it is the largest in Missouri and one of the largest in the United States. St. Louis was founded in 1764 by Pierre Laclde and Auguste Chouteau and named after Louis IX of France. Claimed first by the French, who settled mostly east of the Mississippi River, the region in which the city stands was ceded to Spain following France\'s defeat in the Seven Years\' War. Its territory east of the Mississippi was ceded to the Kingdom of Great Britain, the victor. The area of present-day Missouri was part of Spanish Louisiana from 1762 until 1803.'},{airportCode:'PIE',cityName:'St. Petersburg, Florida',wikiUrl:'https://en.wikipedia.org/wiki/St._Petersburg,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/0/0f/Downtown_St._Petersburg%2C_Florida.png/250px-Downtown_St._Petersburg%2C_Florida.png',imgDescription:'Downtown St. Petersburg in August 2008',cityDescription:'St. Petersburg is a city in Pinellas County, Florida, United States. As of the 2014 census estimate, the population was 253,693, making St. Petersburg the 5th most populous city in the state of Florida and the largest city in Florida that is not a county seat . St. Petersburg is the second largest city in the Tampa Bay Area, after Tampa, composed of roughly 2.8 million residents, making it the second largest Metropolitan Statistical Area in the state. It is also a popular vacation destination for both American and foreign tourists. The city is located on a peninsula between Tampa Bay and the Gulf of Mexico and is connected to mainland Florida to the north.'},{airportCode:'SCE',cityName:'State College, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/State_College,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/ThecornerSC.JPG/275px-ThecornerSC.JPG',imgDescription:'The Corner of College Avenue and Allen Street in downtown State College, taken from the gates of Campus.',cityDescription:'State College is a home rule municipality in Centre County in the state of Pennsylvania. It is currently the largest designated borough in Pennsylvania. It is the principal borough of the six municipalities comprising the State College, Pennsylvania Metropolitan Statistical Area, the largest settlement in Centre County and one of the principal cities of the greater State College-DuBois, PA Combined Statistical Area with a combined population of 236,577 as of the 2010 U.S. census. As of the 2010 census, the borough population was 42,034, with approximately 105,000 living in the borough plus the surrounding townships often referred to locally as the "Centre Region." Many of these Centre Region communities also carry a "State College, PA" address although are not specifically part of the borough of State College.'},{airportCode:'SBS',cityName:'Steamboat Springs, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Steamboat_Springs,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Steamboat_Springs_downtown.jpg/250px-Steamboat_Springs_downtown.jpg',imgDescription:'Downtown Steamboat Springs, in May 2006',cityDescription:'Steamboat Springs, often shortened as Steamboat, is a Home Rule Municipality that is the county seat and the most populous city of Routt County, Colorado, United States. As of the 2010 census, the city population was 12,088.'},{airportCode:'SUN',cityName:'Sun Valley, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Sun_Valley,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/da/Baldmountainid.jpg/250px-Baldmountainid.jpg',imgDescription:'Sun Valley, IdahoBald Mountain from Sun Valley Lake',cityDescription:'Sun Valley is a resort city in the western United States. It is within Blaine County in central Idaho. The resort is adjacent to the city of Ketchum and within the greater Wood River valley. The population was 1,406 at the 2010 census, down from 1,427 in 2000. The elevation of Sun Valley  is 5,920 feet  above sea level. The area is served by Friedman Memorial Airport in Hailey, approximately 15 miles  south. Visitors to Sun Valley are relatively close to the Sawtooth National Recreation Area, accessed over Galena Summit on Highway 75, the Sawtooth Scenic Byway.'},{airportCode:'TLH',cityName:'Tallahassee, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Tallahassee,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cd/Tallahassee_Header_for_Wikipedia_2.png/250px-Tallahassee_Header_for_Wikipedia_2.png',imgDescription:'Top, Left to Right: Tallahassee Skyline, Florida Capitol Buildings, Unconquered statue of Osceola and Renegade at FSU, FAMU\'s Marching 100, Old St. Augustine Canopy Road, and Cascades Park',cityDescription:'Tallahassee  is the capital of the U.S. state of Florida. It is the county seat and only incorporated municipality in Leon County, and is the 126th largest city in the United States. Tallahassee became the capital of Florida, then the Florida Territory, in 1824. In 2010, the population was 181,376, and the Tallahassee metropolitan area is 375,751 as of 2014. Tallahassee is the largest city in the Northwest Florida region.'},{airportCode:'TPA',cityName:'Tampa, Florida',wikiUrl:'https://en.wikipedia.org/wiki/Tampa,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8c/TampaCollection1.png/275px-TampaCollection1.png',imgDescription:'Images from top, left to right: Skyline of Downtown Tampa, Amalie Arena, Ybor City, Henry B. Plant Museum, Raymond James Stadium, Busch Gardens Tampa Bay',cityDescription:'Tampa  is a city in and the county seat of Hillsborough County, Florida, United States. It is located on the west coast of Florida on Tampa Bay, near the Gulf of Mexico, and is part of the Tampa Bay Metropolitan Area. The city had a population of 346,037 in 2011.'},{airportCode:'TXK',cityName:'Texarkana, Arkansas',wikiUrl:'https://en.wikipedia.org/wiki/Texarkana,_Arkansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/37/U.S._Courthouse_in_Texarkana_IMG_6360.jpg/250px-U.S._Courthouse_in_Texarkana_IMG_6360.jpg',imgDescription:'Texarkana federal building, including the post office and courthouse, straddling the Texas-Arkansas state line',cityDescription:'Texarkana is the largest city and the county seat of Miller County, Arkansas, United States. It is effectively one half of a city which crosses a state line  the other half, the city of Texarkana, Texas, lies on the other side of State Line Avenue.'},{airportCode:'TVF',cityName:'Thief River Falls, Minnesota',wikiUrl:'https://en.wikipedia.org/wiki/Thief_River_Falls,_Minnesota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Soo_line_depot_thief_river_falls.jpg/250px-Soo_line_depot_thief_river_falls.jpg',imgDescription:'Soo Line depot, now City Hall',cityDescription:'Thief River Falls, also called Thief River or TRF, is a city in Pennington County, Minnesota, United States. The population was 8,573 at the 2010 census. It is the county seat.'},{airportCode:'OOK',cityName:'Toksook Bay, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Toksook_Bay,_Alaska',imgUrl:undefined,imgDescription:undefined,cityDescription:'Toksook Bay   is a city and village on Nelson Island in Alaska. As of the 2010 census the population was 590, making it the largest village on the island.'},{airportCode:'TOL',cityName:'Toledo, Ohio',wikiUrl:'https://en.wikipedia.org/wiki/Toledo,_Ohio',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/Toledo_Montage.jpg/300px-Toledo_Montage.jpg',imgDescription:'Images, from top left to right: Downtown Toledo, University Hall, Toledo Museum of Art, Lucas County Courthouse, Tony Packo\'s Cafe, Anthony Wayne Bridge, Fifth Third Field',cityDescription:'Toledo  is the fourth most populous city in the U.S. state of Ohio after Cincinnati, Cleveland and Columbus, and it is the county seat of Lucas County. Toledo is in northwest Ohio, at the western end of Lake Erie, and borders the state of Michigan. The city was founded by United States citizens in 1833 on the west bank of the Maumee River, and originally incorporated as part of Monroe County, Michigan Territory. It was re-founded in 1837, after conclusion of the Toledo War, when it was incorporated in Ohio.'},{airportCode:'TOP',cityName:'Topeka, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Topeka,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e1/Topeka%2C_Kansas.JPG/250px-Topeka%2C_Kansas.JPG',imgDescription:'Topeka skyline',cityDescription:'Topeka  is the capital city of the State of Kansas and the seat of Shawnee County. It is situated along the Kansas River in the central part of Shawnee County, located in northeast Kansas, in the Central United States. As of the 2010 census, the city population was 127,473. The Topeka Metropolitan Statistical Area, which includes Shawnee, Jackson, Jefferson, Osage, and Wabaunsee counties, had a population of 233,870 in the 2010 census.'},{airportCode:'TVC',cityName:'Traverse City, Michigan',wikiUrl:'https://en.wikipedia.org/wiki/Traverse_City,_Michigan',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/c/ce/TClogo_color.GIF/110px-TClogo_color.GIF',imgDescription:'Official logo of Traverse City, Michigan',cityDescription:'Traverse City  is a city in the U.S. state of Michigan. It is the county seat of Grand Traverse County, although a small portion extends into Leelanau County. It is the largest city in the 21-county Northern Michigan region. The population was 14,674 at the 2010 census, with 143,372 in the Traverse City micropolitan area.'},{airportCode:'TTN',cityName:'Trenton, New Jersey',wikiUrl:'https://en.wikipedia.org/wiki/Trenton,_New_Jersey',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/Jon_Corzine%27s_Hole.jpg/250px-Jon_Corzine%27s_Hole.jpg',imgDescription:'Governor\'s office',cityDescription:'Trenton is the capital city of the U.S. state of New Jersey and the county seat of Mercer County, as well as briefly the former capital of the United States. The city\'s metropolitan area is grouped with the New York metropolitan area by the United States Census Bureau, but directly borders the Philadelphia metropolitan area and is part of the Federal Communications Commission\'s Philadelphia Designated Market Area. As of the 2010 United States Census, Trenton had a population of 84,913, making it the state\'s 10th-largest municipality. The Census Bureau estimated that the city\'s population was 84,034 in 2014.'},{airportCode:'TUS',cityName:'Tucson, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Tucson,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/89/TucsonDerivative.png/250px-TucsonDerivative.png',imgDescription:'From upper left: Downtown Tucson Skyline, Pima County Courthouse, Old Main, University of Arizona, Saguaro National Park, St. Augustine Cathedral, Santa Catalina Mountains',cityDescription:'Tucson  is a city in and the county seat of Pima County, Arizona, United States, and home to the University of Arizona. The 2010 United States Census put the population at 520,116, while the 2013 estimated population of the entire Tucson metropolitan statistical area  was 996,544. The Tucson MSA forms part of the larger Tucson-Nogales combined statistical area , with a total population of 980,263 as of the 2010 Census. Tucson is the second-largest populated city in Arizona behind Phoenix, which both anchor the Arizona Sun Corridor. The city is located 108 miles  southeast of Phoenix and 60 mi  north of the U.S.-Mexico border. Tucson is the 33rd largest city and the 59th largest metropolitan area in the United States. Roughly 150 Tucson companies are involved in the design and manufacture of optics and optoelectronics systems, earning Tucson the nickname Optics Valley.'},{airportCode:'TUL',cityName:'Tulsa, Oklahoma',wikiUrl:'https://en.wikipedia.org/wiki/Tulsa,_Oklahoma',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Tulsa_Skyline.jpg/250px-Tulsa_Skyline.jpg',imgDescription:'Downtown Tulsa\'s skyline in May 2008.',cityDescription:'Tulsa  is the second-largest city in the state of Oklahoma and 47th-most populous city in the United States. As of July 2014, the population was 399,682, an increase of 7,776 over that reported in the 2010 Census. It is the principal municipality of the Tulsa Metropolitan Area, a region with 961,561 residents in the MSA and 1,131,458 in the CSA. The city serves as the county seat of Tulsa County, the most densely populated county in Oklahoma, with urban development extending into Osage, Rogers, and Wagoner counties.'},{airportCode:'TUP',cityName:'Tupelo, Mississippi',wikiUrl:'https://en.wikipedia.org/wiki/Tupelo,_Mississippi',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/West_Main_Street%2C_Tupelo%2C_Mississippi_%28May_2013%29.jpg/250px-West_Main_Street%2C_Tupelo%2C_Mississippi_%28May_2013%29.jpg',imgDescription:'Main Street in Tupelo',cityDescription:'Tupelo  is the county seat and the largest city of Lee County, Mississippi. The seventh-largest city in the state, it is situated in Northeast Mississippi, between Memphis, Tennessee, and Birmingham, Alabama. It is accessed by Interstate 22 As of the 2010 census, the population was 34,546, with the surrounding counties of Lee, Pontotoc and Itawamba supporting a population of 139,671'},{airportCode:'TWF',cityName:'Twin Falls, Idaho',wikiUrl:'https://en.wikipedia.org/wiki/Twin_Falls,_Idaho',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Downtowntwinfalls.JPG/250px-Downtowntwinfalls.JPG',imgDescription:'Downtown Twin Falls',cityDescription:'Twin Falls is the county seat and largest city of Twin Falls County, Idaho, United States. The city had a population of 44,125 as of the 2010 census.'},{airportCode:'TYR',cityName:'Tyler, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Tyler,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/Tyler_TX_Montage.jpg/250px-Tyler_TX_Montage.jpg',imgDescription:'Clockwise: Tyler skyline with Plaza Tower at right and People\'s National Bank office building in center, Cotton Belt Depot, Caldwell Zoo, Chamblee Rose Garden, Smith County Courthouse, Goodman Home.',cityDescription:'Tyler is a city in and the county seat of Smith County, Texas, United States. It takes its name from President John Tyler. This city had a population of 96,900 in 2010, according to the United States Census Bureau. Tyler\'s 2014 estimated population is 107,405. It is 100 miles  east-southeast of Dallas. Tyler is the principal city of the Tyler Metropolitan Statistical Area, with a population of 209,714 in 2010, and the regional center of the Tyler-Jacksonville combined statistical area, with a population of 260,559 in 2010.'},{airportCode:'UNK',cityName:'Unalakleet, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Unalakleet,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/8/83/Unalakleet_aerial_2010.jpg/250px-Unalakleet_aerial_2010.jpg',imgDescription:'Aerial view of Unalakleet, taken 2010',cityDescription:'Unalakleet  is a city in Nome Census Area, Alaska, United States, in the western part of the state. At the 2010 census the population was 688. Unalakleet is known in the region and around Alaska for its salmon and king crab harvests; the residents rely heavily on caribou, ptarmigan, oogruk , and various salmon species. Unalakleet is also known for its aesthetic value, as it resides right next to the Bering Sea, immediately next to a large, clean river  and has trees, tundra, and hills behind it.'},{airportCode:'EGE',cityName:'Vail, Colorado',wikiUrl:'https://en.wikipedia.org/wiki/Vail,_Colorado',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/Gore_Creek_Drive_-_Vail%2C_CO.jpg/250px-Gore_Creek_Drive_-_Vail%2C_CO.jpg',imgDescription:'Gore Creek Drive in Vail Village',cityDescription:'The Town of Vail is a Home Rule Municipality in Eagle County, Colorado, United States. The population of the town was 5,305 in 2010. The town was established and built as the base village to Vail Ski Resort, with which it was originally conceived. Vail Ski Resort\'s first season was in December 1962; it is the largest ski mountain in Colorado.'},{airportCode:'VDZ',cityName:'Valdez, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Valdez,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Valdez_%283873215708%29.jpg/250px-Valdez_%283873215708%29.jpg',imgDescription:'Aerial view showing the townsite, the harbor, the lower Mineral Creek valley and Blueberry Hill.',cityDescription:'Valdez   is a city in Valdez-Cordova Census Area in the U.S. state of Alaska. According to the 2010 US Census, the population of the city is 3,976. The city is one of the most important ports in Alaska. The port of Valdez was named in 1790 after the Spanish Navy Minister Antonio Valds y Fernndez Bazn.'},{airportCode:'VLD',cityName:'Valdosta, Georgia',wikiUrl:'https://en.wikipedia.org/wiki/Valdosta,_Georgia',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a0/ValdostaCityHall.JPG/250px-ValdostaCityHall.JPG',imgDescription:'Valdosta City Hall',cityDescription:'Valdosta is a city in and the county seat of Lowndes County, Georgia, United States. As of the 2010 Census, Valdosta has a total population of 54,518, and is the 14th largest city in Georgia.'},{airportCode:'VCT',cityName:'Victoria, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Victoria,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/c/c0/Sealofvictoria.PNG/100px-Sealofvictoria.PNG',imgDescription:'Official seal of Victoria, Texas',cityDescription:'Victoria is a city in the U.S. state of Texas. It is the county seat of Victoria County. The population was 62,592 as of the 2010 census. The three counties of the Victoria Metropolitan Statistical Area had a population of 111,163 as of the 2000 census.'},{airportCode:'VIS',cityName:'Visalia, California',wikiUrl:'https://en.wikipedia.org/wiki/Visalia,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/Visalia_Acequia_Ave..JPG/250px-Visalia_Acequia_Ave..JPG',imgDescription:'Acequia Ave',cityDescription:'Visalia  is a city situated in the agricultural San Joaquin Valley of California, approximately 230 miles  southeast of San Francisco, 190 miles  north of Los Angeles, 36 miles  west of Sequoia National Park and 43 miles  miles south of Fresno. The population was 124,442 at the 2010 census.'},{airportCode:'ACT',cityName:'Waco, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Waco,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e1/WacoCity.jpg/250px-WacoCity.jpg',imgDescription:'Skyline of Waco, Texas',cityDescription:'Waco  is a city which is the county seat of McLennan County, Texas, United States. It is situated along the Brazos River and I-35, halfway between Dallas and Austin. The city had a 2010 population of 124,805, making it the 22nd-most populous city in the state. The US Census 2014 population estimate is 130,194. The Waco Metropolitan Statistical Area consists of McLennan and Falls Counties, which had a 2010 population of 234,906. Falls County was added to the Waco MSA in 2013. The US Census 2014 population estimate for the Waco MSA is 260,430.'},{airportCode:'ALW',cityName:'Walla Walla, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Walla_Walla,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/a/af/Second_and_Main_in_Walla_Walla.jpg/300px-Second_and_Main_in_Walla_Walla.jpg',imgDescription:'Reynolds-Day Building, Sterling Bank, and Baker Boyer Bank buildings in downtown Walla Walla.',cityDescription:'Walla Walla is the largest city in and the county seat of Walla Walla County, Washington, United States. The population of the city itself was 31,731 at the 2010 census. The population of Walla Walla and its two suburbs, the town of College Place and unincorporated "East Walla Walla," is about 45,000. Walla Walla is in the southeastern region of Washington, approximately four and a half hours away by car from Portland, Oregon, and Seattle, Washington, and thirteen miles north of the Oregon border.'},{airportCode:'ALO',cityName:'Waterloo, Iowa',wikiUrl:'https://en.wikipedia.org/wiki/Waterloo,_Iowa',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7c/Downtown_Waterloo_North_Side_2006.jpg/260px-Downtown_Waterloo_North_Side_2006.jpg',imgDescription:'East Side of Downtown Waterloofrom the West bank of the Cedar River.',cityDescription:'Waterloo is a city in and the county seat of Black Hawk County, Iowa, United States. As of the 2010 United States Census the population decreased by 0.5% to 68,406; a recent 2014 Census estimates the population at 68,364, making it the sixth-largest city in the state. Waterloo is part of the Waterloo  Cedar Falls Metropolitan Statistical Area, and is the more populous of the two cities.'},{airportCode:'ART',cityName:'Watertown, New York',wikiUrl:'https://en.wikipedia.org/wiki/Watertown,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Publicsquareeast2008.JPG/250px-Publicsquareeast2008.JPG',imgDescription:'Watertown public square',cityDescription:'Watertown is a city in the state of New York and the county seat of Jefferson County. It is situated approximately 20 miles  south of the Thousand Islands, and 70 miles north of Syracuse, NY. As of the 2010 census, it had a population of 27,023, an increase of 1.2% since 2000. The U.S. Army post Fort Drum is near the city.'},{airportCode:'ATY',cityName:'Watertown, South Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Watertown,_South_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/2/22/Redlin_Art_Center.jpg/250px-Redlin_Art_Center.jpg',imgDescription:'Intersection of Interstate 29 and Highway 212: The Redlin Art Center',cityDescription:'Watertown is a city in and the county seat of Codington County, South Dakota, United States. The population was 21,482 at the 2010 census. It is the fifth largest city in South Dakota. It is also the principal city of the Watertown Micropolitan Statistical Area, which includes all of Codington and Hamlin counties.'},{airportCode:'CWA',cityName:'Wausau, Wisconsin',wikiUrl:'https://en.wikipedia.org/wiki/Wausau,_Wisconsin',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/2009-0620-WI017-Wausau-400block.jpg/250px-2009-0620-WI017-Wausau-400block.jpg',imgDescription:'Downtown Wausau skyline',cityDescription:'Wausau is a city in and the county seat of Marathon County, Wisconsin, United States. The Wisconsin River divides the city into east and west. The city is adjacent to the Town of Wausau.'},{airportCode:'EAT',cityName:'Wenatchee, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Wenatchee,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5b/Wenatchee_WA_2009.jpg/250px-Wenatchee_WA_2009.jpg',imgDescription:'Skyline of Wenatchee, 2009',cityDescription:'Wenatchee  is a city located in north-central Washington and is the largest city and county seat of Chelan County, Washington, United States. The population within the city limits in 2010 was 31,925. In 2014, the Office of Financial Management estimated the population at 33,070. Located at the confluence of the Columbia and Wenatchee rivers near the eastern foothills of the Cascade Range, Wenatchee lies on the western side of the Columbia River, across from the city of East Wenatchee. The Columbia River forms the boundary between Chelan and Douglas County. Wenatchee is the principal city of the "WenatcheeEast Wenatchee, Washington Metropolitan Statistical Area", which encompasses all of Chelan and Douglas counties . However, the \'Wenatchee Valley Area\' generally refers to the land between Rocky Reach and Rock Island Dam on both banks of the Columbia, which includes East Wenatchee, Rock Island, and Malaga.'},{airportCode:'PBI',cityName:'West Palm Beach, Florida',wikiUrl:'https://en.wikipedia.org/wiki/West_Palm_Beach,_Florida',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/West_Palm_Beach_Aerial_November_2014_photo_D_Ramey_Logan.jpg/250px-West_Palm_Beach_Aerial_November_2014_photo_D_Ramey_Logan.jpg',imgDescription:'West Palm Beach Aerial November 2014',cityDescription:'West Palm Beach is a city in and the county seat of Palm Beach County, Florida, United States. It is one of the three main cities in South Florida. The population was 99,919 at the 2010 census. The University of Florida Bureau of Economic and Business Research  estimates a 2014 population of 104,031, a 4.1% increase from 2010. It is the oldest municipality in the South Florida metropolitan area, having been incorporated as a city two years before Miami in November 1894. West Palm Beach is located approximately 68 miles  north of Downtown Miami.'},{airportCode:'WYS',cityName:'West Yellowstone, Montana',wikiUrl:'https://en.wikipedia.org/wiki/West_Yellowstone,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/Westyellowstone.jpg/250px-Westyellowstone.jpg',imgDescription:'Yellowstone Avenue in winter',cityDescription:'West Yellowstone is a town in Gallatin County, Montana, adjacent to Yellowstone National Park. The population was 1,271 at the 2010 census. The town is served by Yellowstone Airport. It is part of the Bozeman, MT Micropolitan Statistical Area. It was founded in June 1908 when the Oregon Short Line Railroad was completed. The town\'s name changed several times until West Yellowstone was settled upon in 1920.'},{airportCode:'HPN',cityName:'White Plains, New York',wikiUrl:'https://en.wikipedia.org/wiki/White_Plains,_New_York',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/bb/City_of_White_Plains%2C_Jul_2012.jpg/250px-City_of_White_Plains%2C_Jul_2012.jpg',imgDescription:'The White Plains skyline',cityDescription:'White Plains is a city in Westchester County, New York. It is the county seat and commercial hub of Westchester, an affluent suburban county that is home to almost one million people, just north of New York City. White Plains is located in south-central Westchester, with its downtown about 7 miles  east of the Hudson River and 7 miles  northwest of the Long Island Sound. It is bordered to the north by the town of North Castle, to the north and east by the townvillage of Scarsdale, and to the west by the town of Greenburgh.'},{airportCode:'SPS',cityName:'Wichita Falls, Texas',wikiUrl:'https://en.wikipedia.org/wiki/Wichita_Falls,_Texas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/Revised_photo_of_%22The_Falls%22_at_Wichita_Falls%2C_TX_IMG_6918.JPG/250px-Revised_photo_of_%22The_Falls%22_at_Wichita_Falls%2C_TX_IMG_6918.JPG',imgDescription:'The restored "Falls" of the Wichita River in Wichita Falls, Texas, off Interstate 44',cityDescription:'Wichita Falls is a city in and the county seat of Wichita County, Texas, United States. Wichita Falls is the principal city of the Wichita Falls Metropolitan Statistical Area, which encompasses all of Archer, Clay and Wichita counties. According to the 2010 census, the city had a population of 104,553 making it the twenty-ninth most populous city in the state of Texas. In addition to Sheppard Air Force Base, Wichita Falls is also home to the Newby-McMahon Building, constructed downtown in 1919 and since known as the "world\'s littlest skyscraper".'},{airportCode:'ICT',cityName:'Wichita, Kansas',wikiUrl:'https://en.wikipedia.org/wiki/Wichita,_Kansas',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Wichita-ks.jpg/250px-Wichita-ks.jpg',imgDescription:'Downtown Wichita',cityDescription:'Wichita  WICH--taw is the largest city in the State of Kansas and the 49th-largest city in the United States. Located in south-central Kansas on the Arkansas River, Wichita is the county seat of Sedgwick County and the principal city of the Wichita metropolitan area. As of the 2010 United States Census, the city population was 382,368; as of 2014, it was estimated to have increased to 388,413. In 2014, the estimated population of the Wichita metropolitan area was 641,076, and that of the larger Wichita-Winfield combined statistical area was 673,598.'},{airportCode:'AVP',cityName:'Wilkes-Barre, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Wilkes-Barre,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/Wilkes_Barre_Downtown.jpg/265px-Wilkes_Barre_Downtown.jpg',imgDescription:'Downtown Wilkes-Barre, looking west from Giants Despair',cityDescription:'Wilkes-Barre  is a city in the Commonwealth of Pennsylvania and the county seat of Luzerne County. It is one of the principal cities in the ScrantonWilkes-BarreHazleton, PA Metropolitan Statistical Area. Located at the center of the Wyoming Valley it is second only to the nearby city of Scranton. The ScrantonWilkes-BarreHazleton, PA Metropolitan Statistical Area had a population of 563,631 as of the 2010 Census making it the fourth largest metro/statistical area in the state of Pennsylvania. Wilkes-Barre and the surrounding Wyoming Valley are framed by the Pocono Mountains to the east, the Endless Mountains to the west and the Lehigh Valley to the south. The Susquehanna River flows through the center of the valley and defines the northwestern border of the city.'},{airportCode:'IPT',cityName:'Williamsport, Pennsylvania',wikiUrl:'https://en.wikipedia.org/wiki/Williamsport,_Pennsylvania',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0f/West_4th_Street_between_Court_and_Market_Streets_Williamsport.jpg/275px-West_4th_Street_between_Court_and_Market_Streets_Williamsport.jpg',imgDescription:'West 4th Street in Downtown Williamsport (2014)',cityDescription:'Williamsport is a city in and the county seat of Lycoming County, Pennsylvania, United States. In 2009, the population was estimated at 29,304. It is the principal city of the Williamsport, Pennsylvania Metropolitan Statistical Area, which has a population of about 117,000.'},{airportCode:'ISN',cityName:'Williston, North Dakota',wikiUrl:'https://en.wikipedia.org/wiki/Williston,_North_Dakota',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Williston%2C_North_Dakota_10-18-2008.jpg/250px-Williston%2C_North_Dakota_10-18-2008.jpg',imgDescription:'Business district of Williston',cityDescription:'Williston is a city in and the county seat of Williams County, North Dakota, United States. The 2010 census gave its population as 14,716, and the Census Bureau gave the 2013 estimated population as 20,850, making Williston the sixth largest city in North Dakota. The North Dakota oil boom is largely responsible for the sharp increase in population.'},{airportCode:'ILG',cityName:'Wilmington, Delaware',wikiUrl:'https://en.wikipedia.org/wiki/Wilmington,_Delaware',imgUrl:undefined,imgDescription:undefined,cityDescription:'Wilmington  is the largest city in the state of Delaware, United States, built on the site of Fort Christina, the first Swedish settlement in North America. It is located at the confluence of the Christina River and Brandywine Creek, near where the Christina flows into the Delaware River. It is the county seat of New Castle County and one of the major cities in the Delaware Valley metropolitan area. Wilmington was named by Proprietor Thomas Penn after his friend Spencer Compton, Earl of Wilmington, who was prime minister in the reign of George II of Great Britain.'},{airportCode:'ILM',cityName:'Wilmington, North Carolina'},{airportCode:'OLF',cityName:'Wolf Point, Montana',wikiUrl:'https://en.wikipedia.org/wiki/Wolf_Point,_Montana',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Roosevelt_County_MT_Courthouse.jpg/250px-Roosevelt_County_MT_Courthouse.jpg',imgDescription:'Roosevelt County Courthouse in Wolf Point',cityDescription:'Wolf Point is a city in and the county seat of Roosevelt County, Montana, United States. The population was 2,621 at the 2010 census. It is the largest community on the Fort Peck Indian Reservation. Wolf Point is the home of the annual Wild Horse Stampede, held every year during the second weekend of July. Wolf Point\'s Wild Horse Stampede is the oldest rodeo in Montana, and has been called the "Grandaddy of Montana Rodeos".'},{airportCode:'WRL',cityName:'Worland, Wyoming',wikiUrl:'https://en.wikipedia.org/wiki/Worland,_Wyoming',imgUrl:'https://upload.wikimedia.org/wikipedia/en/thumb/9/99/Worland.png/100px-Worland.png',imgDescription:'Official seal of Worland, Wyoming',cityDescription:'Worland is a city in Washakie County, Wyoming, United States. The population was 5,487 at the 2010 census. It is the county seat of Washakie County. It is located within the Big Horn Basin and along the Big Horn River in northwestern Wyoming'},{airportCode:'WRG',cityName:'Wrangell, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Wrangell,_Alaska',imgUrl:undefined,imgDescription:undefined,cityDescription:'The City and Borough of Wrangell  is a borough in the U.S. state of Alaska. As of the 2010 census the population was 2,369. Incorporated as a Unified Home Rule Borough on May 30, 2008, Wrangell was previously a city in the Wrangell-Petersburg Census Area ). Its Tlingit name is aachxaana.akw . The Tlingit people residing in the Wrangell area, who were there centuries before Europeans, call themselves the Shtaxhen wan after the nearby Stikine River. Alternately they use the autonym Shxt wan, where the meaning of shxt is unknown.'},{airportCode:'YKM',cityName:'Yakima, Washington',wikiUrl:'https://en.wikipedia.org/wiki/Yakima,_Washington',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ee/Yakima%2C_Washington_-_40th_Ave_looking_south_from_Lookout_Point.jpg/300px-Yakima%2C_Washington_-_40th_Ave_looking_south_from_Lookout_Point.jpg',imgDescription:'Yakima viewed from Lookout Point',cityDescription:'Yakima  is a US city located about 60 miles southeast of Mount Rainier in Washington. Yakima is the county seat of Yakima County, Washington, and the state\'s ninth largest city by population. As of the 2010 census, the city had a total population of 91,067 and a metropolitan population of 243,231. The unincorporated suburban areas of West Valley and Terrace Heights are considered a part of greater Yakima.'},{airportCode:'YAK',cityName:'Yakutat, Alaska',wikiUrl:'https://en.wikipedia.org/wiki/Yakutat,_Alaska',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Yakutat-Bay01.jpg/250px-Yakutat-Bay01.jpg',imgDescription:'Yakutat Bay',cityDescription:'The City and Borough of Yakutat   is a borough in the U.S. state of Alaska. Incorporated as a non-unified Home Rule Borough on September 22, 1992, Yakutat was previously a city in the Skagway-Yakutat-Angoon Census Area . The name is Tlingit, Yaakwdat  but it originally derives from an Eyak name diyaqudat and was influenced by the Tlingit word yaakw .'},{airportCode:'YUM',cityName:'Yuma, Arizona',wikiUrl:'https://en.wikipedia.org/wiki/Yuma,_Arizona',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/9/9b/Gowan_Company_Building_Yuma_Arizona.jpg/250px-Gowan_Company_Building_Yuma_Arizona.jpg',imgDescription:'Old Yuma Post Office',cityDescription:'Yuma  is a city in and the county seat of Yuma County, Arizona, United States. It is located in the southwestern corner of the state, and the population of the city was 93,064 at the 2010 census, up from the 2000 census population of 77,515.'},{airportCode:'LAX',cityName:'Los Angeles, California',wikiUrl:'https://en.wikipedia.org/wiki/Los_Angeles,_California',imgUrl:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/57/LA_Skyline_Mountains2.jpg/266px-LA_Skyline_Mountains2.jpg',imgDescription:'Los Angeles skyline',cityDescription:'Los Angeles  , officially the City of Los Angeles and often known by its initials L.A., is the second-largest city in the United States after New York City, the most populous city in the U.S. state of California, and the county seat of Los Angeles County. Situated in Southern California, Los Angeles is known for its mediterranean climate, ethnic diversity, sprawling metropolis, and as a major center of the American entertainment industry. Los Angeles lies in a large coastal basin surrounded on three sides by mountains reaching up to and over 10,000 feet .'}]; // module.exports = [
